lar actividades concuerda con el período del tipo de beca','Adecua el tiempo para desarrollar las actividades según el período que otorga la beca de investigaci',1,49,'2014-11-06 07:32:33'),(5,2,'Las compras requeridas se planifican según la','Las compras requeridas se planifican según la actividas a realizar.',1,49,'2014-11-06 07:32:33'),(5,3,'Recibos y tarjeta de identidad de servicios técnicos','Recibos y tarjeta de identidad de servicios técnicos',1,49,'2014-11-06 07:32:33'),(6,1,'Se identifican los recursos necesarios para desarrollar la actividad','Se identifican los recursos (humanos, materiales o financieros) necesarios para desarrollar la activ',1,49,'2014-11-06 07:32:33'),(6,2,'Los desembolsos están de acuerdo a las activi','Los desembolsos están de acuerdo a las actividades planificadas.',1,49,'2014-11-06 07:32:33'),(6,3,'Realizó las compras mayores a L. 7,000 con orden exonerada','Realizó las compras mayores a L. 7,000 con orden exonerada',1,49,'2014-11-06 07:32:33'),(7,1,'Relación entre la metodología de la investigación y las actividades planificadas','Relación entre la metodología de la investigación y las actividades planificadas',1,49,'2014-11-06 07:32:33'),(7,2,'Los gastos administrativos sobrepasan del 20%','Los gastos administrativos sobrepasan del 20% del mismo (pago de personal administrativo, papelería, tintas, etc).',1,49,'2014-11-06 07:32:33'),(7,3,'Adjunta constancia de inventario de compra de equipo','Adjunta constancia de inventario de compra de equipo',1,49,'2014-11-06 07:32:33'),(8,1,'Periodos de tiempo específicos para conocer los tiempos exactos','Periodos de tiempo son suficientemente específicos para conocer los tiempos exactos (días invertidos',1,49,'2014-11-06 07:32:33'),(8,2,'Las compras se planifican con el tiempo suficiente para trámite de exoneraciones y dispensas','Las compras se planifican con el tiempo suficiente para el trámite de exoneraciones y de dispensas.',1,49,'2014-11-06 07:32:33'),(8,3,'Adjunta voucher de cheque de