INSERT INTO `bec_observacion_general_evaluaciones_tecnicas` (`cod_observacion_general_tecnica`, `anio_beca`, `cod_convocatoria`, `cod_beca`, `cod_actividad`, `cod_sub_actividad`, `cod_evaluacion`, `observacion_general_tecnica`, `user_insert`, `date_insert`) VALUES (1,2015,2,7,'A',1,1,'Un estudio bastante interesante.',19,'2015-05-26 16:51:16'),(2,2015,2,1,'A',1,3,'El proyecto se necesita readecuarlo, ya que muestra un elevado nivel de similitud con documentos de la OMS lo cual se puede interpretar como plagio.',37,'2015-06-04 19:36:31'),(2,2015,2,2,'A',1,2,'Necesita readecuar el proyecto, muestra muchas limitaciones.',37,'2015-06-04 20:01:03'),(2,2015,2,3,'A',1,2,'No se explica la novedad del estudio. Me parece que anteriormente ya se habÃ­a realizado una investigaciÃ³n similar.',45,'2015-06-01 20:01:50'),(2,2015,2,4,'A',1,4,'',37,'2015-06-08 15:22:05'),(2,2015,2,5,'A',1,3,'Revisar presupuesto, el 40% del financiamiento es para participar en eventos (Congreso nacional e internacional).',37,'2015-06-08 15:46:17'),(2,2015,2,7,'A',1,2,'Es un trabajo que pretende conocer la forma en que las plantas nativas desde la astrobiologia, presenta una argumentacion en terminos tecnicos sostenida, tal vez mejorar algo en la redaccion del documento.',30,'2015-05-30 00:45:33'),(2,2015,2,8,'A',1,2,'Revisar la pertinencia del proyecto de investigación, este es un tema que se ha estudiado mucho en la UNAH (revisar cuantas becas de investigación se han otorgado sobre este tema).\nEl presupuesto es muy débil en su concepción.',37,'2015-06-08 18:16:13'),(2,2015,2,9,'A',1,2,'',36,'2015-06-04 16:36:18'),(2,2015,2,10,'A',1,2,'Si bien el objetivo general está redactado de forma adecuada, el estudio no tiene pertinencia, ya que el tema se ha investigado mucho y de acuerdo a la propuesta no genera conocimiento nuevo.\nPor otra parte, analizar impacto implica la revisión y análisis de muchas variables, no solamente las exportaciones y precios, el enfoque del estudio debería ser replanteado.\nRevisar presupuesto, ya que el 80% es destinado para pago de transporte y asesor metodológico, cuando el estudio se basa en información secundaria',37,'2015-06-09 05:02:03'),(2,2015,2,11,'A',1,2,'La pregunta de investigaciÃ³n debe ir al final del planteamiento del problema, no en la metodologÃ­a de investigaciÃ³n.  ESTE PROYECTO TIENE UNA EXCELENTE FUNDAMENTACIÃ“N TEÃ“RICA, LO CUAL ES  VALIOSO CONSIDERANDO QUE  EN ESTE APARTADO  HAY GRANDES  DEBILIDADES   EN LA MAYORÃA DE LOS  PROYECTOS DE INVESTIGACIÃ“N.',36,'2015-06-04 15:50:05'),(2,2015,2,12,'A',1,2,'Explicar el impacto en la poblaciÃ³n de esta investigaciÃ³n.',35,'2015-06-05 16:04:12'),(2,2015,2,14,'A',1,1,'',45,'2015-06-01 21:35:00'),(2,2015,2,16,'A',1,2,'La definiciÃ³n del problema debe hacerse desde lo general a lo especÃ­fico, argumentando porque lo que se quiere estudiar constituye un problema de investigaciÃ³n.\nSe dice que es una investigaciÃ³n con enfoque mixto, pero todos sus objetivos hablan de evaluar, medir y cuantificar.\nEn la justificaciÃ³n, debe justificarse el proyecto de investigaciÃ³n y no la importancia del uso de energÃ­a solar.',45,'2015-06-02 17:01:42'),(2,2015,2,18,'A',1,1,'No se respeto la estructura del Modelo de Proyectos de InvestigaciÃ³n de la DICYP.\nNo presenta un planteamiento del problema contundente que fundamente bien porque el tema es un problema de investigaciÃ³n.\nEl tÃ­tulo y el objetivo general plantea que se estudiara el acceso, entrada y permanencia en la educaciÃ³n superior, pero en lo metodologÃ­a se dice que se trabajarÃ¡ en educaciÃ³n media, esto no es congruente. Con respecto a esto se plantean tres momentos y en ninguno de ellos se habla de consultar en educaciÃ³n superior sobre la permanencia y el rendimiento.\nEn el objetivo general se habla de contextos y dinÃ¡micas, esto no se ve reflejado en los objetivos especÃ­ficos.',45,'2015-06-02 19:31:04'),(2,2015,2,22,'A',1,2,'El planteamiento (definiciÃ³n del problema es muy pobre) casi todo lo que se incluye en ese apartado pertenece a la justificaciÃ³n.\nEn general se presenta mucha informaciÃ³n y muchas afirmaciones de las cuales no se cita la fuente.',45,'2015-06-02 20:55:10'),(2,2015,2,26,'A',1,3,'No son congruentes el tÃ­tulo y el objetivo general. En el tÃ­tulo se dice que se pretende caracterizar molÃ©culas de ADN y en el objetivo general se habla de contruir y validar teorÃ­as fÃ­sicas. Por otro lado, en la descripciÃ³n del poyecto dice que se harÃ¡ algo completamente distinto, modelar cadenas cortas de ADN.\nNo se describen casi ninguno de los aspectos metodolÃ³gicos indispensables como las el tipo de diseÃ±o de investigaciÃ³n, las variables a estudiar, el plan de anÃ¡lisis, etc.',45,'2015-06-03 18:04:08'),(2,2015,2,28,'A',1,2,'En general es un anteproyecto muy pobre, no coincide el tema con los objetivos y metodolÃ³gicamente no se describe casi nada. El apartado de Marco TeÃ³rico no incluye ninguna teorÃ­a.',45,'2015-06-03 19:32:30'),(2,2015,2,30,'A',1,1,'No presenta un planteamiento del problema claro, no argumenta ni fundamenta porque es necesario crear modelos para los piscicultores y si ellos realmente los necesitan. No se describe absolutamente nada de los aspectos metodolÃ³gicos de la investigaciÃ³n.\nLas referencias bibliogrÃ¡ficas enumeradas al final del documento no aparecen citadas en el cuerpo del documento.',45,'2015-06-03 21:18:11'),(2,2015,2,31,'A',1,2,'',36,'2015-06-04 16:38:07'),(2,2015,2,32,'A',1,2,'Tiene un planteamiento del problema muy pobre y sin fundamentación (no tiene citas) de los pocos datos que se presentan. Se debe profundizar en las estadísticas que existen acerca del problema que se quiere investigar.\nSe plantea que la investigación es mixta, por lo tanto deben describirse los dos diseños metodológicos, el cuantitativo y el cualitativo.',45,'2015-06-08 16:19:51'),(2,2015,2,34,'A',1,1,'DeberÃ¡: 1. Mejorar la definiciÃ³n del problema 2. Definir la metodologÃ­a 3. Mejorar objetivo general',35,'2015-06-02 18:04:01'),(2,2015,2,35,'A',1,3,'',35,'2015-06-03 19:16:55'),(2,2015,2,36,'A',1,3,'',35,'2015-06-03 19:21:33'),(2,2015,2,37,'A',1,2,'',36,'2015-06-01 19:42:28'),(2,2015,2,38,'A',1,2,'',36,'2015-06-01 19:44:00'),(2,2015,2,39,'A',1,2,'',36,'2015-06-01 19:45:50'),(2,2015,2,40,'A',1,2,'',36,'2015-06-01 19:46:10'),(2,2015,2,41,'A',1,2,'',36,'2015-06-01 19:46:27'),(2,2015,2,43,'A',1,2,'1. El objetivo general no representa a los objetivos especÃ­ficos.2. DeberÃ¡ escribir nuevamente el apartado de metodologÃ­a que contenga:a. Enfoque b. Tipo de investigaciÃ³n c. Alcance del estudio d. HipÃ³tesis (segÃºn alcance) e. Matriz segÃºn tipo de investigaciÃ³n f. plan de anÃ¡lisis de la informaciÃ³n recolectada.\n3. Se sugiere la informaciÃ³n recolectada pertenezca a la UNAH y solicite permiso para divulgaciÃ³n pues puede ser utilizada para fines comerciales lucrativos y no para beneficio del paÃ­s',35,'2015-06-03 17:19:11'),(2,2015,2,45,'A',1,3,'Es un estudio metodologicamente bien planteado, solamente se debe corregir lo indicado en las obsrvaciones.',45,'2015-06-08 20:12:14'),(2,2015,2,46,'A',1,1,'Denota sesgo la investigaciÃ³n puesto que plantean afirmaciones de lo que se va a investigar. La muestra es no probabilistica y el estudio es cuantitativo.',35,'2015-06-04 20:07:40'),(2,2015,2,48,'A',1,2,'1. Los objetivos específicos no están planteados como objetivos de investigación.2. En la metodología deberán realizar una matriz de operacionalización de variables y explicar como se determinó la muestra. 3. Detallar más el presupuesto.',35,'2015-06-08 16:26:31'),(2,2015,2,49,'A',1,2,'El título no corresponde a lo que se explica en el cuerpo del informe.\nEn lo metodológico, no puede decir que es cualitativo y exploratorio, puesto que esta última categoría corresponde a los estudios cuantitativos de tipo no experimental.\nLe faltan muchos elementos para explicar la metodología.',45,'2015-06-09 17:53:26'),(3,2015,2,2,'A',1,3,'1. Definir mejor el problema , citar adecuadamente. 2.Determinar la muestra',35,'2015-06-08 17:05:47'),(3,2015,2,3,'A',1,3,'Recomendar que hacer con los desechos sÃ³lidos reciclables y reutilizables ( No sÃ³lo cuantifica)',3,'2015-06-08 15:18:36'),(3,2015,2,7,'A',1,3,'En todo el documento presenta informaciÃ³n y afirmaciones que claramente fueron obtenidas de otros documentos y por lo tanto debe citar la respectiva fuente.\nDe igual manera, en la fundamentaciÃ³n metodolÃ³gica se hacen afirmaciones y no se cita la fuente de donde se obtuvieron.\nDebe aclarar que la muestra es intencionada debido a que el diseÃ±o es de tipo experimental.',45,'2015-06-01 21:04:12'),(3,2015,2,34,'A',1,2,'El planteamiento del problema es muy pobre, no se argumentan los hechos o sucesos específicos que dan lugar a la investigación.\nEn la justificación, se justifica la necesidad de producción pero no la investigación. Debe justificar el estudio en función de la novedad, relevancia, pertinencia, beneficios y benficiarios del estudio, valor teórico, utilidad práctica, factibilidad y viabilidad.\nCasi todo lo que se presenta en el Marco Teórico, principalmente lo de los primeros tres párrafos estaría mejor incluirlo en el planteamiento del problema. Presenta un marco teórico muy pobre en el que no se incluye ni siquiera las referencias al estado actual del tema de investigación del cual se puede encontrar mucha información en internet. Inclusive estudios ya realizados en méxico y otros países sobre la biología reproductiva de estas especies.\nEn general el proyecto presenta muchas deficiencias en los aspectos metodológicos. Por otro lado, se dice que no existen muchas investigaciones sobre el tema, sin embargo se realizó la busqueda en internet y se encontraron varios estudios relacionados con la biología reproductiva de ambas especies.',45,'2015-06-08 17:49:01'),(3,2015,2,37,'A',1,3,'',35,'2015-06-03 19:24:54'),(3,2015,2,38,'A',1,3,'',35,'2015-06-03 19:27:11'),(3,2015,2,39,'A',1,3,'',35,'2015-06-04 14:21:39'),(3,2015,2,40,'A',1,3,'1. DeberÃ¡ determinar la metodologÃ­a a utilizar 2.Los objetivos estÃ¡n enmarcados en la investigaciÃ³n macro, determinar sÃ³lo en esta zona del paÃ­s.',35,'2015-06-03 18:13:18'),(3,2015,2,41,'A',1,3,'',35,'2015-06-04 14:24:23'),(3,2015,2,43,'A',1,3,'El título, el planteamiento del problema y todo el proyecto en general están formulados como un proyecto de intervención y no como un proyecto de investigación.\nPresenta un Marco Teórico muy pobre, no se incluyen teorías ni se explica ninguna variable que se quiera estudiar.\nNo se explica nada de la metodología de investigación.',45,'2015-06-08 19:47:26'),(3,2015,2,46,'A',1,2,'Debe mejorarse el planteamiento del problema incluyendo hechos y datos que aclaren porque lo que se quiere estudiar es un problema de investigación.\nDebe mejorarse la fundamentación metodológica incluyendo los aspectos indicados en las observaciones.',45,'2015-06-09 17:11:25'),(3,2015,2,48,'A',1,3,'En casi todo el proyecto lo que se vuelve relevante es la necesidad de contar con un Banco Genético y no se plantea cuál es el vacio teórico que se pretende cubrir.\nEsta planteado más como un proyecto de intervención que como un proyecto de investigación.',45,'2015-06-09 17:36:27');
