INSERT INTO `con_bitacora_evaluacion` (`cod_participacion`, `cod_bitacora`, `cod_evaluacion`, `cod_estado_anterior`, `cod_estado_actual`, `flag_evaluacion_anterior`, `flag_evaluacion_actual`, `observacion_general`, `user_insert`, `date_insert`) VALUES (65,1,1,2,2,1,0,'',35,'2015-06-25 20:13:16'),(72,1,1,2,2,1,0,'',35,'2015-06-25 20:44:49'),(75,1,1,2,2,1,0,'La descripción está muy escueta, deberá ampliar para ser tomada en cuenta.',35,'2015-06-26 19:15:40'),(88,1,1,2,2,1,0,'',39,'2015-06-25 17:08:58'),(89,1,1,2,2,1,0,'',39,'2015-06-25 17:31:03'),(90,1,1,2,2,1,0,'',39,'2015-06-25 17:46:40'),(95,1,1,2,2,1,0,'',39,'2015-06-25 17:58:02'),(96,1,1,2,2,1,0,'',39,'2015-06-25 18:07:36'),(111,1,1,2,2,1,0,'En general hay problema con lo que se llama numero de paginas en la bibliografía, la gente está poniendo el numero total de paginas de la revista o el numero donde inicia el articulo, pero no cuantas paginas tiene el articulo...ademas el numero de paginas solo se debería de pedir para cuando son artículos de revistas y no para los libros',19,'2015-06-26 23:26:22'),(112,1,1,2,2,1,0,'Hace falta incluir en el resumen cual es la zona de estudio, no queda claro si eso se hará en Honduras o en otro país. En el numero de paginas escribieron el total de paginas que tiene la revista y no los números en los que se ubica la ponencia. Solo hay tres referencias bibliograficas',19,'2015-06-26 22:48:01'),(114,1,1,2,2,1,0,'Hay que ver la parte de la normativa empleada...eso no se puede vislumbrar en el formato que se está usando. Y ver lo del numero de paginas',19,'2015-06-27 00:44:15'),(115,1,1,2,2,1,0,'Solo una cuestóin de forma, los nombres de los participantes algunos están con mayúsculas y otros con minusculas',NULL,'2015-06-27 14:28:21'),(124,1,1,2,2,1,0,'',37,'2015-06-28 03:28:43'),(134,1,1,2,2,1,0,'',37,'2015-06-28 03:54:40'),(138,1,1,2,2,1,0,'',37,'2015-06-28 04:04:31'),(141,1,1,2,2,1,0,'',24,'2015-06-25 18:57:51'),(168,1,1,2,2,1,0,'',24,'2015-06-25 19:10:35'),(173,1,1,2,2,1,0,'Al ser una Mesa de Trabajo, se espera la presentación de un diseño o avance de investigación; no es necesaria la presentación de conclusiones. ',24,'2015-06-25 19:21:55'),(175,1,1,2,2,1,0,'El instrumento para la ',24,'2015-06-26 19:36:46'),(179,1,1,2,2,1,0,'',24,'2015-06-26 15:37:27'),(181,1,1,2,2,1,0,'Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui.',66,'2015-06-24 18:00:02'),(182,1,1,2,2,1,0,'Se encuentra un ALTO GRADO DE SIMILITUD con el estudio \"Posición antero posterior del hueso hioides en los biotipos faciales\" de Valenzuela Alvarez, Sebastián Patricio (2008), no citado entre las referencias bibliográficas. ',24,'2015-06-26 17:46:22'),(216,1,1,2,2,1,0,'',19,'2015-06-27 15:17:42'),(227,1,1,2,2,1,0,'',19,'2015-06-27 15:23:41');
