INSERT INTO `con_participaciones` (`cod_participacion`, `cod_tipo_participacion`, `con_congreso`, `titulo_participacion`, `resumen`, `palabras_claves`, `cod_rango_horario`, `cod_coordinador`, `cod_modulo`, `cod_flujo`, `cod_modulo_flujo`, `cod_estado`, `cod_sala`, `fecha`, `asistencia_estimada`, `con_comentarios_generales`, `cod_usuario_denegacion`, `observacion_denegada`, `flag_evaluacion`, `flag_correo_observaciones`, `date_insert`) VALUES (47,2,1,'Actitud hacia la estadística por parte de estudiantes de Medición Psicológica de la UNAH','La presente investigación tuvo como objetivo principal conocer la actitud hacia la estadística, por parte de los estudiantes cursando las clases de Medición Psicológica, de la UNAH-CU, durante el primer período académico de 2015. El abordaje se realizó con un enfoque cuantitativo de alcance descriptivo. Para ello se tomó una muestra de 316 alumnos a los cuales se les aplicó la Escala de Actitudes hacia la Estadística (Auzmendi, 1992), versión validada por Tejero & Castro (2011). Los resultados indican que el 16% de los sujetos manifiestan una actitud negativa hacia la estadística, mientras que el 43% de los alumnos se muestra indiferentes ante ella y el 41% tienden a tener actitudes favorables hacia tal disciplina.\nEl análisis por factores indica que existe resistencia por parte del alumno a involucrarse en asignaciones con carga estadística. Por otro lado, se reconoce la utilidad de la estadística en la psicología, pero existe renuencia a involucrarse personalmente en faenas relacionadas a ella. Se encontró que la actitud hacia la estadística no varía en función a la asignatura que cursa el alumno. Finalmente se concluye que, dentro de la muestra de estudio,  los hombres tienden a mostrar una mejor actitud hacia la estadística que las mujeres.','Actitudes Psicología Estadística Psicometría',1,187,11,1,11,1,1,'0000-00-00',50,'',NULL,NULL,0,0,'2015-05-13 20:11:13'),(48,2,1,'El sismo M7.3 de agosto 27 dos mil doce como evidencia de acoplamiento sismico debil en la zona de subducción en C.A.','Las zonas de subducción exhiben grados variables de acoplamiento intersísmico como se muestra por inversiones de datos geodésicos y los análisis de la liberación de energía sísmica. El grado en el que se acopla un límite de placas puede tener efectos profundos en el comportamiento sismogénico. En este trabajo usamos mediciones GPS para estimar la deformación co-sísmica y post-sísmica del Terremoto Mw7.3 ocurrido el 27 de agosto 2012 frente a las costas de El Salvador, terremoto que produjo tsunami. Inversión de desplazamientos co-sísmicos estimados están de acuerdo con los modelos publicados previamente, que indican poca profundidad (<20 km de profundidad) en la ruptura de la interfaz de la placa.  Nuestro análisis indica que la deformación post-sísmica está dominado por afterslip, en contraposición a relajación viscosa. Sugerimos que el movimiento post-sísmico excesivo es característico para el segmento de la zona de subduciión en El Salvador - Nicaragua y puede ser una característica de los márgenes tectónicos que producen terremotos capaces de generar tsunami.','Terremotos GPS tsunamis',2,105,11,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-05-15 22:02:54'),(50,2,1,'Satisfacción con la educación recibida en estudiantes de grado en Ciudad Universitaria de la UNAH','El nivel de satisfacción que tienen los estudiantes durante su proceso de formación es un aspecto de suma importancia para tener idea de la calidad percibida sobre la educación brindada, en ese sentido, el objetivo de la investigación fue determinar el nivel de satisfacción con la educación recibida de los estudiantes de grado en la modalidad presencial en Ciudad Universitaria de la Universidad Nacional Autónoma de Honduras durante el primer período académico del 2015. El enfoque metodológico fue de tipo cuantitativo. Se utilizó un diseño no experimental de tipo transeccional, descriptivo y correlacional. El universo constó de 48,854 estudiantes y el tamaño de la muestra fue de 381. El tipo de muestreo es probabilístico, trietápico y estratificado. Se aplicó el Cuestionario para valorar la Satisfacción de los Estudiantes Universitarios con la Educación (SEUE) elaborado por Gento y Vivas (2003).\n\nSe encontró, en promedio, un nivel de satisfacción estudiantil de 3.23 (en una escala de 0 a 5), que equivale a un 64.55 por ciento y se ubica en el rango de satisfacción alto, lo que significa que en promedio los alumnos están satisfechos. También se encontró, que en los estudiantes no existe relación entre la satisfacción con la educación y la edad, el número de clases aprobadas y el índice académico global. Tampoco existen diferencias entre la variable de estudio y el sexo, la institución de educación media de la que se graduaron, sea pública o privada, y la jornada en la que matriculan las clases (matutina, vespertina o mixta).','Satisfacción Educación Calidad Estudiantes Universitarios',2,284,11,1,11,1,1,NULL,30,'',NULL,NULL,0,0,'2015-05-19 18:06:53'),(51,5,1,'Importancia Macroeconómica del Sector Agropecuario','Con esta investigación se ha podido constatar que la importancia estratégica del sector agropecuario, por su contribución a la economía en su conjunto, que le ha dado soporte de estabilidad en el tiempo, al incorporar amplias masas de la población rural al proceso productivo, que a pesar de no tener los servicios de apoyo complementarios sigue contribuyendo con un alto porcentaje en la conformación del Producto Interno Bruto (PIB).\nLas relaciones intersectoriales e interfactoriales han mostrado que la agricultura campesina e indígena ha venido sufriendo un proceso de desarticulación, desde que se impulsan los programas de ajuste en el que se le ha dado primacía a la agricultura industrial orientada hacia el mercado externo. A pesar del alto potencial del sector agropecuario, los indicadores macroeconómicos reflejan que el excedente económico real es inferir al potencial, lo que limita la acumulación de capital e impide las transferencias productivas hacia los demás sectores, limitando con ello la expansión de la propia agricultura con efectos negativos para la seguridad alimentaria, el desarrollo del mercado interno y reduciendo los excedentes exportables.','Sector Agropecuario macroeconomia desarticulacion campesina  relaciones intersectoriales y interfactoriales',2,285,11,1,11,1,1,NULL,10,'',NULL,NULL,0,0,'2015-05-20 14:21:09'),(52,2,1,'Arte Rupestre de Valle y Choluteca','Arte Rupestre en Valle y Choluteca\nUna de las preguntas más difíciles de responder sobre el arte rupestre es la de su significado. Teniendo en cuenta la imposibilidad actual de saber qué grupo humano realizó tal o cual figura, quién la hizo o qué contexto permitió su elaboración, llegar a suponer lo que buscaba plasmar el artista, es una tarea difícil. Incluso, algunos investigadores proponen que ante la dificultad de tener acceso a los contextos de elaboración, que serían los que dan al arte, su respectivo significado. Es imposible una traducción cultural en nuestros propios términos, que permita llegar a una explicación adecuada de su significado. La mayoría de los sitios con muestras de arte rupestre que existen en los departamentos de Choluteca y Valle, además de no estar debidamente identificados, carecen de la más mínima protección; lo que los pone en serio riesgo de ser dañados e incluso de ser destruidos, con las consecuencias respectivas para el proceso de construcción de la historia de Honduras. Esto constituye una situación problema que merece el mejor de los esfuerzos para disminuirlo y así propiciar un mayor conocimiento y protección del patrimonio cultural legado por nuestros antepasados en Honduras. Encontrando posibles alineamientos de los sitios estudiados con astros y reconstruyendo la historia antigua aun pendiente de esta región.','Arte rupestre Grupo etnico Cueva Alineamiento Fitomorfo Antropomorfo Zoomorfo Astromorfo Meteomorfo',3,292,11,1,11,1,1,NULL,50,'',NULL,NULL,0,0,'2015-05-20 22:37:07'),(53,2,1,'Sacrificios en la Civilizacion Maya','Los sacrificio practicados en la civilizacion maya, constituyeron actos con un significado propio de la cultura maya, con variantes de preferencia en el individuo sacrificado, segun el momento historico por el que pasaban; desde los sacrificios de prisioneros de guerra, sacrificios de ninos y jovenes, sacrificio de animales y hasta los autosacrificio. Constituian eventos con un fuerte componente ritual, mediante el cual se le pedia a los Dioses la proteccion de la comunidad ante catastrofes naturales y antropicas como la sequia, el hambre y la guerra. Estos actos rituales de sacrificio en sus diferentes variantes las dejaron plasmadas los artistas mayas en la ceramica y las pinturas murales encontradas por los investigadores de esta gran civilizacion.','Sacrifio Autosacrificio Sacrificio de animales Prisioneros Venados',3,292,11,1,11,6,2,'2015-06-27',50,'',NULL,NULL,0,0,'2015-05-20 23:00:06'),(54,2,1,'Regulaciones para el Ejercicio de la Docencia en Ciencias de la Cultura Física en Honduras','Se presentara la investigación realizada en base a la Ley  de Colegiacion Obligatoria en Honduras a la comunidad de Educadores Físicos.\n En el Pais no Existe un ente que regule el Ejercicio profesional en esta área del conocimiento,  es un tema de mucha relevancia entre los profesionales involucrados en este saber,  desde hace años se ha hablado de un Colegio de Educadores Fisicos, pero nadie ha hecho las respectivas investigaciones, y en este congreso se presentara la primera investigación realizada en Honduras sobre este tema.','Colegiacion Profesionales No profesionales Empirismo',2,296,11,1,11,6,2,'2015-06-26',50,'',NULL,NULL,0,0,'2015-05-21 17:31:51'),(55,2,1,'Evaluación del Nivel de Satisfacción o Insatisfacción de los Estudiantes del Sistema Educativo Publico y Privado del Ciclo Común hacia la Asignatura de Educación Física en la Ciudad de Tegucigalpa.','El estudio realizado en la ciudad de Tegucigalpa sobre el nivel de satisfacción o insatisfacción de los estudiantes del sistema educativo público y privado hacia la asignatura de Educación Física,  comprendió en si un análisis al problema que se presenta en los estudiantes al momento del desarrollo de la clase, uno de los temas abordados fue el de la Motivación,  aspecto vital en el desarrollo de cualquier actividad, en resumen existen dos tipos de motivación; la Motivación Intrínseca la cual busca una satisfacción propia por realizar la actividad y la Motivación Extrínseca que es condicionada por un estímulo externo como ser una medalla, dinero etc.\nEl problema resulta en los grandes grupos y la poca atenccion que se logra obtener por parte del estudiantado, y como el nivel de satisfaccion esta condicionado por la calidad y la preparacion del profesional que imparte la asignatura. de esto emana la Investigacion sobre la Ley de colegiacion Obligatoria en Honduras y su aplicacion al campo de la Educacion Fisica.','Motivación Satisfacción Insatisfacción',1,296,11,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-05-21 17:42:18'),(57,5,1,'Efecto de la intensidad  de luz, tipo y densidad de alimento en la primera alimentación de la cabrilla sardinera.','La cabrilla sardinera es una especie endémica del Pacífico mexicano, de importancia en la pesca comercial, deportiva y con un alto potencial en la acuicultura. El presente evaluó el efecto de la intensidad de luz, el tipo y densidad de presa en la sobrevivencia de la cabrilla sardinera en el periodo de su primera alimentación durante su desarrollo larvario. Se evaluaron los siguientes tipos de alimento: rotífero tamizado a 75 µm, trocoforas de bivalvo (Crassostrea gigas), la mescla de ambos alimentos y un testigo con larvas en ayuno. La intensidad de luz fue de 500 lux, La densidad de siembra fue de 100 huevos por litro y se obtuvo una eclosión 55.7 %. El alimento fue proporcionado  a las larvas a partir del tercer día posterior a la eclosión.  La densidad de presas que se manejo en el experimento fue  de (5 trocoforas/ ml) dos veces al día cada 12 horas, (3 rotíferos/ ml) tres veces al día cada 6 horas y la mezcla de ambos. No se observaron diferencias significativas (P>0.05) en la sobrevivencia de las larvas alimentadas con las diferentes dietas evaluadas a los 4 y 6 (DPE); en el 8 (DPE) se observaron diferencias significativas (P<0.05) en los organismos alimentados con trocoforas que presentaron una mayor sobrevivencia y el testigo que presento una sobrevivencia de 0.','desarrollo larvario',2,299,11,1,11,1,1,NULL,15,'',NULL,NULL,0,0,'2015-05-21 21:37:32'),(59,5,1,'Cómo afecta el Alto Empirismo en la Cadena de Valor y Suministro del Servicio Hotelero en Honduras','La presente investigación tiene como objetivo el evidenciar los distintos efectos generados por el uso de practicas empiricas de gestión del servicio hotelero a lo largo de la Cadena de Valor y Suministro del mismo, de igual manera, este analisis tiene a bien la descripción integral de la Cadena de Valor y Suministro del rubro hotelero como tal, a modo de determinar los coellos de botellas y excesos en los tiempos predeterminados de gestión.\nCabe mencionar que en este analisis se mapean las causalidades que estimulan el detrimento operativo en las empresas del sector Hotelero, asi como la descripción del grado de empirismo que conlleva a frenar la adopción de buenas practicas en este sistema de negocios.','Cadena de Valor y Suministro Empirismo Buenas Practicas Deficiencia Operativa',1,277,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-22 15:34:26'),(60,5,1,'El Factoraje una salida para las MIPymes del Sector Hotelero en Honduras','El ?confirming? es un instrumento de financiamiento que el tejido empresarial puede utilizar para atender necesidades de capital de corto plazo, de gestión de cuentas por pagar y coberturas de riesgo crediticio, entre otros servicios. \nLas dificultades de acceso al crédito, dadas las alarmas de riesgo país, dificultan a la banca comercial el otorgamiento de préstamos para apalancar el emprendedurismo y las distintas dificultades que conlleva el cumulo de deudas a los acreedores, que merman la liquidez de estas iniciativas de negocio, sin embargo hoy en día, existe una fuerte tendencia de los estados a intervenir en el marco de la protección de los sectores productivos clave del pais,. \nEl presente análisis,  tiene a bien describir la temática denominada como confirming Financiero, explorar sus métricas, sus dimensiones, así como la identificación de productos similares a confirming en el contexto Hondureño local. Señalando sus bondades y condicionantes, los cuales deberán de ser evaluados por la empresas, al momento de requerir este tipo de servicios','Tercerización Confirming Riesgo Deuda',2,277,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-22 15:50:46'),(61,5,1,'El Confirming La Mejor alternativa financiera para mantener la liquidez del sector turismo en Honduras','El ?confirming? es un instrumento de financiamiento que el tejido empresarial puede utilizar para atender necesidades de capital de corto plazo, de gestión de cuentas por pagar y coberturas de riesgo crediticio, entre otros servicios. \nLas dificultades de acceso al crédito, dadas las alarmas de riesgo país, dificultan a la banca comercial el otorgamiento de préstamos para apalancar el emprendedurismo y las distintas dificultades que conlleva el cumulo de deudas a los acreedores, que merman la liquidez de estas iniciativas de negocio, sin embargo hoy en día, existe una fuerte tendencia de los estados a intervenir en el marco de la protección de los sectores productivos clave del pais,. \nEl presente análisis, se ampara tiene a bien describir la temática denominada como confirming Financiero, explorar sus métricas, sus dimensiones, así como la identificación de productos similares a confirming en el contexto Hondureño local. Señalando sus bondades y condicionantes, los cuales deberán de ser evaluados por la empresas, al momento de requerir este tipo de servicios.','Tercerización Deuda Confirming Riesgo',1,277,11,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-22 16:08:38'),(62,2,1,'Revisión de la Inclusión Social en la regulación Energética en América Latina y El Caribe','El presente trabajo muestra el análisis de la situación actual de la inclusión social en el marco regulatorio del sector energía de América Latina y El Caribe, AL&C. Se muestra un resumen de la situación de los grupos étnicos, la brecha de género, las personas de la tercera edad y personas con discapacidad en la región. Luego se analiza la situación energética de la región, con énfasis en la oferta y demanda de energía así como el potencial energético visto desde la perspectiva de producción/consumo de petróleo, gas natural, biocombustibles y electricidad. Dos fuentes primarias de energía se han elegido (petróleo y gas natural) y dos fuentes secundarias (biocombustibles y electricidad), dado que se consideran los elementos más importantes en la dinámica de producción/consumo de energía en la región. Una vez obtenido el panorama general de la situación social y el estado de la producción/consumo de energía en la región, se establecen algunas observaciones, recomendaciones y conclusiones.','Regulación Energética',3,307,11,1,11,2,1,NULL,35,'',NULL,NULL,0,0,'2015-05-22 17:09:16'),(64,2,1,'Actitud hacia la estadística por parte de estudiantes de Medición Psicológica de la CU UNAH','La presente investigación tuvo como objetivo principal conocer la actitud hacia la estadística, por parte de los estudiantes cursando las clases de Medición Psicológica, de la UNAH-CU, durante el primer período académico de 2015. El abordaje se realizó con un enfoque cuantitativo de alcance descriptivo. Para ello se tomó una muestra de 316 alumnos a los cuales se les aplicó la Escala de Actitudes hacia la Estadística (Auzmendi, 1992), versión validada por Tejero & Castro (2011). Los resultados indican que el 16% de los sujetos manifiestan una actitud negativa hacia la estadística, mientras que el 43% de los alumnos se muestra indiferentes ante ella y el 41% tienden a tener actitudes favorables hacia tal disciplina.\nEl análisis por factores indica que existe resistencia por parte del alumno a involucrarse en asignaciones con carga estadística. Por otro lado, se reconoce la utilidad de la estadística en la psicología, pero existe renuencia a involucrarse personalmente en faenas relacionadas a ella. Se encontró que la actitud hacia la estadística no varía en función a la asignatura que cursa el alumno. Finalmente se concluye que, dentro de la muestra de estudio,  los hombres tienden a mostrar una mejor actitud hacia la estadística que las mujeres.','Psicología Psicometría Actitud Estadística',1,187,7,1,11,1,1,NULL,40,'',NULL,NULL,0,0,'2015-05-23 20:37:17'),(65,4,1,'Bienestar Subjetivo como Indicador de Desarrollo Humano en el Municipio de Tatumbla','La presente investigación en curso tiene como objetivo describir el Bienestar Subjetivo de los habitantes del municipio de Tatumbla, durante el último trimestre de 2015. Específicamente pretende: \n?	Identificar los factores que componen el Bienestar Subjetivo en los habitantes del municipio de Tatumbla, durante el último trimestre de 2015.\n?	Describir la percepción de Bienestar Subjetivo en los habitantes del municipio de Tatumbla, durante el último trimestre de 2015. \n?	Identificar la relación entre Bienestar Subjetivo e ingreso personal, en habitantes del municipio de Tatumbla, durante el último trimestre de 2015. \n?	Identificar la relación entre Bienestar Subjetivo y variables demográficos, en habitantes del municipio de Tatumbla, durante el último trimestre de 2015. \n\nEl fin último de la economía y de la distribución de recursos es lograr el bienestar humano, en cuanto a lo material y lo inmaterial (Banguero, 2004). Por lo tanto, es de fundamental relevancia establecer mediciones que permitan visibilizar el Bienestar Subjetivo de las poblaciones humanas. Dicho elemento ofrece un punto de partida para determinar la satisfacción de los individuos respecto a su vida. Tal información servirá para identificar los distintos elementos que conforman el Bienestar Subjetivo, discriminando así entre los factores que fomentan o limitan dicha condición. \nTal conocimiento será de beneficio directo para los habitantes y dirigentes municipales de Tatumbla. Extensivamente, la metodología para la medición del Bienestar Subjetivo, podrá ser de utilidad para demás comunidades de Honduras. Este abordaje servirá como complemento para evaluar el impacto de distintas estrategias y programas, de manera que tales datos puedan integrar los resultados de métricas económicas. \nEsto ofrecerá pautas estratégicas que permitan elevar la condición humana, por medio de la  formación de políticas públicas orientadas al bienestar colectivo. La medición del Bienestar Subjetivo es vital para el diseño de políticas públicas, así como para monitorear y asesorar su implementación (Dolan, Layard, & Metcalfe, 2011). Considerando la accesibilidad geográfica del municipio de Tatumbla, sumado a la anuencia de las autoridades locales para promover proyectos de investigación, se supone la factibilidad y viabilidad del presente estudio.','Bienestar subjetivo desarrollo humano felicidad',3,187,7,1,11,3,1,NULL,30,'',NULL,NULL,1,0,'2015-05-23 21:29:41'),(66,2,1,'EFECTO DE LA HARINA DE MORRO COMO INGREDIENTE PROTEÍNICO PARA LA ALIMENTACIÓN DE TILAPIA','El cultivo de la tilapia generó en Honduras 70 millones de dólares en el año 2014 posicionando al país como el primer exportador de filete fresco de tilapia en el mundo. La tilapia es un cultivo de fácil manejo sin embargo el 60% de los costos totales de producción es alimentación, las dietas balanceadas se mantienen al alza debido al incremento de algunos insumos como las harinas de pescado, soya y maíz, los acuicultores buscan fuentes alternativas de proteína que abarate costos de alimentación y la harina de morro puede ser una opción. El estudio se realizó en el Centro de Investigación Acuícola Pesquero, se usaron cuatro tanques de concreto con 1.86 m3 de capacidad, en cada tanque se sembraron 45 tilapias (24.2 peces por m3) a un peso inicial de 5 g y se cosecharon 256 días después. Los peces fueron alimentados con una dieta balanceada al 28% de PC y una dieta experimental a base de sorgo, melaza y morro (82.7%) con 28% de PC. Se evaluaron indicadores de desempeño y relación biométrica. Los peces alimentados con la dieta balanceada mostraron mejores resultados en los indicadores de desempeño, los peces alimentados con la dieta experimental la ganancia diaria de peso fue menor (P>0.0356). Se encontraron los peces con mayor longitud y peso los alimentados con la dieta comercial, en los dos tratamientos se observó una alta correlación entre longitud y peso (r>0.90). La harina de morro puede usarse como ingrediente de proteína con la inclusión de alimentos ricos en los aminoácidos de lisina, metionina y treonina.','dieta balanceada',1,265,7,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-24 01:18:53'),(67,2,1,'COMPARACIÓN DE TRES SALINIDADES PARA EVALUAR EL CRECIMIENTO POBLACIONAL DE LA MICROALGA Chaetoceros muelleri','En la región sur de Honduras existen ocho laboratorios que producen 6,400 millones de post-larva de camarón por año, las microalgas son usadas como alimento vivo en la cría de post-larva de camarón, por el potencial de crecimiento y valor nutricional, la especia de preferencia es la Chaetocera muelleri. Los laboratorios manejan sus propios protocolos de cultivo masivo de microalgas adaptados de otros países y desconocen el efecto de la salinidad para optimizar el crecimiento de la microalga Chaetoceros muelleri. El objetivo del estudio fue comparar tres concentraciones de sal para conocer el efecto de la salinidad sobre el crecimiento de la microalga y encontrar un modelo estadístico que ayude a predecir poblaciones de microalgas. El estudio se realizó en un laboratorio de producción de post-larva de camarón en la comunidad de Cedeño, Choluteca. Se usaron tres concentraciones de salinidad (7000, 20000 y 34000 ppm) como medio de cultivo a una densidad de 470000 cel/cm3 de inóculo y cosechando al cuarto día después de la siembra, se analizaron 108 unidades experimentales. El mayor crecimiento de las microalgas se desarrolla a 20000 ppm de sal a la densidad promedio de 3.85x106 cel/cm3, a la salinidad de 7000 ppm el crecimiento de las microalgas fue el menor. Es posible predecir poblaciones de microalgas usando un modelo de relación confiable (R2=0.91) contribuyendo a optimizar los procesos de operación para los productores de post-larva de camarón.','Microalgas',2,265,7,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-24 04:23:01'),(69,5,1,'La Cultura Política de los Universitarios, como eje transversal de la Democracia','El tema de este proyecto de investigación articula dos campos de estudio. El primero refiere al campo teórico de las orientaciones sociales y políticas; el segundo refiere a un sector social: el mundo de los estudiantes universitarios. Más particularmente, este proyecto dirige su atención a los jóvenes universitarios del: Centro Universitario Tecnológico de San Pedro Sula (CUTEC SAP).\nSe tomó como caso de estudio a los jóvenes universitarios en el campus CEUTEC San Pedro Sula. En búsqueda de factores que condicionan la Cultura Política de los jóvenes, se valoran variables de tipo subjetivas y socio-demográficas, tales como orientaciones políticas, religión, tolerancia, adhesión al régimen, etc. Estas variables forman parte del mundo joven, no obstante, se encuentran en el medio nacional pocos antecedentes de investigaciones previas relacionadas con este tema.','Cultura Política Adhesión Democrática Confianza Institucional',3,283,7,1,11,1,1,NULL,5,'',NULL,NULL,0,0,'2015-05-25 14:28:20'),(70,5,1,'La Demografia Empresaial del Sector Hotelero en Honduras, una tendencia que evita la alza de la mortalidad empresarial.','La presente investigación de corte descriptivo, tiene a bien diaganosticar el alcance del fenomeno de la Demografia Empresarial del Sector Hotelero de Honduras y de como esta tendencia se esta  reproduciendo entre los pequeños  y medianos emprendedores, los cuales condicionan sus propuestas y modelos de negocio, en acorde a : La Saturación del Mercado, Barreras Comerciales, Monopolización del Sector, Logistica de Adquisiciones, Seguridad y Oportunidades de Venta.\n\nDestacando que mas haya de explorar y describir la problematica de la mortalidad empresarial como tal del Sector Hotelero en Honduras, se exploraran las causalidades que originan el mismo. En este analisis se describen los actores que de forma directa y/o indirecta participan y se ven obligados a trabajar en conjunto para estimular el crecimiento del emprendedurismo, la generación de empleos y por ende la mitigación de la pobreza en el pais.','Mortalidad MIPYMEs Ciclo de Vida Emprendedurismo',2,277,11,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-25 15:26:02'),(71,5,1,'Las Bondades de un Observatorio de MIPYMEs a nivel Sectorial en el Pais','El presente analisis tiene a bien describir las bondades de la creación de un Observatorio de MIPYMEs, a traves de la creación de un marco referencial, basado en la gestión exitosa del IESALC, asi como de otras instancias a nivel Latino Americano, que orientan hacia el cumplimiento de las buenas practicas en la gestión adecuada de los observatorios academicos, el cuales definen las entradas ,procesos, salidas, indicadores e involucrados en esta gestión.\n\nDenotando que con la creación de estas unidades a nivel de la Educación Superior s estimula:\n*La Internacionalización de la Educación Superior.\n*La Efectiva Gestión de la Información, tanto a nivel teorico como aplicado.\n*El analisis efectivo de los fenomenos economicos, sociales y culturales, con el uso del Think Tanks.\n*Entre otros elementos.\n\nFinalmente se concluye que ene efecto es viable, a nivel investigativo el desarrollo de Observatorios de las MIPYMEs, dado que favorece el acercamiento entre la academia y el empresariado.\nDiagnostica las condiciones de riesgo para de esta forma estimular el emprendimiento en el pais y representa una plataforma gestora de analisis universal para distintas tematicas de orden social, financiero, cultura, politico, etc.','Demografia Empresarial Mortalidad Empresarial Emprendimiento Sector Hotelero',2,277,11,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-25 15:55:33'),(72,5,1,'El Grado de Empirismo en la Aplicación de la Manufactura Esbelta  en el Sector Hotelero Hondureño','El presente documento respresenta un consolidado de  la evidencia empirica atinente a la gestión efectiva de la aplicación de las buenas practicas, contemporaneas dictaminadas por aquellas empresas denominadas de clase mundial en el rubro/sector.\nEn este analisis se evaluan los Indicadores Clave de Rendimiento, asi como las causalidades de todos aquellas anomalias actuales relevantes para el sector Hotelero en Honduras, que evidencian la clara desaplicación de las practicas estandares de gestión hotelera a nivel mundial, asi como la sostenibilidad de estas empresas en el tiempo.\n\nPor otro lado, se exploran las condiciones sobre las cuales se gestiona el sector hotelero y las distintas dificultades que conlleva invertir en este modelo de negocios en Honduras, concluyendo que en este analisis se evidenciara la no utilización de metricas, instrumentos e indicadores que automaticen y homologuen los patrones de servicios ofrecidos por las MIPYMEs Hondureñas en el sector Hotelero.','Manufactura Lean Emprirismo Buenas Practicas Empresas de Clase Mundial',2,277,11,1,11,3,1,NULL,30,'',NULL,NULL,1,0,'2015-05-25 16:22:19'),(75,3,1,'Adopción de métrica V3 para ciclo de vida de Sistemas de información','Entender el mundo actual y como funciona es una labor compleja, día con día fronteras geográficas/virtuales (acceso, cobertura, etc.) que antes marcaban con facilidad los límites de las áreas de conocimiento se van reduciendo lo que dificulta en muchas formas el dominio de las materias y en otras hacen necesario el uso de recursos informáticos para desarrollo de los procesos que de ellas se derivan. Lo anterior pone de manifiesto como los procedimientos son complejos, las herramientas de software que apoyan a los mismos pueden también llegar a serlo.\n\nEn tal sentido, los avances y descubrimientos aún no han podido invalidar la necesidad de una metodología que permita a especialistas en Tecnologías de la información y Comunicación desarrollar de manera eficaz y eficiente el ciclo de vida en el desarrollo de sistemas de información y, así como existen metodologías también concurren expertos, ambos orientados a particularidades para proponer soluciones y, siendo nuestro contexto la academia, se vuelve determinante la difusión de tales métricas a fin de contribuir en la transferencia de conocimientos.    \n\nEn virtud de lo anterior, los resultados obtenidos, así como generalidades de la metodología y la conclusión con base a nuestra experiencia son los contenidos de éste  trabajo.','Metrica desarrollo de sistemas',1,179,7,1,11,3,1,NULL,11,'La descripción está muy escueta, deberá ampliar para ser tomada en cuenta.',NULL,NULL,1,0,'2015-05-25 17:36:20'),(76,4,1,'Percepción y Caracterización del Desarrollo en las Comunidades de Carrizalón, Copán Ruinas y La Campa, Lempira de la Región','La investigación que se realiza con el nombre de ?Percepción y Caracterización del Desarrollo en las Comunidades El Carrizalón, Copán Ruinas y La Campa, Lempira de la Región Occidental de Honduras?, pretende hacer una valoración de los principales significantes y significados (imágenes, símbolos, signos, conceptos, ideas, etc.) que culturalmente están presentes en las poblaciones Chortí y Lenca de esta región del país. La idea de desarrollo ha estado en profundo cuestionamiento en las últimas décadas, es un concepto dinámico, adaptable, pegajoso, polisémico y polémico, que según algunos críticos, se ha implantado bajo una ideología o proyecto de dominación económico y cultural. Por tal razón, nuestro propósito es comprender desde la gente y principalmente desde los gestores del desarrollo de las comunidades El Carrizalón, Copán Ruinas y La Campa Lempira, qué se está entendiendo por desarrollo, cómo lo percibe la población o cómo lo define, cómo se realiza su gestión. Todo ello posibilitará el encuentro con esa búsqueda de respuestas del porqué la región occidental de Honduras sigue tan desigual como nunca. La elección de estas comunidades se debe principalmente al número de población Chortí y Lenca que habitan en ellas, pero también, cómo estas nociones de desarrollo se han implementado y de qué forma han sido aceptadas por estas comunidades ancestrales.','Desarrollo, Región, Occidental, Pobreza, Cooperación, Crecimiento, Percepción, Caracterización.',2,245,9,1,11,2,1,NULL,40,'',NULL,NULL,0,0,'2015-05-25 21:54:22'),(77,5,1,'Estudio Arqueoastronómíco en el Sitio Arqueológico de Yarumela','El estudio del sitio arqueológico de Yarumela  surge como una iniciativa para  seguir avanzando en las investigaciones de tipo Arqueoastronómíco y de esta forma tener mayor  conocimiento de nuestras culturas antepasadas y la utilización del movimiento aparente del sol para la orientación de sus estructuras, para este estudio se  utilizo la información arqueológica Hondureña, se desarrollo un estudio de campo, del Sitio Arqueológico de Yarumela, se realizó,  una revisión   bibliográfica de otros investigadores, se muestran fotos e imágenes  del  sitio arqueológico y de sus estructuras. Se realizó un plano topográfico y un mapa georreferenciado para determinar la orientación entre las estructuras, con la cual se obtuvo tablas comparativas  de las coordenadas de algunas estructuras de Yarumela,  tablas del acimut entre las estructuras y se hicieron cálculos de geometría  para determinar el acimut  de la salida del sol por el horizonte en los diferentes eventos solares midiendo la altura de las montañas y así determinar si hay algún alineamiento Arqueoastronómíco entre las estructuras y la salida  del sol en los eventos solares, equinoccios y solsticios.','sitios arqueológicos Arqueoastronomía alineamientos orientación acimut equinoccios solsticios',2,327,11,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-26 17:50:13'),(78,3,1,'Vinculación entre la investigación Histórica y la Protección del Patrimonio Cultural Construido.','Las investigaciones históricas que se presentarán, constituyen ejemplos de los diversos tipos de procesos que se llevan a cabo para valorar y categorizar el Patrimonio Cultural construido. Estas investigaciones son necesarias para garantizar la mejor aplicación de la Ley para la Protección del Patrimonio Cutlral de la Nación (Decreto 220-97). \nPresentaremos los siguientes casos, con los que esperamos que estos sitios sean potenciados como elementos indispensables para impulsar la investigación y divulgación de la Historia nacional, fomentando asi la Identidad Nacional y alentando la participación ciudadana en la búsqueda de solciones para la problematica de nuestro país :\n1. Parque La Concordia:  El parque La Concordia fue el primer espacio público de Tegucigalpa que nació bajo la función de parque durante la Reforma Liberal. Brinda testimonio de dos momentos políticos y sociales importante dentro de la historia republicana de Honduras: el inicio de la  Reforma Liberal mencionada, cuyas políticas se vieron reflejadas en la intervención y construcción de espacios públicos bajo los lemas de Concordia y Libertad, brindando tributo a ?héroes nacionales?, y el de la dictadura del General Tiburcio Carías Andino, quien profundizó las políticas estatales para forjar la ?identidad nacional maya?, tomando en cuenta que durante su gobierno se impulsaron las investigaciones arqueológicas de las ruinas de Copan, a través de universidades norteamericanas. Durante el gobierno de Carías, La Concordia se convierte en un ?Jardín Maya?, brindándosele la configuración urbana y arquitectónica actual.  Este espacio publico se encuentra inventariado como bien inmueble que forman parte  del Centro Histórico del Distrito Central.\n La finalidad de la investigación histórica de este espacio es contribuir al proceso de restauración y rehabilitación del mismo, la valoración historica permite establecer la significancia, el simbolismo y conocer el desarrollo urbano del espacio para determinar el alcance de la intervención fisica que puede ser permitida.\n2. Antigua Penitenciaría Central: En el caso de Honduras, la construcción de la Penitenciaría Central, se inscribe dentro de la tendencia en América Latina del siglo XIX, cuando se construyen los primeros centros penitenciarios modernos que tomaron en la mayoría de los casos, los modelos norteamericanos y europeos en cuanto a tipologías constructivas y sistemas carcelarios.  Bajo las ideas modernas sobre el Derecho Penal y el Sistema Penitenciario, el gobierno de Soto y Rosa lanzan en los últimos meses de su mandato, el proyecto de construcción de una Penitenciaría Central, mediante la emisión de un decreto donde se define la necesidad de construcción de la ?Penitenciaría General?; el 15 de noviembre de 1882.\nLa finalidad de esta investigación es darle sustentación histórica a la declaratoria individual de Monumento Nacional con la que se pretende darle mayor nivel de protección a este emblemático espacio. \n3. Cantarranas: El dato más antiguo de la fundación de la Villa de San Juan de Cantarranas es del año de 1667. El 20 de marzo de 1934 según Decreto No. 92 se le dio el título de ciudad?. Existen varias hipótesis sobre la palabra Cantarranas, una de ellas es en alusión al origen árabe, ?Cantara? derivado de alcántara o al-qantarah,  que significa ?el puente?. La otra hipótesis y la más usada, por su lógica en el sonido, es qué Cantarranas comúnmente se les llama a los lugares pantanosos donde el croar de las ranas es muy común y abundante.Las dos hipótesis anteriores no dejan de tener relevancia,  la primera, encuentra sus argumentos en la dominación árabe que por más de 7 siglos vivió España, la segunda, que tienen que ver con el ?croar? de las ranas toma mucha validez porque la mayoría de las calles y poblados con este nombre se encuentran cercanas a algún rio y arroyo donde habitan estos anfibios.\nLa finalidad de de esta investigación es delimitar y declarar su centro histórico en su conjunto como Monumento Nacional.','Patrimonio Cultural Historia Conservación Lesgilación Identidad Patricipación Ciudadana',3,339,11,1,11,2,1,NULL,60,'',NULL,NULL,0,0,'2015-05-26 18:01:46'),(81,2,1,'Programa de ejercicios físicos y educación diabetologica para diabetos tipo 2 del IHSS  y el Hospital Regional de Danlí.','Resumen: La presente investigación será de carácter experimental (cuasi-experimento)  la cual se refiere a los ejercicios físicos los cuales son considerados muy beneficiosos para los pacientes aquejados de Diabetes Mellitus tipo 2, constituyéndose en uno de los pilares fundamentales en el tratamiento de esta enfermedad, aunque se desconoce por gran parte de los pacientes y la población en general. Esta problemática no es ajena a los pacientes que asisten al Hospital Regional Gabriela Alvarado (HRGA) y al Seguro Social (IHSS) de la ciudad de Danlí, los cuales según el diagnóstico realizado a los efectos de esta investigación, se pudo comprobar que presentan  bajo nivel de conocimientos sobre dicho padecimiento, asumiendo como problema: ¿Cómo mejorar el control metabólico y  la calidad de vida de los pacientes diabéticos tipo II del IHSS y el HRGA de la Ciudad de Danlí? por lo que el objetivo general de esta investigación es:  Analizar los resultados de la aplicación de un programa de ejercicios físicos y educación  diabetológica para mejorar el control metabólico y la calidad de vida de los pacientes diabéticos tipo II del  Seguro Social y el Hospital Regional de la Ciudad de Danlí. La muestra seleccionada es probabilística por cuota, algunos criterios para su selección y consta de 25 personas del IHSS y 25 personas del HRGA. Después de cumplimentar acciones tareas planificadas para propuesta de un   programa que  estará formado por ejercicios físicos y educación diabetológica, análisis e instrucción piscológica así como intervención médica se podrá medir la eficiencia en la aplicación de este estudio y comprobar las siguientes hipótesis:1.  Al culminar el programa de ejercicios físicos y educación diabetológica se observa que existe una mejoría con respecto a la prueba de glicemia de entrada e intermedia con respecto a la de salida de la muestra experimental con respecto a la no experimental. 2. Al culminar el programa de ejercicios físicos y educación diabetológica se observa que el consumo de medicamento disminuye, lo que da una medida de la que los ejercicios planificados y realizados influye sobre el control metabólico, disminuyendo el uso de medicamentos en el grupo experimental con respecto al no experimental, aspecto que concreta una mejor calidad de vida de los diabéticos tipo 2. Al culminar el programa de ejercicios físicos y educación diabetológica se observa que las orientaciones acerca del padecimiento, modifican los conocimientos de los pacientes diabéticos tipo 2 de la muestra experimental con respecto a la muestra no experimental sobre su enfermedad, así como  cambios positivos en la actitud  y conductas inadecuadas, para lograr una calidad y  estilo de vida más saludable. 4. Al culminar el programa de ejercicios físicos y educación diabetológica se observa que la rapidez de pensamiento del diabético tipo 2 de la muestra experimental con respecto a la muestra no experimental es más eficaz.','Programa de ejercicio físico, Diabetes mellitus, Rapidez de pensamiento, Glicemia, Hipoglicemia, Hiperglicemia.',3,220,9,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-27 00:19:18'),(82,2,1,'Sistema de ejercicios físicos aeróbicos para mejorar índices cardiorrespiratorios, en alumnos de Voleibol de la UNAH TEC.','La presente investigación es el resultado de un estudio experimental (Pre-experimento  [Pre-test y pos-test]). Cuyo objetivo del estudio es Proponer un Sistema de ejercicios aeróbicos para mejorar índices cardio-respiratorios (Índice de Ruffier, Índice de Inspiración, Índice de Espiración, así como el % de grasa y el índice de masa corporal (IMC) y así mejorar la calidad de vida de los estudiantes que cursan la asignatura de Voleibol en UNAH-TEC-Danlí, aspecto incorporarlo como eje transversal al programa de la asignatura de Voleibol de la UNAH-TEC-Danlí. La población es de 28 estudiantes lo que representa el universo de la indagación y fue seleccionada de forma intencional. Son varios los autores que han hecho estudios sobre la materia, pues es de gran importancia para la salud de los educandos. Para este estudio se consideraron fundamentos prestigiosos, y a partir  de ello se seleccionaron los ejercicios y la adecuados para el tratamiento del objeto de estudio de la indagación. Tales ejercicios contribuyeron en gran medida a mejorar los índices cardio respiratorios así como % de grasa e índice de masa corporal, pues ello se evidenció a través de las técnicas y métodos de investigación aplicada, correspondientes a los niveles empíricos teóricos y matemáticos.','Indices cardio respiratorios, Indice de Ruffier, Indice de inspiración, Índice de espieración, Procentaje de grasa',2,220,9,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-27 00:44:05'),(83,3,1,'Gestión de los espacios geográficos para la construcción de centros educativos en Tegucigalpa y Comayaguela  entre 1930 y 1950','Durante la década de los años 30 y 50 del siglo XX los aspectos educativos adquieren  especial importancia, sobre todo en las ciudades de Tegucigalpa y Comayagüela haciéndose necesaria la construcción de nuevos centros educativos entre  escuelas, de primera enseñanza, y colegios de secundaria, lo que no significo  los problemas económicos, que se enfrentaban en el resto del país para tales fines no afectaran a Distrito Central, pues al contrario, esa problemática económica era amplia mente sentida en la capital política del país.','espacio geográfico, centro educativo',2,358,11,1,11,2,1,NULL,60,'',NULL,NULL,0,0,'2015-05-27 15:08:01'),(85,2,1,'Manejo multidisciplinario de pacientes con secuelas en dentición permanente posteriores a trauma en dentición temporal.  Rep','El trauma orofacial en menores de 5 años es desgraciadamente bastante común y representa un problema difícil de manejar en la práctica dental, carecen en su mayoría de diagnóstico, tratamiento y control adecuados en el tiempo. Flores MT sugiere que el tratamiento de los dientes temporales traumatizados debe ser restringido a una observación adecuada de acuerdo a la situación ocurrida. El objetivo principal del diagnóstico y tratamiento de lesiones traumáticas en dentición temporal es el manejo adecuado del dolor y prevenir secuelas en el diente permanente en formación. La prevalencia de lesiones traumáticas en dentición temporal varía entre 15-30%. Andreasen JO refiere que la proximidad entre las raíces de los dientes temporales y el germen permanente en desarrollo es de suma importancia sobre todo en las lesiones por luxación, en especial por intrusión. La prevalencia de alteraciones en la formación del germen permanente varía entre 12-69%. El objetivo del trabajo es presentar 3 casos de alteraciones en dentición permanente posteriores a secuelas por trauma orofacial ocurrido en la dentición temporal. Los casos coinciden en relación a diversas variables y tienen un seguimiento entre 3-7 años, dejando cada vez más claro que lo sucedido en dentición temporal es altamente predictivo de presencia o no de secuelas en la dentición permanente.\nEn su mayoría el manejo de estos casos debe ser multidisciplinario e involucra áreas como odontopediatría, endodoncia, cirugía máxilofacial, restauradora, ortodoncia, entre otras.\nSe concluye que las lesiones traumáticas en dentición temporal tienen un alto potencial de desarrollar alteraciones en los dientes permanentes dependiendo de la severidad y tipo de lesión así como el grado de desarrollo del germen permanente. Por lo que se hace necesario el manejo adecuado al momento del trauma, los controles en el tiempo y el manejo multidisciplinario del caso de acuerdo a la severidad del mismo.','Dental trauma, primary dentition, permanent dentition, avulsion, intrusion',3,343,11,1,11,1,1,NULL,80,'',NULL,NULL,0,0,'2015-05-27 17:28:14'),(86,4,1,'Efecto de fertilización mineral, orgánica y biológica sobre la producción de frijol común (Phaseolus vulgaris L.) en SRC.','El presente proyecto es una investigación aplicada de tipo cuantitativo experimental basa en un diseño de Bloque Completo al Azar (BCA) con ocho tratamientos y cuatro replicas para un total de 32 unidades experimentales, el análisis realizado fue una ANAVA con separación de medias por el método de Duncan. El proyecto tiene como objetivo evaluar los efectos de fertilización mineral, orgánica y biológica sobre la producción de frijol común (Phaseolus vulgaris L.) en Santa Rosa de Copán. Los resultados obtenidos servirán de base para el diseño de una estrategia de fertilización para el cultivo en la zona.','Fertilización, Frijol.',2,365,11,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-05-27 17:30:16'),(87,2,1,'Conocimientos y experiencias frente al manejo de traumatismos orofaciales en la población docente del CURLA','INTRODUCCIÓN: La literatura internacional hace especial énfasis sobre los conocimientos que en traumatología orofacial deben tener profesores, estudiantes, atletas, padres de familia, entre otros. En Honduras, no contamos con estudios ni con personal docente entrenado en primeros auxilios en traumatología oral. Por lo que el OBJETIVO de este estudio es investigar el grado de conocimiento y experiencias frente al manejo de traumatismos orofaciales en la población docente del CURLA. MATERIAL Y MÉTODOS: un cuestionario de 21 preguntas divididas en 4 partes relacionadas con datos demográficos, conocimiento, manejo de avulsión-fracturas y actitudes fue aplicado a 202 docentes y analizados utilizando estadística descriptiva con el paquete SPSS 22. RESULTADOS: Del total de 202 docentes el 42.8% son mujeres y el 57.2% son hombres. Y solo el 5% realizaría un reimplante inmediato al momento de una avulsión; pero el 63.7% considera que un diente permanente se debería reimplantar y el 51.7% considera importante buscar los fragmentos coronarios posterior a una fractura dental. El medio de transporte más comúnmente indicado para el manejo de avulsión o fracturas, fue de tipo no fisiológico (69.1%). DISCUSIÓN Y CONCLUSIONES: Los resultados encontrados son similares a otros estudios demostrando la falta de conocimiento de los docentes en temas referentes a trauma dental y sobre todo a lo que se refiere a fracturas y avulsión. Así pues estos resultados indican la necesidad de establecer programas de educación continua en trauma orofacial y así mejorar el nivel de conocimiento y manejo de estas urgencias cada vez más frecuentes.','Dental Trauma, Knowledge, storage medium, tooth avulsion, tooth fracture',2,343,11,1,11,1,1,NULL,80,'',NULL,NULL,0,0,'2015-05-27 18:06:42'),(88,4,1,'ESP: un estudio multidisciplinario interinstitucional de necesidades sociocomunicativas','La investigación pretende en primer lugar obtener un diagnostico completo alrededor de las necesidades de formación en la lengua inglés de los estudiantes y egresados de la Carrera de Ingeniería en Agroindustria del CURVA UNAH, con el fin de, en segundo lugar, diseñar y luego validar una propuesta curricular de enseñanza-aprendizaje de lengua inglesa que responda a las necesidades personales, lingüística y socio-profesionales específicos de este público y su disciplina.','ESP, necesidades lingüísticas, reforma curricular, estilos de aprendizaje',2,367,11,1,11,3,1,NULL,45,'',NULL,NULL,1,0,'2015-05-27 19:04:24'),(89,5,1,'Caracterización del Trabajo Infantil en Honduras','La presente investigación analiza y realiza una caracterización del trabajo infantil en el rango de edad de 5-17 años en la población hondureña en un conjunto de variables socioeconómicas. \nDestacando que en Honduras  se considera la edad acta para insertarse en el mercado laboral desde los 10 años, sin embargo existen muchos niños y niñas menores de 10 años realizando trabajos; provocando que muchos infantes no culminen su año escolar satisfactoriamente, así también que no tengan tiempo de recreación.  Aunque no necesariamente ellos estén en una actividad económica (remunerada), sino en actividades domésticas. \nAunado a lo anterior, se podría considerar que un porcentaje de ellos son  considerados jefes de hogar; con esto se darían efectos sobre el capital humano, un desaprovechamiento del bono demográfico y poco avance en la reducción de la pobreza.','Trabajo Infantil, Mercado Laboral, Actividad Económica y Actividad Domesticas.',2,370,9,1,11,3,1,NULL,10,'',NULL,NULL,1,0,'2015-05-27 20:09:18'),(90,5,1,'Lecciones Aprendidas en la implementación del uso del  Gestor Bibliográfico CITAVI en la UNAH.','Después de una introducción a las peculiaridades y algunas funciones de ese programa de gestión bibliográfica se presentarán las experiencias y lecciones aprendidas con cooperación técnica internacional, para que la comunidad universitaria de la Universidad Nacional Autónoma de Honduras (UNAH) implemente el uso de la herramienta para la investigación Citavi de la Swiss Academic Software GmbH (SAS).','gestor bibliografico, investigacion,',2,375,11,1,11,3,1,NULL,25,'',NULL,NULL,1,0,'2015-05-27 21:46:11'),(92,6,1,'IDENTIFICACIÓN  DE RIESGOS POR DESASTRES NATURALES EN LAS CUENCAS HIDROGRÁFICAS MARINO COSTERAS DEL RIO GUASCORAN CON TIG','El impacto de las actividades de cuencas hidrográficas en las áreas costeras determina la necesidad de un análisis global que integre aspectos esenciales, relacionados con la actividad humana y con fenómenos naturales que ocurren en tierras altas, vertientes y valles, y que tienen consecuencias generalmente negativas en el hábitat costero-marino, a través de las corrientes fluviales, las cuales vinculan a estos sectores como un hilo conductor de un proceso que tiene\nImplicaciones de índole socioeconómica, legal-institucional, técnica y ética. Entre los innumerables factores de causa se puede citar como un hecho fundamental la desvinculación entre el manejo de los recursos naturales y el medio ambiente y la planificación del desarrollo global del país.\nEn Honduras por lo general no existe una integración en el manejo de las cuencas hidrográficas y el área costera, si bien existe una importe experiencia en el manejo de ambas regiones particulares.  Debemos aclarar que la primera dificultad, que estará implícita en los problemas que se describen a continuación, es la falta de una concepción cuenca-costa en los programas y proyectos relacionados con los recursos hídricos. Los proyectos hidrológicos como presas, desvíos de ríos y obras de canalización, bien sean para favorecer la agricultura o reducir los riesgos de inundaciones, priorizan el aspecto social y económico de la región de la cuenca donde van a operar, pero no consideran los impactos sobre otras regiones de la cuenca ni la relación con la zona costera y sus impactos. Lo mismo es válido para cualquier obra o proyecto que se realice en las cuencas altas, media o bajas, desde la introducción de especies exóticas hasta la selección de puntos para el vertimiento de contaminantes.\nCon este proyecto se pretende desarrollar una metodología que posibilite la identificación, el análisis y la clasificación de riesgos producto de la identificación de amenazas y vulnerabilidades en el área de la cuenca hidrográfica marino costera del Río Goascorán, Golfo de Fonseca mediante el uso de la tecnologías de Información Geográfica, elaborando además propuestas y recomendaciones para minimizar riesgos identificados como altos.','tecnologías de Información Geográfica, cuenca, Riesgos, desastres',2,289,7,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-05-27 21:55:55'),(93,2,1,'Influencia de la salinidad sobre la supervivencia de la postlarva de camarón','La larvicultura es el primer paso en la producción comercial de camarón cultivado, en la zona sur de Honduras existen once laboratorios de producción que producen 7,000 millones de post-larva que camarón, sin embargo la salinidad es un parámetro en el agua que es difícil controlar y con la influencia del cambio climático las salinidades no son constantes. El objetivo del estudio fue detectar la influencia de la salinidad sobre la mortalidad del camarón en un ciclo de producción. El estudio se realizó en un laboratorio de producción de post-larva en la comunidad de Cedeño, Choluteca. Se usaron 16 tanques de 10 m3 cada uno en donde se sembraron nauplios de camarón y se coseharon 21 días después en el estadio larval de Pl-12. En ocho tanques se manejó la salinidad de 33,000 ppm y en los otros ocho la salinidad fue de 30,000 ppm, sembrando a la densidad de 1600 nauplios por tanque, todos los tanques recibieron las mismas condiciones de manejo. Los camarones manejados en la salinidad de 33,000 ppm presentaron 62% de supervivencia en comparación a los de 30,000 ppm de salinidad que mostro un 56% de supervivencia, encontrando diferencias estadísticas significativas (P<0.05). Los animales a 30,000 ppm de salinidad desarrollaron un 97% de supervivencia a la prueba de estrés en comparación del 90% de los camarones manejados a 33,000 ppm. Los acuicultores tienen preferencias por camarones que tengan alta tolerancia a la prueba de estrés.','salinidad, supervivencia',3,265,7,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-27 23:37:11'),(94,2,1,'Riesgos climáticos sobre los componentes, recursos y medios de vida de los sistemas alimentarios del departamento de Copán','El estudio analiza los riesgos de los sistemas alimentarios en dos comunidades del departamento de Copán ante los efectos de las amenazas climáticas, mediante la estimación de la peligrosidad de las amenazas identificadas en la zona y del grado de sensibilidad, exposición y capacidad de adaptación ante los impactos climáticos de las amenazas identificadas. La estrategia de diseño de la investigación es un estudio de caso instrumental con unidades incrustadas. La muestra es no probabilística, y sigue una estrategia de selección deliberada e intencional de informantes, aplicando la entrevista semiestructurada y los grupos focales como técnicas de recolección de la información. La investigación examina la peligrosidad de las amenazas climáticas, y cómo inciden sobre los medios de vida y los recursos de los sistemas alimentarios. Se analizó la sensibilidad de los sistemas alimentarios con respecto a los componentes de la seguridad alimentaria y la exposición de los recursos, servicios, organizaciones y políticas de apoyo de los sistemas alimentarios ante las amenazas climáticas. Luego, se analizó la capacidad de adaptación con respecto al acceso, flexibilidad y estabilidad de los recursos y medios de vida. La vulnerabilidad, se determinó como una función de la sensibilidad, exposición y capacidad de adaptación. Por último, se determinó el riesgo de los sistemas alimentarios de las comunidades ante las amenazas climáticas, como una función de las amenazas y la vulnerabilidad.','Riesgos, vulnerabilidad, sistemas alimentarios, amenazas climáticas, medios de vida, seguridad alimentaria',2,352,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-27 23:57:32'),(95,6,1,'Evaluación sobre la dispersión de semillas de Muntingia calabura L. (Muntingiaceae) por murciélagos frugívoros en la UNAH','El ?capulín de montaña? o Muntingia calabura (Muntingiaceae), es una de las frutas que compone la dieta de los murciélagos frugívoros, los cuales son los responsables de la dispersión de semillas a largo plazo, y cumplen con la función de realizar la dinámica natural del área. Su acción como dispersores favorece el desarrollo de los procesos de sucesión de las plantas, y siendo esta la razón por la que se propuso determinar la importancia de los murciélagos frugívoros en la distribución y dispersión de semillas, así como evaluar la efectividad de la dispersión de semillas de Muntingia calabura en el Campus Universitario de la Universidad Nacional Autónoma de Honduras (CU-UNAH) en Tegucigalpa. Para ello se definieron tres áreas de estudio dentro del Campus de acuerdo a la abundancia de ?capulínes? que se encontraron. Se capturaron 20 individuos usando red de niebla y se identificaron cuatro especies de murciélagos, además se obtuvieron 7 muestras fecales para analizar su viabilidad de acuerdo a su condición morfológica después de haber pasado por el tracto digestivo de los murciélagos, al igual que se analizaron muestras fecales que contenían otro tipo de semillas, y se tomaron muestras de polen del todo el cuerpo de los individuos. El índice de dispersión de semillas indico que Artibeus lituratus es el murciélago frugívoro más importante en la dispersión de semillas en el campus. Estos resultados son la clave para estudios de reforestación y biología reproductiva en el campus universitario.','Capulín, dispersión de semillas, murciélagos frugívoros',2,383,11,1,11,3,1,NULL,25,'',NULL,NULL,1,0,'2015-05-28 13:06:41'),(96,6,1,'ANÁLISIS FILOGENÉTICO DE DIEZ GÉNEROS DE LA FAMILIA MALPIGHIACEAE CON BASE EN DATOS MORFOLÓGICOS Y MOLECULARES','Malpighiaceae constituye una de las familias más diversas de angiospermas en el Neotrópico y se caracteriza por presentar árboles, arbustos y trepadoras de hojas simples, normalmente opuestas, con o sin estípulas. Flores en racimos con 5 sépalos imbricados, 5 pétalos con frecuencia unguiculados, y normalmente 10 estambres unidos en la base y con frutos esquizocárpicos o drupas. Se llevó a cabo un análisis cladístico de diez géneros de la familia Malpighiaceae registrados en Honduras usando el programa computacional Winclada-Nona. Estos diez géneros y dos grupos externos fueron ploteados en una matriz de 42 caracteres morfológicos y 830 caracteres de secuencias de una región específica del gen cloroplastidial matK. Los resultados apoyan la monofilia de la familia y muestran dos clados que confirman la propuesta por Anderson (2006) de las Subfamilias Byrsonimoideae, el cual está constituida por el género Byrsonima y la Subfamilia Malpighioideae constituida por los géneros Heteropterys, Stigmaphyllon, Banisteriopsis, Bunchosia, Mascagnia y Malpighia. Las relaciones cercanas entre los géneros Mascagnia y Malpighia propuestas por otros autores fueron confirmadas. Los géneros Hiraea y Tetrapterys se ubican en un clado y sus relaciones con las Subfamilias mencionadas permanecen sin esclarecer y el género Gaudichaudia es considerado un linaje muy cercano a Banisteriopsis y Stigmaphyllon.','Malpighiaceae, cladístico, morfología, molecular',2,383,11,1,11,3,1,NULL,20,'',NULL,NULL,1,0,'2015-05-28 13:08:07'),(99,2,1,'Módulo Didáctico para el Estudio de Tópicos de Electromagnetismo','Se describen las características de un sistema desarrollado en Java que provee herramientas computacionales para complementar el estudio de tópicos relacionados con campos electromagnéticos variables con el tiempo. El sistema está basado en varios módulos que simulan la evolución de ondas planas, la dinámica de guías de onda rectangulares, y la solución numérica de la ecuación de onda unidimensional.','Electromagnetismo, simulación, Java, guias de onda, ecuación de onda, ondas planas',3,280,9,1,11,1,1,NULL,10,'',NULL,NULL,0,0,'2015-05-28 17:56:44'),(100,2,1,'Estimación del acomplamiento sísmico en la zona de subduccion de América Central a partir del sismo El Salvador 212','Las zonas de subducción exhiben grados variables de acoplamiento intersísmico como se ha mostrado a partir de inversiones de datos geodésicos y los análisis de la liberación de energía sísmica. El grado en el que se acopla una falla límite de placa puede tener efectos profundos en el comportamiento sismogénico. En este estudio usamos mediciones GPS para estimar la deformación co y post-sísmica de el megaterremoto Mw7.3 ocurrido en alta mar frente a la costa de El Salvador  el 27 de agosto 2012, el cual produjo un  tsunami.  Nuestro análisis indica que la deformación post-sísmica está dominado por afterslip, en contraposición a la relajación viscoelástica.  Sugerimos que el movimiento post-sísmico excesivo es característico del segmento El Salvador - Nicaragua  del margen de Centroamérica, y puede ser una característica de los márgenes de placas capaces de producir terremotos generadores de tsunami.','terremotos, GPS, tectonica, sismologia, El Salvador',3,105,7,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-05-28 21:22:03'),(101,4,1,'La Problemática de la industria del camarón cultivado en el Golfo de Fonseca','El presente trabajo de investigación nos muestra la problemática de la industria del camarón cultivado en el Golfo de Fonseca. La acuacultura o acuicultura es un término muy amplio que abarca los cultivos de cualquier organismo acuático, incluyendo a los peces, crustáceos, moluscos, algas y muchos otros organismos de agua dulce y salada.\nLa apertura de los países a una economía global obliga a todas las empresas a realizar un salto orientado a mejorar la competitividad , la cual, a su vez, se refiere a la calidad del producto y a la eficiencia con la que se produce en relación a la cantidad producida y a los insumos utilizados para obtenerla (Porter 1990).\nActualmente esta actividad es industrializada en algunas explotaciones, respondiendo muy bien a la demanda alimenticia mundial del camarón que cada día se ve más afectada por la pesca comercial.\nLa producción del cultivo del camarón fue iniciada en Honduras en 1983 en los esteros del Golfo de Fonseca a lo largo de la costa del Pacifico. El cultivo del camarón ha presentado ser una oportunidad de negocios para pequeños, medianos y grandes productores.\nEsta área de producción comercial del camarón enfrenta la pérdida de rentabilidad ocasionado por la disminución de los precios en el mercado y el aumento de costos de factores de producción como de exportación, limitando su productividad, participación en otros mercados  y de la falta de  apoyo del Gobierno a estandarizar políticas que apoyen al productor artesanal de pequeña y mediana extensión económica.\nMostraremos los factores que impide el crecimiento de esta área camaronera dentro de un mercado competitivo en la economía global, lo cual obliga a varios productores a no tener competitividad y de explicar a partir de los conceptos de productividad y rentabilidad del por qué no hay un incentivo por parte del gobierno para el crecimiento de este mercado denominada el principal ejercicio de esta zona del Golfo de Fonseca.','camaronera, Golfo de Fonseca, acuicultura.',1,391,11,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-05-28 21:29:01'),(103,2,1,'Estimación de parámetros geofísicos en la zona minera de San Juan Arriba, El Corpus posterior al derrumbe de Julio 214','El 3 de Julio de 2014  una mina artesanal de la zona minera de San Juan Arriba, El Corpus, Choluteca colapso causando que 11 personas quedaran soterradas. 3 personas fueron rescatadas en los días posteriores pero nuevos colapsos y el desconocimiento de la ubicación y dimensiones de los tuneles complico las acciones de rescate. El Instituto Hondureño de Ciencias de La Tierra en conjunto con COPECO  realizó un estudio empleando el método de tomografía  eléctrica  para determinar las características del subsuelo con el fin de ubicar y delimitar los tuneles existentes. La información obtenida de este estudio junto con información geológica recolectada por especialista en minas ayudo para coordinar las acciones de rescate de los cuerpos soterrados.','Geofisica aplicada, Resistividad Electrica, mineria, geologia',3,105,7,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-05-28 21:52:46'),(104,4,1,'Automedicacion en Estudiantes de Quinto año de Medicina en la Facultad de Ciencias Medicas de la UNAH en periodo de Oct  Dic','AUTOMEDICACIÓN EN ESTUDIANTES DE QUINTO AÑO DE MEDICINA EN LA FACULTAD DE CIENCIAS MÉDICAS DE LA UNIVERSIDAD NACIONAL AUTÓNOMA DE HONDURAS EN EL PERIODO DE OCTUBRE A DICIEMBRE DEL 2014?\n\nDiana Gabriela Rivera Alcántara\nMaster en Salud Publica, Profesor del Departamento de Fisiología, Facultad de Ciencias Médicas.\n\n Antecedentes: En Honduras no se cuenta con estudios sobre la Automedicación en estudiantes de Medicina Objetivo: Determinar los conocimientos, actitudes y prácticas de la Automedicación en estudiantes de quinto año de medicina de la UNAH en el periodo octubre a diciembre del 2014.Metodologia:Tipo de  Estudio descriptivo transversal , universo de 759 estudiantes se obtuvo una muestra de 256 (P=58%, d= 5%) la cual se seleccionó mediante un muestreo no probabilístico donde se incluyó a todos los estudiantes de quinto año de medicina, los datos se recolectaron mediante una encuesta de carácter anónimo en la cual se tomó en cuenta la características sociodemográficas agrupándose en estudiantes que se automedicaron y los que no lo hacían además se tomó en cuenta  conocimientos (conocimiento de la Automedicación y efectos adversos) , actitudes (percepción, motivaciones intrínsecas y extrínsecas, fuentes de información, riesgo ) prácticas ( Medicamentos utilizados, tipo de efectos, lugar de obtención) la información recolectada se analizó utilizando estadística descriptiva . Resultados: Con respecto al sexo se obtuvo una Razón de M: F = 1: 1.02, con una media de edad 23.6 años ± 2.1 1DE, siendo el 85.9% solteros, procedencia Urbana 78.1%, el 76.2% se habían auto medicado en los últimos 6 meses , 97.4%  de los que se auto medicaron  tenían el conocimiento de Automedicación, el 91.8% consideraron que la Automedicación no es adecuada, el medicamento más utilizado fueron los AINES en un 73.8%, seguido por los antigripales 52.3% en tercer lugar los antibióticos con 52.3%, en relación a las motivaciones extrínsecas que tuvieron fue largo tiempo de espera y alto costo de la consulta privada, dentro las motivaciones intrínsecas  los síntomas no eran tan serios, confianza en lo que se auto médica y alta demanda académica, solo el 23.1% de los estudiantes que se auto medicaron  en los últimos 6 meses consideraron que la automedicación no presentaba un riesgo. Conclusiones /Recomendaciones:  este trabajo expresa que la  automedicación es  una práctica muy común dentro de la población universitaria en estudiantes de medicina, por lo que es necesario poner en marcha una campaña donde se involucre a los Docente y estudiantes a promover el uso racional de medicamentos.','Automedicación, Estudiantes de Medicina, Efectos adversos',2,390,11,1,11,1,1,NULL,15,'',NULL,NULL,0,0,'2015-05-28 22:52:21'),(105,1,1,'La creatividad como competencia docente del profesor de Diseño','Ser un profesional destacado del diseño no es suficiente para desempeñarse con éxito como profesor de diseño, ser profesor de diseño es otra profesión y por ello es necesario dominar las competencias que lo distinguen como profesional. \n¿Existe una Didáctica especifica del proceso proyectual?\n¿El trabajo del profesor y su actividad docente están a la altura de las aspiraciones de aprendizaje que debe alcanzar un diseñador?, ¿existen momentos creativos esenciales en la enseñanza del diseño?\n\n¿Es creativa la actividad docente de los talleres de proyecto?, ¿cuál debe ser el nivel y alcance de los objetivos cuando la aspiración de aprendizaje es innovar?, ¿la enseñanza de un contenido creativo es creativa por naturaleza?, ¿qué hace el profesor cuando la creatividad es el contenido a enseñar?, ¿cómo evaluar las capacidades creativas con creatividad?\n¿Existen claves para una enseñanza creativa del diseño?','Didáctica especifica del diseño, proceso proyectual,  enseñanza del diseño, creatividad competencias del profesor de diseño.',2,399,11,1,11,1,1,NULL,150,'',NULL,NULL,0,0,'2015-05-29 05:57:48'),(106,2,1,'Estudio del efecto bactericida del clavo de olor, canela y benzoato de sodio en la conservación del mango haden y Melón.','Se realizó estudio experimental para determinar la inhibición y/o  destrucción de los patógenos en los siguientes; Controles, M-EC, M-S, Me-EC, Me-S, Tratamientos M-EC-CL, M-S-CL, Me-EC-CL, Me-S-CL, M-EC-C, M-S-C, Me-EC-C, Me-S-C, M-EC-B, M-S-B, Me-EC-B y Me-S-B. Donde M ?mango?, Me ?Melón?, EC ?Escherichia coli?, S ?Salmonella sp?, CL ?clavo de olor?, C ?canela?, B ?benzoato de sodio?. Calificando cada tratamiento de acuerdo al poder bactericida, como: no efectivo, efecto mínimo, letal y fulminante, en los días 0 (t0), 7 (t7) y 15 (t15); se evaluó el efecto bactericida de extractos acuosos de canela, clavo de olor en concentraciones de 2.5% y benzoato de sodio en concentraciones permitidas según FDA 0.1%, utilizando el método de cuantificación o  conteo de unidades formadoras de colonia UFC, sobre dos cepas bacterianas, Escherichia coli y Salmonella enteritidis, se inocularon en muestras de frutas tropicales, mango haden (Mangifera indica) y melón cantaloupe (Cucumis melo).  \nEl efecto bactericida de clavo de olor fue diferente en las dos frutas tratadas; en el mango inoculado con E. coli se observó un mínimo efecto y en el inoculado con Salmonella spp. no hubo efecto bactericida.\nEn el melón inoculado con ambas bacterias, se observó el efecto bactericida del clavo de olor.  \nEl efecto de la canela fue mínimo en ambas frutas inoculadas con E. coli. En el mango inoculado con Salmonella spp. no hubo efecto bactericida. En el melón si tuvo un efecto letal. \nEl uso del benzoato de sodio ejerció un efecto bactericida, tanto en el melón como el mango, inoculadas con ambas bacterias. En el análisis se observó que en el mango inoculado con E. coli el efecto fue fulminante, (muerte en el día 0).\nSe determinó materia seca, balance de materia y análisis sensoriales, para tener una mejor conclusión de la investigación.','Clavo de olor (Syzygium aromaticum), canela (Cinnamomum verum) y benzoato de sodio, E. coli y Salmonella.',3,381,11,1,11,1,1,NULL,30,'',NULL,NULL,0,0,'2015-05-29 14:23:36'),(107,2,1,'Fortalecimiento y Formación de Capacidades de Profesionales en Control y Mitigación Frente a Deslizamientos en Tegucigalpa','Este proyecto, busca fortalecer la capacidad a los investigadores de la UNAH y a los técnicos de la AMDC en la toma de medidas contra deslizamientos de tierra, y contribuir a la mitigación de los daños de los mismos mediante el apoyo al establecimiento del sistema de ejecución de las medidas correspondientes en ambas instituciones; a través del fortalecimiento en la UNAH de un sistema organizacional de investigación para realizar el estudio y análisis de los deslizamientos de magnitud mediana, así como para diseñar obras de contramedida. y Establecer en la AMDC un sistema para planear medidas contra deslizamientos de tierra, contratar obras de contramedida de pequeña y mediana escala, y realizar la supervisión y mantenimiento de dichas obras, mediante el uso del libro mayor y mapa de riesgo de deslizamientos. Entre las actividades que el proyecto contempla estan:\n\n?	Asesoría sobre el plan de fundación de la organización de investigación geológica en la UNAH. \n?	Asesoría sobre el establecimiento del sistema organizacional de investigación sobre los deslizamientos de tierra dentro de la UNAH y a nivel nacional.\n?	Asesoría sobre el establecimiento del sistema de ejecución de medidas contra deslizamientos de tierra en la AMDC. \n?	Realizar seminarios para hacer entender el proceso de recolección de información sobre deslizamientos de tierra, estudio, análisis, diseño, construcción y mantenimiento. \n?	Asesoría sobre el establecimiento del sistema de coordinación entre la AMDC y la UNAH respecto a las medidas contra deslizamientos de tierra.\n?	Hacer la transferencia a AMDC de las técnicas para elaborar el libro mayor y mapa de riesgo de deslizamientos, y asesorar sobre el aprovechamiento del mismo. \n?	Hacer la transferencia a AMDC de las técnicas para la operación y mantenimiento de las obras contra deslizamientos y las instalaciones de monitoreo.','Deslizamiento, medidas de control, mitigacion, monitoreo, mapeo, tipologia de deslizamientos',4,388,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-29 14:37:20'),(108,2,1,'Evaluación de Efecto de Sitio, Caracterización Geofisica de suelos y microzonificacion sísmica en Balfate y Jutiapa. Hondura','En general, el territorio nacional por su ubicación geográfica, puede ser catalogado dentro  del contexto de multiamenaza. La vulnerabilidad de nuestras comunidades está dada en función principalmente de las debilidades sociales, que llevan a ubicar asentamientos humanos en zonas vulnerables. Sin embargo aspectos como: los  físicos y ambientales, tanto como las  características estructurales o físicas en  estructuras viales, obras públicas y viviendas, el tipo de suelo o geología local (muy poco conocida), los bajos niveles educativos e ingresos per cápita; también aumentan los niveles de vulnerabilidad de una unidad social frente a eventos sísmicos.\n\nEn el marco geotectónico que es el que compete principalmente para el desarrollo de la microzonificación sísmica. Las principales fuentes generadoras de sismicidad en Honduras están determinadas por la Fosa Mesoamericana, La cuenca del Caimán, la gran Depresión de Honduras, la Falla de Guayape y un conjunto de fallas más pequeñas distribuidas en todo el territorio.   \nHonduras se localiza en el punto donde se encuentran tres placas principales: Caribe, Cocos y Norte América. Es en las zonas de contacto entre estas placas donde se observa la mayor sismicidad que afecta Honduras, siendo la zona de subducción entre las placas Cocos y Caribe la zona más activa y con mayor potencial para generar terremotos de gran magnitud. De manera similar el contacto entre las placas Caribe y Norte América cuya expresión es el sistema de fallas Motagua-Polochic y su continuación en el mar la Falla del Cisne generan mucha sismicidad.\n\n En el interior del país, sobre todo en el occidente hacia el centro y en la zona norte una gran cantidad de fallas activas generan también sismicidad, produciendo temblores de magnitudes bajas pero que pueden tener efecto local. Existe la probabilidad de que al ocurrir un terremoto las ondas sísmicas lleguen amortiguadas a diferentes zonas del país,  siempre pueden ocasionar daños por la gran cantidad de fallas geológicas que hay en su entorno y sobre todo por las débiles construcciones sobre laderas o al pie de estas.\n\nEn el ambiente de subducción del pacifico podemos observar sismos de tipo subducción, hacia el sistema Polochic Motagua y la Cuenca del Caimán sismos provocados por un deslizamiento transcurrente entre las placas y sismos de tipo corticales con menos magnitud provocados por fallamiento local.\n\nEl proyecto:  \"Fortalecimiento de la Resiliencia y las Capacidades de las poblaciones garífuna y ladina de los municipios de Balfate y Jutiapa, con énfasis en mujeres, niñez y juventud\";  responde a la iniciativa del Marco de Acción de Hyogo (MAH) y  la Declaración de Rio, convenios que establecen la necesidad de desarrollar acciones orientadas a fortalecer la seguridad humana de cara a fenómenos capaces de generar desastres en función de las condiciones de vulnerabilidad y capacidad de respuesta de una unidad social. \n\nEn Honduras, la Ley del SINAGER establece un vínculo interinstitucional, en donde todas las instituciones deben procurar acciones e involucramiento relativo a las actividades de prevención, adaptación al cambio climático y en general a la Reducción de Riesgo de Desastres.  La región Centroamericana, por su ubicación geográfica está expuesta no solo a fenómenos hidrometereológicos  que desencadenan una serie de eventos capaces de producir desastres; además debido a sus características geotectónicas compartidas con los países vecinos; nos ubica en un área de alta amenaza sísmica, la cual ha sido subestimada hasta la ocurrencia del sismo de 7.3 grados en la  Escala de Richter en Mayo de 2009 en la costa Atlántica del país, el cual alarmo a la comunidad hondureña como a las autoridades y académicos.  \n\nPor tanto, el desarrollo de estudios orientados a enriquecer el entendimiento de esta amenaza, sus fuentes generadoras y las acciones a tomar para convivir con ella bajo el menor riesgo de pérdidas humanas y reducción de los desastres toman entonces, un carácter de pertinencia prioritaria; junto con otras acciones por realizar en conjunto con el importante papel de las diferentes organizaciones que conforman el SINAGER; como ente tomador de decisiones al cual deben sumarse los aportes de la comunidad internacional; en función de búsqueda continua de disminuir la vulnerabilidad y mejorar la capacidad de respuesta de las comunidades amenazadas.\n\nEn ese sentido DanChurchAid y el Instituto Hondureño de ciencias de la Tierra han acordado realizar la evaluación de efecto de sitio, con una caracterización de suelos a través de métodos geofisicos, generando una propuesta de microzonificacion sísmica para las comunidades de: Balfate Centro, Lis Lis, Rio Coco y Rio Esteban en el municipio de Balfate; y: Jutiapa casco Urbano, La Bomba y Nueva Armenia en el municipio de Jutiapa; como un componente de los resultados generales del proyecto. Este componente busca fortalecer la capacidad de respuesta comunitaria, el conocimiento del riesgo y el crecimiento urbanístico controlado.','Sismicidad, Microzoificacion Sísmica, Efecto de Sitio, Refracción, Amplitud, Frecuencia, Periodo, Microzonas, Riesgo Sismico',3,388,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-29 15:11:57'),(110,1,1,'Estudio Hidrológico para la implementación de un Sistema de Alerta Temprana de Inundaciones en la Subcuenca del Río Papalote','La capacitación comunitaria asociada a la reducción de la vulnerabilidad frente a peligros naturales, requiere de la implementación de programas de capacitación fáciles y de dominio de toda la comunidad. Para reducir la vulnerabilidad frente a inundaciones en comunidades próximas a las riveras de los ríos se deben de desarrollar programas de investigación de bajo costo, fáciles de implementar y que perduren en el tiempo.\n\nEl éxito del desarrollo de este Sistema de Alerta Temprana de Inundaciones radica en la participación de todos los miembros de la comunidad, ya que son ellos quienes realizarán los pasos necesarios para llevar a cabo dicho sistema.\n\nSe presenta la propuesta de estudio hidrológico para la implementación de un sistema de alerta temprana en la subcuenca Papaloteca, Atlántida, que permitirá poder entender el comportamiento hidrológico de la cuenca frente a las precipitaciones y las posibles respuestas de la misma, según los eventos de lluvia que puedan presentarse.','Ciclo Hidrologico, Hidrologia, Sistema de Alerta Temorana, Inundacion, Planicie de Inundacion, Susceptibilidad, Vulnerabilid',2,388,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-29 15:33:53'),(111,6,1,'Experiencia Barrial en Tegucigalpa. Caso Canaan, fortalecimiento de capacidad de respuesta y resiliencia comunitaria','La docencia, investigación y vinculación universitaria es una imperante necesidad para que las universidades puedan aportar productos tangibles a sus comunidades y logre orientar la educación superior a las necesidades de las mismas.\n\nEs por ello que la Universidad Nacional Autónoma de Honduras a través del Instituto Hondureño de Desastres, la Facultad de Ingeniería Civil y la Facultad de Trabajo Social; auspiciados por el Gobierno de Taiwan a través del PADF y la OEA, el apoyo del CODEM D. C. y la AMDC; han podido desarrollar diferentes actividades para fortalecer a nivel comunitario y frente a respuesta a desastres y prevención de los mismos a los habitantes de la colonia Canaan.\n\nEste proyecto contemplo el enfoque de análisis de las amenazas y la situación del riesgo, capacitación y fortalecimiento para la respuesta y obras a pequeña escala de mitigacion y control frente a deslizamientos e inundaciones.','Capacidad de Respuesta, resiliencia, riesgo, inundaciones, deslizamiento, vulnerabilidad.',2,388,11,1,11,3,1,NULL,20,'En general hay problema con lo que se llama numero de paginas en la bibliografía, la gente está poniendo el numero total de paginas de la revista o el numero donde inicia el articulo, pero no cuantas paginas tiene el articulo...ademas el numero de paginas solo se debería de pedir para cuando son artículos de revistas y no para los libros',NULL,NULL,1,0,'2015-05-29 15:47:00'),(112,6,1,'Efecto de Sitio, Caracterización geofisica de suelos y evaluación de la amenaza frente a tsunami','El poster  resume resultados de la  caracterización de los suelos del área de estudio a través de métodos geofísicos y evaluar la respuesta de sitio mediante el análisis de microtremores, generando una propuesta de microzonificación sísmica, ademas se presenta la evaluacion de amenaza frente a tunamis.\nDentro de las actividades que se resumen están: \n\n?	Realización de  6  arreglos necesarios en la aplicación del método de refracción sísmica  para la caracterización geofísica de los suelos en la zona de estudio.\n?	Análisis de los registros de microtremores en al menos 6 aldeas de Trujillo y Limón orientados a  obtener con ello una propuesta de microzonificación sísmica para cada aldea.\n?	Evaluación de amenaza frente a tsunami desde diferentes fuentes generadoras de sismos, calculo de tiempos de arribo y altura de la ola\n\nEste estudio es un producto de tres docentes/investigadores de la Facultad de Ciencias quienes aunaron esfuerzos y conocimientos para obtener los resultados que acá se presentan.','Tsunami, microzonificacion, geofisica, periodo dominante, efecto de sitio, refracción sismica',3,388,11,1,11,3,1,NULL,200,'Hace falta incluir en el resumen cual es la zona de estudio, no queda claro si eso se hará en Honduras o en otro país. En el numero de paginas escribieron el total de paginas que tiene la revista y no los números en los que se ubica la ponencia. Solo hay tres referencias bibliograficas',NULL,NULL,1,0,'2015-05-29 15:56:55'),(113,5,1,'Estudio de Flora y Fauna en el Aeropuerto Ramon Villeda Morales, San Pedro Sula, Honduras','Desde los inicios de la aviación se ha prestado poca atención a la interacción de la fauna con esta y hasta recientemente, no se había dado importancia  a las consecuencias de los impactos de aves con aeronaves.  Al incrementarse progresivamente la velocidad de estas y su fragilidad al utilizar nuevos materiales más ligeros, observamos que las consecuencias de este tipo de incidentes son cada vez más severas. La presencia de aves y todo tipo de fauna en aeropuertos y sus zonas de su influencia representa un riesgo para las operaciones aéreas conocido como peligro aviario. Este peligro se presenta en prácticamente todos los aeropuertos del mundo, y se traduce en incidentes y colisiones de fauna contra las aeronaves causando desde interrupciones a la operación aeronáutica y pérdidas económicas por daños en los aviones hasta pérdidas de vidas humanas. Por tanto, la fauna ante la posibilidad de ser impactada por las aeronaves, representa un problema para la seguridad aérea que debe ser identificado y abordado en razón de la amenaza que representa y la vulnerabilidad del sistema aeronáutico a este tipo de eventos.  La magnitud del problema es específica para cada aeródromo y depende de 3 factores principales: el tipo y cantidad de operaciones aéreas; la fauna presente y su comportamiento; y, el emplazamiento y entorno natural del aeropuerto y sus cercanías. El estudio de fauna aportara la mayor información posible sobre la fauna presente en el aeropuerto y en su entorno para su consideración en el posterior análisis, evaluación  y desarrollo de un plan de manejo y gestión de la fauna, acorde los requisitos establecidos por la Dirección General de Aeronáutica Civil (DGAC) en la Regulación Aeronáutica Civil -139  enmarcados en los requerimientos de certificación de  aeródromo y de esta forma velar por la seguridad operacional.  La colecta de los organismos se centraran en las zonas con mayor cobertura vegetal, se harán giras de colecta una vez al mes durante un año seguido. Para la observación de aves se hará en dos horarios por la mañana de 5:30 am a 10:00 am y por la tarde de 4:00 pm a 6:00 pm, se tiene que observar el comportamiento de vuelo de las aves ya que esta determinara la baja de accidentes por coaliciones con aves, los otros grupos taxonómicos se tomaran  \nlos mismos horarios de colecta y también se tomaran los horarios de 5:00 pm a 12:00 de la noche para la colocación de trampas y búsqueda directa de los organismos respetando los protocolos de seguridad del aeropuerto por medio de la fuerza aérea Hondureña . Todos los organismos colectados serán llevados a los diferentes laboratorios de la Escuela de Biología de la Universidad Nacional Autónoma de Honduras.  los datos recopilados hasta el momento nos muestra una cercana relación entre los diferentes grupos encontrados tal es el caso de las aves rapaces, se ha encontrado que existe una alta población de ratones las cuales son el alimento preferido de estos, la mayor cantidad de plantas encontradas están las gramíneas esta le sirven de alimento a los roedores y una gran cantidad de insectos que también atrae a otras tipos de aves que pueden ocasionar problemas de coaliciones, a esto debemos agregar que hay aves migratorias, aves acuaticas ya que en la zona se forman lagunas que se mantienen con agua durante casi todo el año y crea problemas.','Aeronáutica, fauna, flora, aves, gramineas',2,400,11,1,11,1,1,NULL,4,'',NULL,NULL,0,0,'2015-05-29 15:57:21'),(114,4,1,'AMÉRICA CENTRAL EN LA MIRADA EXTRANJERA  EXPLORADORES Y VIAJEROS ENTRE 1845  a 1898.  (Beca DICU)','El presente  proyecto estudia los  libros de viajeros extranjeros por Centroamérica, mismos  que fueron publicados entre los años de 1845 a 1898. El estudio se realizada en base a la propuesta teórica de investigación  filológica de Rafael Cano,  donde se genera y explica  el análisis de textos dentro de las  distintas áreas del conocimiento científico social.  Los libros viajeros analizados,  en  primer lugar, se han  categorizando evaluándolos conforme a las visiones viajeras desde el punto de vista filológico, estableciendo  a la literatura de viaje como un género que ha existido dentro de la narrativa y que ha ido evolucionando con  el correr de los años. A través de este género literario, se  estudian  a los autores extranjeros propuestos, dentro de  múltiples  puntos de vista  de especialistas , quienes  aportan en sus escritos  análisis desde la perspectiva  del conocimiento propio  que van  desde  la Economía, la  Lingüística, el Derecho, la Literatura, la Historia, además de lo  artístico,  la traducción e interpretación; tomando  cada investigador en consideración todos  los contextos  históricos y sociales  desde la perspectiva  diacrónica y sincrónica, que exponen escrituralmente  cada uno de los  viajeros extranjeros.  Dentro del proceso de la investigación   se puede  esbozar la concepción de la  escritura  viajera, se apoya en   la construcción de los  visitados  desde la perspectiva  del autor,  quien  través de un  prismático ideológico dominante y particular,  va describiendo a toda  la sociedad en general. De esta manera es evidente  la relación de la ideología identitaria de los autores, pues  resulta  interesante, que al leer los  distintos relatos  de viaje realizados por  Honduras en particular, y Centroamérica en general; los autores escriben y describen a la sociedad  visitada, desde una óptica muy individual, pues sin lugar a dudas, cada uno de ellos viene de tierras lejanas, con una concepción cultural muy distinta a la de la sociedad visitada. Cada autor viajero se apropia  de la realidad y  analiza la nación  asépticamente, generando tal vez,  una quimérica realidad en relación con los actores de la historia.','Literatura de viajes, Viajeros extranjeros por Centroamérica  siglo XIX, Destino manifiesto. Historia de Honduras siglo XIX.',1,196,9,1,11,3,1,NULL,60,'Hay que ver la parte de la normativa empleada...eso no se puede vislumbrar en el formato que se está usando. Y ver lo del numero de paginas',NULL,NULL,1,0,'2015-05-29 15:59:56'),(115,2,1,'Inversión Extranjera Directa: Efecto Crowding In o Crowding Out en C.A','Uno de los objetivos de esta investigación es determinar sí la inversión extranjera directa que recibieron los países de Centroamérica, en el período 1980-2014, tuvo un efecto crowding in o crowding out sobre la inversión doméstica. Además, se describe la evolución de los flujos de IED en el mundo y en la región, así como los patrones de distribución de la misma, también se analiza el vínculo entre violencia-IED y Corrupción-IED. Para estimar dicho efecto, se utilizó un modelo de series de tiempo, los resultados de la investigación revelaron que la IED tuvo un efecto crowding in en Costa Rica y Honduras en las primeras 2 décadas y  en los demás países de la región se observó lo contrario. Sin embargo, en el siguiente período el efecto crowding in se observó únicamente en Nicaragua y en los demás países fue crowding out, a excepción de Costa Rica donde tuvo un efecto neutral.','Inversión extranjera directa, efecto crowding out, crowding in, inversión doméstica.',4,406,11,1,11,3,1,NULL,200,'Solo una cuestóin de forma, los nombres de los participantes algunos están con mayúsculas y otros con minusculas',NULL,NULL,1,0,'2015-05-29 16:05:40'),(116,3,1,'La Evolución del Mercado Laboral de Honduras en el último quinquenio','En las últimas décadas los países de América Latina, han experimentado cambios en sus mercados laborales, Centro América no escapa de ello y mucho menos Honduras, entre ellos destacan la creciente participación  de las mujeres en el mercado laboral, la mejora en los niveles educativos y que el desempleo está afectando  más a hombres y a la población joven de ambas sexos.  \nEn esta investigación se analiza la evolución del empleo, sus características y su impacto en el crecimiento económico en el período comprendido entre el año 2009 y 2013. Los cambios suscitados en este periodo están relacionados con el contexto económico-productivo y con el marco político- institucional del quinquenio.  Se muestra como la participación de la mujer ha mejorado en el quinquenio pero que aun así Honduras es uno de los países de América Latina que presenta tasas bajas de participación femenina.  Asimismo se expone  como los cambios en las políticas de empleo incidieron en la generación del mismo. \nFinalmente se destaca como el nivel educativo es muy importante en el tópico laboral; pero a la vez se observa, como el esfuerzo de las personas al instruirse no es favorecido para obtener una mejor oportunidad de empleo la cual favorezca a su formación, similar situación sucede con los que tienen poca o ninguna educación que por no poseer una adecuado preparación no son tomados en cuenta para ocupar una plaza determinada. Lo apuntando anteriormente esta relacionado con la complejidad del mercado laboral donde en ciertas ocasiones no solo se requiere de la formación sino que de la experiencia que haya adquirido las personas en la plaza a ocupar especialmente en el sector industrial.','Empleo Mercado laboral desemplo',2,318,11,1,11,2,1,NULL,10,'',NULL,NULL,0,0,'2015-05-29 17:28:14'),(121,5,1,'Comparativa de métodos estadísticos para la mejora   de productividad en la industria del puro de tabaco   en Honduras','El trabajo consiste en comparar las diferentes medidas cuantitativas de elaboración de puros hechos a mano por los trabajadores,haciendo una diferencia entre \npequeñas, medianas y grandes empresas tabacaleras. Se estudia la medición cuantitativa de calidad del producto finalizado, así como el uso muestreo en la elaboración de nuevos productos o nuevos movimientos de los materiales de producción.\nIgualmente se identifican las diversas técnicas estadísticas  asociadas a predicción y análisis de producción estimada versus producción real.','tabaco puros estadística muestreo métodos producción',1,286,11,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-05-29 18:40:41'),(122,2,1,'Contexto de la enseñanza de la investigación en la Facultad de Ciencias de la Universidad Nacional Autónoma de Honduras','La presente investigación plantea un análisis del contexto de la enseñanza de la investigación en la Facultad de Ciencias de la Universidad Nacional Autónoma de Honduras (UNAH), describiendo las competencias investigativas que desarrollan los estudiantes en el transcurso de su formación profesional, así como los conocimientos adquiridos en las asignaturas de seminario de investigación y la percepción general que poseen el estudiantado en torno a la investigación y en particular a los procesos de enseñanza aprendizaje con los que se enseña a investigar en su carrera. La metodología consistió en un análisis censal de los estudiantes matriculados en las asignaturas de seminario de investigación de todas las carreras adscritas a la Facultad de Ciencias de la UNAH durante el tercer período académico del año 2014, lo que permitió identificar las fricciones que limitan el aprendizaje eficiente de la investigación por parte de los estudiantes, así como la percepción de éstos en relación a los contenidos impartidos en el seminario de investigación, las fuentes bibliográficas consultadas, el uso y nivel de dominio de herramientas computacionales, la aptitud hacia la investigación, entre otras.','Investigación, metodología de enseñanza, competencias investigativas, momentos de la investigación',1,311,9,1,11,2,1,NULL,25,'',NULL,NULL,0,0,'2015-05-29 19:01:45'),(124,3,1,'Transferencias Monetarias Condicionadas dentro del contexto del desarrollo en Honduras','Antecedentes\nA lo largo de la década pasada Honduras tuvo un comportamiento económico fluctuante, en los años intermedios de la misma se dio un crecimiento económico oscilando alrededor de 5.4%, pero luego tuvo una deceleración del -2.1%  a finales de la década 2001-2010; unido a este panorama, otros indicadores también desmejoraron en su conjunto e impactaron directamente en la renta de los ingresos de los hogares hondureños, en el 2012 el país tenía ingresos medianos bajos, con un  ingreso nacional bruto per cápita de US$4,270.00, ubicando a Honduras en el puesto 162 a nivel mundial (Banco Mundial, 2014).\nPor otro lado, hay que reconocer que se han hecho esfuerzos por disminuir la pobreza, para mejorar las condiciones de vida de la población, aumentando el acceso a la salud y  los niveles educativos de los niños y jóvenes; sin embargo,  Honduras sigue siendo uno de los países más pobres de la región, con muchas desigualdades e iniquidades. Aún faltan esfuerzos para revertir esta situación, siguen siendo insuficientes los programas y proyectos en las áreas de salud, educación y nutrición y empleo.\nEn este contexto, se han implementado proyectos para subsanar el impacto de las condiciones socioeconómicas y para mejorar las condiciones de pobreza; básicamente se  han orientado programas y proyectos para atender necesidades de educación, salud y nutrición de los hogares que se encuentran en pobreza y pobreza extrema. Estos proyectos están diseñado dentro de los programas denominados ?Programas de Transferencias Condicionadas?, o aquellos incentivos en efectivo que se les da a las familias que cumplan con requisitos y conductas como: i.- Enviar sus hijos menores a la escuela, ii.- Llevar a estos a los chequeos médicos, lo que en general aumentan la escolaridad de los niños, mejora la cobertura de atención en salud e incrementa los niveles de consumo de los más pobres, con una consecuente mejoramiento de la calidad de vida de estos.\n Objetivos \nConocer que son los programas de transferencias condicionadas en Honduras y sus alcances\nA partir de las evaluaciones de los PTC  conocer los factores de impacto \nDentro del contexto del desarrollo establecer la vinculación de PTC\n\nPrograma de Transferencias Monetarias Condicionadas: Generalidades \nLos programas de transferencias monetarias condicionadas puntualmente son los programas de la protección social, que buscan  por medio de la transferencia de donaciones en efectivo estimular el desarrollo de la población a través de un conjunto de corresponsabilidades o condicionalidades, que se centran principalmente en la salud y educación infantil, y en algunos casos también en la salud materna.\nLos programas de protección social fueron  implementados por varias razones: \ni.- La economía del país se estancó, lo que generó altas tasas de pobreza y de trabajo informal. Grandes grupos de población carecieran de la cobertura de planes de seguridad social asociados al empleo formal (Fonseca, 2006).  \nii.- Promoción del concepto de \"crecimiento pro-pobre\", que incluía oportunidades de empleo y políticas públicas dirigidas a mitigar las desigualdades, con especial énfasis en las mujeres y en grupos tradicionalmente excluidos. Se incorporó la idea de que las inversiones en necesidades humanas básicas mejoran la productividad y contribuyen a la eficiencia y al crecimiento económico, según (Kakwani y Pemia, 20009); (Eastwood y Lipton, 2001); (Ravallion, 2004) citado por BID, 2013.\niii.- La reactivación del crecimiento económico amplió el espacio fiscal para asistencia social en la década del 2000 (Ver Cuadro No. 1).\nCuadro No. 1: Crecimiento económico de Honduras\nPaís		             Período		\n	1980-2002	2003-2008	2009	2010-2011\nHonduras	2.9	5.4	-2.1	3.2\nFuente: Indicadores del Desarrollo Mundial (consultados el 11 de enero de 2013).\niv.- Las transferencias monetarias condicionadas fueran vistas como una forma de redistribución con estándares morales y técnicos aceptables. La economía política de los programas contribuyó a garantizar el apoyo de políticos y votantes, que valoraron la transparencia de los procesos de focalización de beneficiaros de los programas de transferencias monetarias condicionadas y la exigencia a los beneficiarios de cumplir con su parte de la responsabilidad, haciendo de la participación un contrato implícito con obligaciones tanto para los gobiernos como para los hogares pobres según (Fiszbein y Schady, 2009) citado por BID, 2013.\nPrograma de Transferencias Monetarias Condicionadas  en Honduras ?Bono 10 Mil?\nDentro de muchos proyectos sociales que se han estado ejecutándose, hay los 2 programas prioritarios de protección social: i.- El programa Bono 10 mil y ii..- el Programa de Apoyo al Bono Vida Mejor implementado por el actual gobierno para reforzar la Política de Protección Social\nConclusiones y recomendaciones para el futuro\nLos programas de transferencias condicionadas en efectivo tienen una evidencia sobre su impacto positivo en la acumulación de capital humano en humano en los hogares pobres. Sin embargo, hay efectos indeseables.\nEl éxito de este tipo de programas respecto del aumento de las tasas de matrícula, el mejoramiento de la utilización de servicios de salud preventiva y el aumento del consumo a nivel del hogar. Pero habría que evaluar si este comportamiento no solo es producto del bono,  si a largo plazo produce un efecto positivo.\nLos PTC han proporcionado a los políticos pruebas empíricas respecto de la eficiencia y la eficacia, lo que además permite replicar los programas a escalas geográficas mayores y expandirlos a nuevos grupos demográficos, así como implementar ajustes necesarios para el diseño de políticas. El enfoque debería llegar a los más pobres, más vulnerables y necesitados,  de manera de incidir sobre la pobreza generacional.\nLos PTC son una herramienta importante dentro de las políticas sociales, que buscan aumentar los niveles de consumo de las familias por medio de transferencias monetarias y así reducir la pobreza en el corto plazo para romper con la reproducción intergeneracional de la pobreza.\nAun cuando las transferencias se consideran esenciales para incentivar el uso de servicios de salud y educación, y así lograr objetivos de desarrollo humano, en el país  es urgente reflexionar sobre la necesidad de destinar los  fondos  para  la  reducción  de  la  pobreza  no  solo  al  incremento  de  la demanda de servicios de salud y educación, sino también a la expansión y el fortalecimiento de la oferta?.','Transferencias monetarias Cindicionadas, Desarrollo, Pobreza',2,301,9,1,11,3,1,NULL,70,'',NULL,NULL,1,0,'2015-05-29 20:10:31'),(128,2,1,'efiCIENCIA','Presentación del proyecto ganador del Concurso Nacional de Vivienda Social 2014, promovido por el IHCIETI (Instituto Hondureño de Ciencia, Tecnología e Innovación. efiCIENCIA, más una filosofía que un concepto aborda los temas que condicionan el desarrollo de la vivienda social en Honduras. La propuesta de vivienda social presenta evita ser un prototipo concreto y se define mejor como un concepto moldeable. La investigación y diseño de este prototipo trae en discusión los siguientes temas:\n-la posibilidad de consolidar mercados nacionales sostenibles con el uso y regulación de recursos renovables\n-la posibilidad de crear microcomunidades a partir de la producción en masa de vivienda social\n-el nuevo rol del arquitecto en una sociedad emergente de tercer mundo\n-la sistematización de los recursos y los insumos para la producción y socialización de la vivienda social\n-desarrollo de tecnologías lowcost \n-La posibilidad de implementación de políticas y capacitaciones para hacer la vivienda social más accesible','arquitectura vivienda social sostenibilidad prefabricados',4,394,11,1,11,6,2,'2015-06-26',75,'',NULL,NULL,0,0,'2015-05-29 20:53:03'),(130,5,1,'Percepciones cognitivo lingüísticas de los hondureños hacia el español de otras naciones','Se exponen en este estudio, los resultados de una investigación sobre las percepciones cognitivo-lingüísticas de los hondureños hacia el español otros países de habla hispana tales como Argentina, Bolivia,Chile, Colombia, Costa Rica, Cuba, Ecuador, El Salvador, España, Guatemala, México, Nicaragua, Panamá, Paraguay, Perú, Puerto Rico, República Dominicana, Uruguay, Venezuela y se incluye el español hablado por los inmigrantes en los Estados Unidos de América. Los resultados de este estudio recién se han publicado en una de las páginas electrónicas más prestigiosas de Europa, esto es BELLS en Bergen Languaje and Linguistics Studies https://bells.uib.no/bells/article/view/687/677   University of Bergen Library ISSN: 1892-2449 de la Universidad de Bergen, Noruega. Este estudio se reviste de una gran importancia al realizarse por primera vez en nuestro país con una metodología unificada por  lingüistas en los países de habla hispana, además los resultados demuestran el grado de identidad y lealtad que los hondureños tienen hacia su propia lengua. Por otro lado esta investigación pretende constituirse en la base de futuras políticas lingüísticas que permitan a la población hondureña mejorar sus competencias lingüísticas a partir de una autoestima saludable desde  la comunicación oral y escrita. Las percepciones cognitivo-lingüísticas abarcan: El español del país que los capitalinos consideran similar al suyo, el español del país que los capitalinos consideran diferente al suyo, las actitudes afectivas hacia el español de otras naciones, las preferencias generales por otras variantes dialectales, la enseñanza por profesores de otro país de habla hispana,  las preferencias dialectales en los medios de difusión, el habla del país en el que los capitalinos consideran se debe proporcionar la información telefónica, y el habla del país en el que los capitalinos consideran que se debe hacer doblaje de películas.','Lingüística, cognitivo lingüístico, español, identidad, lealtad, variantes dialectales.',2,338,11,1,11,2,1,NULL,50,'',NULL,NULL,0,0,'2015-05-29 22:21:29'),(131,2,1,'Automatización de registro de parámetros meteorológicos de interés energético','La Sección de Energía, Escuela de Física, Facultad de Ciencias, desde el año 2010 instaló una estación meteorológica automática que transmite la información a una consola receptora remota, con transmisión de data vía FM, misma que se almacena directamente en tiempo real en un computador. Los datos que registra la estación meteorológica son: Radiación solar, energía solar, máximos y mínimos de radiación solar, radiación ultra violeta solar y dosis de radiación UV, velocidad y dirección del viento, máximos y mínimos de la velocidad del viento y dirección de la velocidad máxima del viento; temperatura interior (lugar del receptor) y exterior (ambiente); índice de calor; temperaturas máximas y mínimas diaria y por datos; índice de temperatura de congelamiento; punto de rocío; presión atmosférica; ratio de lluvia, ratio de lluvia acumulada, densidad del aire interior (consola) y exterior (ambiente), entre otros parámetros meteorológicos.\nInicialmente, la información se almacenaba en el computador, posteriormente se procesaba y analizaba con el fin de realizar estudios de investigación relacionadas con potenciales energéticos renovables locales. Actualmente, la data se puede visualizar, y analizar automáticamente en tiempo real, gracias a la implementación del software y su apropiada configuración para su monitoreo y el empleo de una hoja web como si fuese un SCADA básico para su conexión y difusión a través del Internet, por lo que podemos monitorear los datos registrados por la estación meteorológica en tiempo real e históricos.\nActualmente contamos con una hoja web piloto de la Sección de Energía en la que se cuenta con un vínculo para accesar a los datos de la estación meteorológica.\nEl haber desarrollado éste mecanismo, nos facilita el análisis de los datos en cualquier lugar y tiempo, además de evitar las pérdidas de data, ya que su almacenamiento es automático; gracias al cual; por ejemplo, podemos analizar parámetros como el potencial de energía renovable disponible en Ciudad Universitaria, la incidencia de UV solar y la densidad del aire que puede ser un indicador de contaminación local de la atmósfera. El objeto de este trabajo, es presentar a la Comunidad Universitaria los resultados registrados y un pequeño análisis de algunos parámetros de interés en las investigaciones científicas de la Sección de Energía. La data y la mecánica de almacenamiento, fruto de éste trabajo, puede ser de gran utilidad a los investigadores interesados en el análisis de los datos que se registran en la estación meteorológica.','data meteorológica, potencial energético, automatización, adquisición de datos',2,163,9,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-05-29 23:06:35'),(133,5,1,'Honduras: Su posición geográfica codiciada','Honduras: una posición geográfica codiciada\nEl motivo de esta investigación surge de la revisión bibliográfica y documental durante más de diez años sobre la comprensión y explicación en la Cátedra de Historia de Honduras sobre los primeros cincuenta años de presencia española, específicamente en lo que se ha dado en llamar ?Exploraciones, conquista, colonización y Organización político-administrativa de Honduras?.\nLa historiografía ha sido dispersa y escasa en relación a la importancia del problema. Se han escrito obras monográficas y desde múltiples perspectivas acerca de la búsqueda del paso entre el Océano Atlántico al Océano Pacifico, búsqueda iniciada por Cristóbal Colón, seguido de Vicente Yáñez Pinzón y Juan Días de Solís, Vasco Núñez, Hernán Cortés, Gil González Dávila, a fines del siglo XV y los primeros cincuenta años del siglo XVI. \n\nEs así como nos explicamos que durante el período colonial las comunicaciones entre España y sus colonias americanas, por supuesto, eran totalmente dependientes del transporte marítimo. La travesía transatlántica dio a España el acceso a las Antillas, la costa caribeña de América del Sur y Central y las costas del Golfo de México.\nSin embargo la idea y el proyecto de comunicar ambos mares no quedan engavetados en la época colonial. En el siglo XIX, nuevamente resurge la idea, con la diferencia que en estos tiempos, el ferrocarril impulsado por locomotoras y vagones es la respuesta a los avances en las comunicaciones.  \nLa construcción del canal interoceánico que debía unir las aguas del Atlántico y el Pacífico es uno de los sueños de países, empresas y gobiernos nacionales,  hasta nuestros días siguen pendientes por hacerla realidad, este sueño ha convertido a Honduras y Centroamérica en ese espacio codiciado, posicionado, intervenido y saqueado por más de 500 años, potencias como: desde España, Inglaterra, Estados Unidos y más recientemente la China Continental.','Estrecho Dudoso, Camino Real, Depresión Transversal, Ruta Transitsmíca, Ferrocarril Interoceánico, Canal Interoceánico.',2,357,11,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-05-30 01:04:28'),(134,2,1,'Operaciones en programas de producción: relaciones con competitividad','Actualmente, los productores deben enfrentar mercados que requieren una capacidad rápida de respuesta. Ello significa que la implementación eficaz de programas de producción debería llevar a una mayor competitividad. Por lo tanto, este resumen analiza los operaciones de programas de producción en diferentes contextos industriales con un triple objetivo: (1) determinar si existen diferencias entre diferentes sectores industriales; (2) verificar las interrelaciones de los programas de producción con la competitividad; y (3) comprobar si los distintos contextos industriales explican las diferencias de competitividad','Operaciones, Programas de producción, competitividad',2,107,7,1,11,3,1,NULL,35,'',NULL,NULL,1,0,'2015-05-30 02:59:10'),(135,5,1,'Técnicas y estrategias de la traducción en literatura viajera','El presente estudio se enmarca en el proyecto de investigación ?América Central en la mirada extranjera: exploradores y viajeros entre 1845 y 1898?  financiado por la DICYP mediante beca sustantiva. Dicho trabajo está basado en la experiencia de traducción de textos viajeros, del inglés al español respectivamente. Hasta el momento hemos trabajado en cuatro  textos de  la revista Harper?s Magazine; todos  publicados a mediados  del siglo XIX, que narran la experiencia de viajeros que recorrieron zonas específicas de nuestro país Honduras. Cabe mencionar que este no fue un trabajo traductológico común, sino que se utilizaron  técnicas y estrategias que nos han permitido conocer la visión del mundo de los viajeros mencionados, pero  también respetando los arcaísmos y giros lingüísticos propios de la época, de manera que la riqueza cultural subyacente en el texto viajero se conserve y podamos visualizar las descripciones que ahí se nos presentan. Las traducciones de este tipo de literatura pueden verse afectadas por la fidelidad del traductor al texto original, sobre todo porque los traductores hemos sido enseñados a traducir de manera literal, pero mediante esta estudio queda demostrada la importancia de los rudimentos de la lingüística y la filología, la utilización de herramientas como el Corpus Diacrónico del Español o el Tesoro Lexicográfico de la Lengua Española para realizar las traducciones adecuadas e ir más allá del valor comunicativo del texto. Nos hemos auxiliado para este trabajo de disciplinas como la lingüística, la etnolingüística y por supuesto la traductología.','Técnicas, literatura viajera, lingüística, texto, traductor, traductología.',1,338,11,1,11,2,1,NULL,50,'',NULL,NULL,0,0,'2015-05-30 03:06:14'),(136,3,1,'Fotografia Documental en Honduras: la Fototeca Nacional de la UNAH','Entre las distintas colecciones fotográficas que componen la Fototeca Nacional de la Universidad Nacional Autónoma de Honduras (UNAH), encontramos un grupo de 20 imágenes que retratan distintas facetas de la tristemente recordada guerra civil del año 1924: sus antecedentes, sus principales protagonistas o las primeras pruebas de la aviación como arma de guerra son algunos de los temas que podemos encontrar en ellas. Y si bien es cierto, al analizar estas imágenes podemos inferir que el fotógrafo gozaba de amplias libertades para movilizarse en el bando que salió triunfador del triste suceso, las limitantes técnicas de la fotografía en ese momento hacen que este registro gráfico de la guerra se magnifique y se convierta en un documento histórico pleno de información para entender y analizar una época oscura de nuestra nación, fotografías captadas pese a todas las vicisitudes que con seguridad debieron padecer el o los artistas gráficos que las realizaron.\nEl estudio de estas imágenes que ahora pertenecen al acervo institucional de la UNAH, nos ayuda a entender mejor la compleja trama de las guerras civiles que asolaron la nación en el primer cuarto del pasado siglo XX, su estudio también nos enseña un breve espacio de tiempo en la historia de la fotografía documental de nuestro país y los procesos históricos de esta disciplina artística que se utilizaron para congelar en película un momento dado de nuestra historia. Su estudio rescata no solo el hecho registrado en ellas, sino también la historia de la fotografía documental en Honduras, tema sobre el cual muy poco ha escrito la academia y los mismos artistas que le han practicado.','1924, guerra civil, montoneras, El Berrinche, fotografía documental, negativos en película, nitrocelulosa',2,329,11,1,11,2,1,NULL,50,'',NULL,NULL,0,0,'2015-05-30 03:58:38'),(137,2,1,'Deformación Dinámica de Variedades Matriciales Toroidales','Presentaré una técnica, que he desarrollado en colaboración con mi asesor principal de tesis doctoral, la cual hemos llamado, deformación dinámica por acción de semi-grupos dinámicos libres, dicha técnica, nos permite estudiar la beneficiosa interrelación entre las estructuras geométricas no-conmutativas, que hemos llamado variedades matriciales toroidales, y elementos en algebras de operadores y grupos unitarios, que permiten el estudio de procesos de naturaleza cuántica en física y matemática. En particular, los resultados relacionados con este trabajo, nos permiten establecer un vínculo entre procesos físicos de alta complejidad y entes geométricos de naturaleza relativamente simple, lo cual nos ha permitido resolver problemas que permanecían abiertos hasta ahora. Algunas conexiones y aplicaciones a la física matemática y la biología teórica será discutidas al final.','Topología y geometría no conmutativas, deformación de variedades complejas, álgebras de operadores, flujos geométricos.',3,303,9,1,11,1,1,NULL,35,'',NULL,NULL,0,0,'2015-05-30 05:38:58'),(138,5,1,'Perspectivas de decodificación en la Literatura de viajes dentro del marco de los estudios humanísticos','El potencial de los estudios interdisciplinarios aplicados al campo de las Humanidades es creciente en la actualidad, de esta manera es  pertinente indagar las  distintas posibilidades de investigación y análisis aplicados a la  literatura de viajes. De esta manera , este panel de investigación  trata desde distintos puntos de vista de  varios  especialistas, aproximarse y estudiar   la mirada particular  de los escritos literarios desde la perspectiva   lingüística, didáctica, artística , periodística e histórica  aplicada  a  la Literatura de viajes;  pues se considera que esta literatura en particular  es un vehículo que provee aproximaciones  de modo asertivo   de  las  sociedades visitadas por los autores viajeros  por medio de  referencias geográficas, culturales, políticas y económicas   en un momento determinado. Para nuestro estudio aplica  especialmente aquellas referencias  en la que Honduras  constituye  el destino del viaje   entre  los siglos XIX y  XX.','Literatura de viajes, Humanidades, Arte, Economía, Literatura, Lingüística, Historia, siglos XIX y XX',4,403,11,1,11,3,1,NULL,50,'',NULL,NULL,1,0,'2015-05-30 06:01:35'),(139,2,1,'Cambio climático: de la adaptación a un enfoque de adaptación.','El abordaje teórico del cambio climático en los últimos 20 años ha estado circunscrito al campo de las ciencias naturales. Siendo la Biología, Ingenierías y Química, las disciplinar que más han abordado esta problemática. De hecho los estudios y correspondientes publicaciones en el área de las ciencias sociales a nivel global son comparativamente menores a los de las ciencias naturales y más específicamente en el campo de la Sociología son escasos en cantidad y en propuestas metodológicas y de cambio social.\nEn el área de la sociología sobresalen los estudios fundamentados en los conceptos evolucionistas de adaptación inspirados en el darwinismo social y de mitigación también de carácter funcionalista. Estos dos enfoques son  predominantes  e impulsados por organismos internacionales como el PNUD. y otras agencias de cooperación; no obstante en Honduras son casi nulos los estudios acerca de los contenidos políticos, económicos y culturales subyacentes en dichas propuestas. Además cabe resaltar que desde la Sociología se abordan otros enfoques fundamentados en los paradigmas conflictivitas e interaccionistas que pueden generar una serie de propuestas alternativas a la crisis global provocada por el cambio climático a la crisis multidimensional generada por el cambio climático.  \nEl objetivo de la conferencia es, Esbozar los múltiples enfoques o abordajes analíticos que la sociología como ciencia propones para comprender, explicar y generar propuestas alternativas en el nuevo contexto del cambio climático. Tal presentación parte de la hipótesis de que el enfoque de adaptación al cambio climático predominante en el país contiene un alto componente político y cultural que impide a los sectores más vulnerabilidades construir estrategias alternativas ante esta problemática que permitan una transformación integral de transformación integral desde sus capacidades. \nA nivel metodológico la presente propuesta parte de un análisis exploratorio de la literatura existente tanto en el campo de la sociología como en el del cambio climático. A partir de estos insumos se construye una ruta crítica que parte desde el enfoque funcionalista, pasando por el conflictivista y culminado en el interaccionista. En cada uno de ellos se destacan las teorías y conceptos clave que explican integralmente el abordaje del cambio climático en las principales experiencias desarrolladas en los últimos 20 años a nivel nacional e internacional.','Cambio climatico, Paradigmas, Adaptación, Pobreza, Cambio Social.',2,440,11,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-05-30 16:30:45'),(140,2,1,'Evaluación de la vulnerabilidad y capacidad de respuesta ante desastres de la UNAH','La UNAH no esta exenta del impacto de las amenazas que afectan al municipio del DC, se ha visto históricamente que algunas amenazas como las lluvias provocadas por algunas tormentas tropicales\nhan causado inundaciones en en campus universitario,han ocurrido algunos incendios como el que causo el desastre en agosto de 2008 que afecto el antiguo edificio de Qui mica y Farmacia, así como el ocurrido en marzo de 2012 en los predios del edificio de laboratorios de ingeniería. En este contexto, la UNAH es propensa a algunas amenazas,por lo que esta investigación busco evaluar a través de dos matrices de indicadores la capacidad de la vulnerabilidad y capacidad de respuesta a desastres de la UNAH. Obteniéndose como resultado que el 45% de los edificios estudiados esta en baja vulnerabilidad y baja capacidad de respuesta ante desastres, el 45% en capacidad media y solo un 10% puede responder adecuadamente a una emergencia, por lo que es importante trabajar en estos temas de reducción del riego de desastres desde el interior de la UNAH.','Vulnerabilidad, Amenazas, Riesgo, Desastre, Capacidad de respuesta',2,442,11,1,11,1,1,NULL,30,'',NULL,NULL,0,0,'2015-05-30 17:16:13'),(141,4,1,'Respuesta del bosque CURLA a la aplicación de tratamientos silviculturales, La Ceiba, Honduras.','Desde 1994 con el apoyo de Proyectos como PDBL, TRANSFORMA, PROINEL, se instalaron 4 parcelas de monitoreo permanentes (PPM) en el bosque conocido como 2000ha, que pertenecen al Centro Regional Universitario del Litoral Atlántico (CURLA). El estudio tiene como objetivo determinar la respuesta del bosque ante las intervenciones silviculturales, mediante la evaluación de variables como crecimiento en diámetro, mortalidad, natalidad o reclutamiento entre otras. El problema que se desea resolver es la proyecciones de volúmenes y estimación de volumen de corta anual permisible (VCAP), en estos momentos la información utilizada no es propia del país, lo que se ha hecho es usar información generada en otros países de Centroamérica, es por ello que la información	 generada en las PPM nos servirá para generar esta información y así en el mediano plazo  podemos usar estos datos propios del país, con ello estaremos contribuyendo a proyectar datos acorde a la realidad de nuestros bosques. Para lograr información consistente las parcelas se instalaron en el mismo tipo de bosque, el tamaño de las parcelas es de 50 m X 50m (0.25ha), subdividida en parcelas de 10m X 10m, cada parcela cuenta con una faja de protección de 25m de ancho, para evitar el efecto de borde. De acuerdo a los resultados obtenidos, las especies actualmente comerciales pasaron de un Índice de Valor de Importancia (IVI) de 24% a 29.8% con un incremento de 24.02%, mientras las especies sin valor comercial y potenciales disminuyen de 48.7% a 45.2%. En composición florística encontramos 482 individuos por ha, en 29 familias, 43 géneros y 52 especies. Crecimiento promedio fue de 0.54 cm al año. La mortalidad fue mayor en la parcela tratada (50%); al igual que el reclutamiento  (150%).En la última medición realizada el área basal incremento en 1.3 m²/ha, concentrado en las especies actualmente comerciales. La información que se está generando en las PPM servirá para realizar los diferentes cálculos en los planes de manejo en bosque latifoliado del país.','Parcelas permanetes, tratamientos silviculturales, dinamica',1,441,11,1,11,3,1,NULL,25,'',NULL,NULL,1,0,'2015-05-30 17:25:35'),(142,2,1,'Evolución Política del Titular de Prensa Acerca del Movimiento Social Obrero Hondureño','Las empresas dedicadas a la difusión de contenidos comunicativos? ¿manifiestan un posicionamiento político en sus rotativos? En Honduras, su papel se ha visto cuestionado durante los últimos años, a raíz de su participación en la crisis política que desembocó en el Golpe de Estado del 28 de junio de 2009. Esta investigación documental se apoyó en la epistemología de la Teoría de la Agenda Setting y el Análisis de Cultivo, con la metodología del Análisis de Contenido y una entrevista-sondeo entre informantes claves, se realizó una aproximación exploratoria al problema de la conflictividad y/o afinidad de intereses de diario La Prensa y Tiempo, en relación a la movilización insigne de los trabajadores: las protestas del 1° de Mayo de cada año, desde 1965 para La Prensa, y desde 1972 para diario Tiempo. Los resultados afirman suficientemente que la hipótesis es válida: diario La Prensa sí expresó mayor conflicto de intereses y, por lo tanto, menor afinidad con el movimiento social obrero. Tal aseveración se sustenta por el análisis de frecuencias temáticas y semánticas de sus titulares principales y secundarios, por la orientación valorativa (semiótica) de sus portadas analizadas como conjunto y por la percepción de 6 de las portadas en años de alta significancia histórica nacional: 1974, 1990 y 2012, por parte de informantes claves representativos de la sociedad adulta hondureña de la costa norte. El estudio es de nivel exploratorio, por lo tanto se debe profundizar en la comprobación cualitativa y cuantitativa de la hipótesis en cuestión.','MT 5.1 Invest. y Politica de la Comunicación, TE Sociología de la Comunicación, TE2 Opinión Publica, UP Control de la Prensa',4,444,11,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-05-30 20:03:33'),(143,4,1,'Bases de Datos para fortalecer Herbarios en Honduras','Un herbario se refiere a una colección de muestras botánicas, desecadas y prensadas, y posteriormente incorporadas en bases de datos que dependiendo de la disponibilidad de recursos se pueden encontrar en linea, estas plantas y datos  representan el patrimonio vegetal de una localidad, región o país.\nLos herbarios son herramientas de primordial importancia para la taxonomía vegetal, entre otras razones porque proveen el material comparativo que es fundamental para descubrir o confirmar la identidad de una especie, o determinar si la misma es nueva para la ciencia (Lot & Chiang 1986). Adicionalmente, los herbarios son esenciales para estudios en áreas tales como: sistemática, ecología, evolución, morfología, anatomía, etnobotánica, conservación de recursos naturales, biogeografía, medicina, criminalística, paleobotánica, palinología, genética, fenología, jardinería y educación (Bridson & Forman 1992). Los herbarios son una fuente de información acerca de las plantas y del medio en que habitan y suponen en si mismos un registro permanente de la biodiversidad (Quesada et al. 1998). \nDebido a la importancia de la informacion contenida en los herbarios que es necesario  que la misma se encuentre organizada en una base de datos para hacer mas eficiente y optimizar los inventarios, la investigación y la conservación de los recursos vegetales. BRAHMS (Botanical Research and Herbarium Management System) es un sistema flexible de base de datos para la investigación botánica y para el manejo de herbarios; que provee una gran funcionalidad para recolectar, editar, analizar, publicar datos botánicos y optimizar la curación de especímenes.','Herbarios, Bases de Datos, BRAHMS',3,297,9,1,11,1,1,NULL,8,'',NULL,NULL,0,0,'2015-05-30 20:33:12'),(144,6,1,'Primer Reporte de la especie Arundo donax L. (Poaceae) para Honduras','*Eydi Yanina Guerrero Medina & Adan Flores \nHerbario CURLA, Centro Universitario Regional del Litoral Atlantico CURLA, Universidad Nacional Autonoma de Honduras, UNAH. Telefono: 96769191 correo electronico: eydi.guerrero@unah.edu.hn\n2 Departamento de Biologia, CURLA, UNAH. adan.flores@unah.edu.hn\nSe reporta por primera vez la presencia de Arundo donax L. gramínea exótica invasora originaria de La India; localizada en tres sitios en Tegucigalpa, Honduras. Esta planta es catalogada dentro de la lista las 100  Especies Exóticas Invasoras más dañinas del mundo, en una selección del Global Invasive Species Database,  publicado por el Grupo Especialista de Especies Invasoras (GEEI), un grupo especialista de la Comisión de Supervivencia de Especies (CSE) de la Unión Mundial para la Naturaleza (UICN) en el año 2004.\nArundo es el nombre latino antiguo de  \"caña\", y donax, nombre latino y griego de una especie de \"caña\", en principio se usó como nombre genérico, pero que resultó ser sinónimo de Arundo [En un principio Donax fue utilizado  como género, siendo después sinonimizado con Arundo] Species Plantarum 1: 81. 1753. (Sp. Pl.) \nDistribución geográfica: Arundo donax L. es una especie introducida al continente americano. La distribu¬ción natural de la especie parece ser el sur de Asia, a partir de la India hasta Tailandia. Su introducción en Europa es muy an¬tigua y algunos autores la considera¬ron autóctona en Oriente Próximo y en la región del Mediterráneo. \nNuevo reporte para Honduras; Se colectó una planta de 8 m de altura y con inflorescencia el 11 de diciembre de 2008 en tres sitios en Tegucigalpa, Sitio 1; en un car wash cerca de el estacionamiento del centro comercial Mall Multiplaza 14°10?58.65?? N. y 87°10?58.65?? W. altitud 959 msnm;  el segundo punto  en las cercanías de la oficina principal del Banco HSBC en el Bulevar Juan Pablo Segundo, 14°05?15.24?? N y 87°11?28.89?? W. altitud 980 msnm.  y un Sitio en donde la planta aun está en estado juvenil a inmediaciones del bulevar Suyapa en un predio privado cerca de una gasolinera, 14°05?3.38?? N y 87°10?29.15?? W, altura 1027 msnm. (Fig. 1). Se procedió a identificarla con claves taxonómicas usando Flora de Nicaragua y se procedió a buscar especímenes en los herbarios Paul C. Standley de la Escuela Agrícola Panamericana El Zamorano [EAP] y en el Herbario Cyril Hardy Nelson Sutherland de la Facultad de Biología de la Universidad Nacional Autónoma de Honduras [TEFH]. Asi como también se consultó la base en línea de el Jardín Botánico de Missouri [sw3 Tropicos]. El material colectado fue depositado en el Herbario Paul C. Standley de la Escuela Agrícola Panamericana El Zamorano con código Eydi Yanina Guerrero Medina, colecta 752.','Especie invasora, Flora, Arundo donax',1,297,9,1,11,1,1,NULL,5,'',NULL,NULL,0,0,'2015-05-30 21:01:24'),(145,2,1,'Indicadores de Cambio Climático con enfoque Socio','Las variaciones naturales de la precipitación y la temperatura generan distintos efectos en las economías y la sociedad en general. El presente documento presenta una revisión bibliográfica de indicadores socio-económicos de acuerdo a los distintos sectores vulnerables a modificaciones en las variaciones de precipitación y temperatura debido al Cambio Climático.\nLos primeros capítulos describen los antecedentes, la justificación, objetivos y metodología empleada en esta revisión. Posteriormente un Marco de Referencia provee mayor información histórico-política y conceptual.\nEl capítulo 11, describe el análisis de indicadores para los 7 sectores vulnerables estipulados en la Estrategia Nacional de Cambio Climático, considerando tanto indicadores nacionales que el país actualmente posee como aquellas opciones internacionales de posible aplicación.\nLa revisión bibliográfica concluye con sus respectivas conclusiones y recomendaciones, así como también anexos relevantes para el documento y, un anexo digital de los documentos recopilados con sus fichas bibliográficas y una base de datos en Excel para fichas metodológicas de indicadores internacionales.','Cambio climático, variabilidad climática, adaptación y mitigación',1,294,9,1,11,2,1,NULL,100,'',NULL,NULL,0,0,'2015-05-30 22:15:48'),(146,2,1,'Estudio Hidrogeoquímico de la parte alta de la cuenca del Rio Choluteca','Los habitantes de la ciudad de Tegucigalpa y sus alrededores utilizan los recursos hídricos superficiales como su principal fuente de abastecimiento. Sin embargo en los últimos años este recurso se ha visto disminuido y degradado. La problemática ha sido el resultado de las variaciones en las intensidades de las precipitaciones y del desarrollo de distintas actividades antropogénicas (además de las naturales) que alteran el estado natural del agua y del suelo. Como consecuencia de ello el uso del agua subterránea ha incrementado en varios sectores. Con ello las aguas subterráneas han tomado la importancia que siempre debieron haber tenido dentro de la investigación del recurso hídrico.\n\nEste estudio es una continuación del trabajo realizado por la DGRH-SERNA en el 2008, a través del proyecto Fortalecimiento Institucional en el tema de las Aguas subterráneas, en el cual se desarrolló la hidrogeología y geología de la parte alta de la cuenca del Rio Choluteca donde se censaron 354 pozos, sin embargo los alcances iban encaminados a conocer el medio físico y no se consideró la parte hidrogeoquímica.\nSe hizo igual una campaña (Mayo 2012 ? junio 2013) de muestreo y censo que resulto en 266 muestras, y 114 pozos censados, el número de muestras de agua subterránea se basó en la máxima representatividad del acuífero, en la posible interacción de las aguas superficiales con las aguas subterráneas, en la divisoria de las subcuencas que conforman la parte alta de la cuenca del Río de Choluteca y en la importancia que pudiese representar para las diferentes comunidades que se abastecen de agua subterránea. En general las aguas subterráneas tienden a mantener constante su composición química, tanto más cuanto más profundo y más alejadas de las zonas de recarga. En cuanto a la composición bacteriológica está tienden a ser más cambiante ya que está sometida a acciones muy locales y a cambios rápidos.\nSin embargo es de considerar que existen algunos componentes que evidencias cambios en sus concentración en las dos épocas, unos que se potencian en época lluviosa y otras en época seca, y así mismo es de considerar también que estos cambios son muy parecidos para las aguas superficiales, que tienen una clara influencia en los acuíferos libres evidenciada a través de su semejanza química y su contaminación bacteriológica. \nLas aguas subterráneas son clasificadas en su mayoría por bicarbonatadas cálcicas, bicarbonatadas sódicas, y en algunos casos bicarbonatadas cloruradas y magnésicas, las cuales se potencian de manera distinta en cada época.','Aguas subterraneas, hidroquimica, acuífero',2,294,9,1,11,2,1,NULL,100,'',NULL,NULL,0,0,'2015-05-30 22:18:09'),(147,2,1,'Evaluación de los recursos hídricos en su régimen natural a nivel nacional','La Evaluación de los Recursos Hídricos en su Régimen Natural de Honduras que se ha elaborado por el Instituto Hondureño de Ciencias de la Tierra (IHCIT) de la Universidad Nacional Autónoma de Honduras (UNAH), con la Dirección General de Recursos Hídricos de la SERNA, en el marco del Proyecto Fondo de Adaptación ?Enfrentando riesgos climáticos en recursos hídricos en Honduras: Incrementando resiliencia y disminuyendo vulnerabilidades en áreas urbanas pobres? del Programa de las Naciones Unidas para el Desarrollo (PNUD), representa una herramienta que facilitará y permitirá la implementación de medidas de adaptación al Cambio Climático.\nSe presenta en una primera sección las características generales de Honduras, en conjunto con la hidrografía e información base de suelo e hidrogeología. Posteriormente se presenta el estado de la información meteorológica obtenida por las instituciones generadoras de la información, con la cual se realizó la base de datos homogenizada y estadísticamente analizada, para los parámetros precipitación, temperatura, humedad relativa, radiación solar  y viento (media anual y mensual a nivel nacional).\nEs importante mencionar que se incorporó a este estudio la variable de Evapotranspiración con el auspicio de COSUDE, en la cual se logra presentar esta variable con la fórmula de la FAO Penman-Monteith para poder desarrollar en el futuro índices (sequía, aridez, etc) que requieren que la ETP esté desarrollada por esta fórmula, sin embargo también se desarrolló por los métodos de Jensen-Haise, Hargreaves, Ivanov y Thornthwaite.\nPara el tema de la Infiltración y la recarga se desarrolló una metodología en el cual los resultados son teóricos/potenciales para ambos parámetros, según las metodologías de Losilla y Schosinsky y RAS. Con estos resultados y de las variables climáticas se generó como producto final el balance climático y el balance hídrico potencial del suelo.','Recursos hídricos, escurrimiento, infiltración, precipitación',2,294,9,1,11,2,1,NULL,100,'',NULL,NULL,0,0,'2015-05-30 22:20:07'),(148,1,1,'Incidencia en el uso de habilidades vitales en la gerencia','Los gerentes  no valoran el potencial que dejan de usar por oponerse a una idea positiva y benéfica, valoradas en los conocimientos y habilidades que en potencia tenemos, pues, existen factores que hacen que no veamos oportunidades reales aunque la tengamos en frente. Las habilidades vitales se basan en la psicología humana y teoría de aprendizaje social; esto se basa en las creencias que poseemos y que influyen en nosotros dando a conocer que lo que vemos y pensamos es el límite de nuestro pensar y actuar, esto hace que el potencial para desarrollar se limite y se pongan obstáculos en el progreso o las decisiones que se toman en gerencia se limitan al \"limite que nuestras creencias nos dan\". Esto nos da la particularidad que las personas no progresan no por que no quieran, sino porque las creencias sociales, económicas, políticas nos han limitado a un gusto, una decisión, un determinado crecimiento haciendo que nuestra mente solo encaje en lo que socialmente es aceptado. Es fácil comprobar y hay muchos ejemplos que personas, empresas, proyectos o marcas más exitosas no han encajado socialmente cuando están en construcción, pero cuando son parte de un consumo, es aceptado en nuestro enmarcado pensamiento.  Por lo que un gerente es por lo que piensa (enmarcado en ello), y no necesariamente lo que piensa es lo que necesita la empresa o el mercado. Esto ha detenido el desarrollo por los gustos creados en el área de confort por lo que muchos no terminan su  universidad, no aprenden inglés, y si saben inglés, no aprenden otro idioma, no solucionan problemas conyugales de crisis adecuadamente, no se especializan en un postgrado, buscan descansar, duermen más, trabajan menos, dejan de disfrutar o se sienten grandes cuando son tan jóvenes. De manera empresarial no terminan los proyectos, el crecimiento de la empresa se evalúa sobre el crecimiento personal, no saben trabajar en equipo, sus prejuicios empresariales son distintos, son académicos en una posición empresarial sin ser emprendedores o tener espíritu empresarial.\n\nPor lo que las empresas crecen, pero no como lo haría crecer una persona con un pensamiento en extensión, no amplían oportunidades, y si hay oportunidades no las observan por su magnitud, no filtran los pensamientos a la hora de tomar decisiones, no se conocen en sus potencialidades físico-químicas del cerebro que le benefician, no toman en cuenta la programación neurolingüística para la toma de decisiones, utilizan afirmaciones de complacencia y consideran que la \"verdad\" de cómo viven y piensan es la \"verdad\" que necesita la empresa para seguir, esto va desde el dueño, gerente general o cualquiera que tome decisiones y aporte directa o indirectamente a la empresa.\n\nPero las personas que tienen una dimensión y usan las habilidades vitales adecuadamente, progresan más, tienen éxito en lo sentimental, económico y social, no buscan imitar, son auténticos, por lo que una empresa debe tener una persona que las administre adecuadamente y hacer que los trabajadores pasen por un filtro en su forma de ser, sentir y pensar para que el progreso empresarial sea global y se maneje una cultura empresarial emprendedora y constante. Qué pasaría si a todos los estudiantes se les inculcaran estas habilidades, y los catedráticos las asumieran, si una familia obtuviese estos beneficios, si los desempleados usaran estas habilidades, la sociedad mejoraría y ya no existiría la envidia social, sino una proyección social de beneficio.','Programación Neurolinguistica, habilidades vitales, verdad, ceguera empresarial',3,443,11,1,11,1,1,NULL,1,'',NULL,NULL,0,0,'2015-05-30 22:54:00'),(149,2,1,'REPRESENTACIONES DEL CAUTIVERIO DE LAS MUJERES EN LA ÉPOCA COLONIAL','La historia de las mujeres es un tema que no ha sido tratado en nuestro medio académico desde un perspectiva científica, con la profundidad y creatividad que pretendo en Honduras: Las mujeres al margen de su historia. REPRESENTACIONES DEL CAUTIVERIO DE LAS MUJERES EN LA ÉPOCA COLONIAL es parte de ese trabajo y hoy la presento como una ponencia que constaría de tres partes: la primera  presenta una descripción más que un análisis  de la época y sus cambios. La segunda  presenta el tema y el problema central a partir de la sintesis de dos documentos coloniales claves seguido un breve análisis desmitificador, que nos permita historizar y visibilizar desde las perspectivas pasado/ presente, desde una óptica feminista, el papel asignado a las mujeres en la sociedad colonial y en la construcción de sociedades desiguales, injustas y desequilibradas en América Central, en coherencia con las vidas de las mujeres elegidas, centrada entre fines siglo XVIII. La tercera  parte es una reflexión acerca de los hallazgos de la investigación.\nEl objetivo de este estudio es profundizar en el papel de ellas en el desarrollo de un espacio en el mundo económico,  escenario en el que imperan, aún hoy,  relaciones de poder y determinadas dinámicas de las relaciones entre hombres y mujeres que moldearon la cultura  de las mujeres.','género, mujeres, cautiverio, machismo, patriarcado, colonia',3,291,7,1,11,1,1,NULL,250,'',NULL,NULL,0,0,'2015-05-30 23:38:21'),(150,3,1,'Las pruebas de aptitud de la UNAH, un análisis retrospectivo','La presente propuesta indaga sobre los procesos de admisión a la UNAH  por parte de los nuevos aspirantes a ingresar a esta Institución Educativa del Nivel Superior. Asimismo, indagará sobre los resultados obtenidos de las diversas pruebs aplicadas, así como la(s) principal(es) utilización u objeto de aplicacón de la presente la cual implica una orientación adecuada a los nuevos aspirantes para permitirles qué carrera determinar en base a ciertos criterios de evaluación, a saber: Nivel de puntajes obtenidos en las prubas de aptitud y cierto tipo deaesoría para indicar al estudiante que carrer(s( es la que le permite matricularse en base a los puntajes obtenidos de dicha prueba.','Educación Superior, Evaluación, Rendimientos',1,159,7,1,11,2,1,NULL,9999,'',NULL,NULL,0,0,'2015-05-31 13:32:28'),(151,5,1,'Estado, Políticas Públicas y Desarrollo Social','En la propuesta de panel se abordará el tema del Estado,  su institucionalidad y la definición de las políticas públicas.  Los ejes de discusión son  los siguientes:  (a) las transformaciones estructurales  ocurridas en los últimos años en el país y la región latinoamericana a partir de la crisis del modelo neoliberal; (b) los nuevos planteamientos sobre el rol del Estado y las políticas públicas; (c) la importancia de las políticas públicas para el desarrollo incluyente. \nEl tema invita a reflexionar  críticamente  sobre el rol del Estado en  las nuevas realidades estructurales de la región,  así como en el debate sobre el rol del  Estado y  las orientaciones de las políticas públicas,  los actores sociales implicados  y los  proyectos de desarrollo estratégico.\nEl tema del Estado y políticas públicas  contiene   visiones y posiciones teóricas contrapuestas  sobre  el  Estado y lo público,   por lo que bajo un enfoque relacional  se analizan  críticamente  las  transformaciones más recientes del Estado y las políticas públicas en nuestro país. \nPor otra parte,  la emergencia de nuevas agendas de análisis e investigación   sobre la estructura estatal y las políticas públicas requiere de  la mirada micro y  macro social,  así como la interrelación del análisis interrelacionado de   lo económico, social, político y cultural.','Estado, Políticas Públicas y Desarrollo Social',3,182,9,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-05-31 20:44:52'),(152,5,1,'Algunos aspectos de visibilidad de las Instituciones de Educación superior en la web','Hoy en día, la presencia en la web de las universidades es más que una simple forma de publicitarse, es más bien una necesidad. Con forme a ello un conjunto de aspectos se tornan importantes a considerar.','Visibilidad web, ranking, Universidades',1,340,9,1,11,1,1,NULL,10,'',NULL,NULL,0,0,'2015-05-31 23:33:00'),(153,5,1,'Hacia la internacionalización de la educación superior hondureña','En un momento de competencia entre las instituciones de educación superior, el factor de calidad de la educación, obtiene una diversidad de dimensiones, las cuales se van desarrollando una a una, para ser considerada una universidad de clase mundial, la carencia de una ruta para dicho objetivo, genera que se planteen muchas estrategias para obtenerlo, sin embargo, siempre hay que evidenciar algunos criterios que son base para lograr el objetivo de posicionarse en las mejores posiciones','Internacionalización, Educación Superior, Honduras',1,340,9,1,11,1,1,NULL,10,'',NULL,NULL,0,0,'2015-05-31 23:55:14'),(154,4,1,'Diagnóstico del uso  de las TIC en la educación de la UNAH','La presente investigación se realizó en el centro universitario UNAH-TEC de Danlí, departamento del Paraíso, en donde una de las dimensiones de su visión es la educación con orientación tecnológica. Para este estudio el objetivo general fue diagnosticar el uso de las Tecnológicas de la Información y la Comunicación (TIC), mediante un análisis de condiciones en el contexto educativo universitario para el periodo 2014-2015, cuyas dimensiones en relación a las TIC son las competencias de uso, aprovechamiento y estado físico del equipo tecnológico. . El enfoque de investigación es realizando con un análisis cuantitativo con encuestas aplicadas a 44 docentes y 274 estudiantes, el resultado obtenido muestra que existe un desaprovechamiento de recursos TIC con baja frecuencia de uso y solo tres sobresalen de 11 identificados, también se muestra un nivel bajo de competencias como apoyo al proceso de enseñanza-aprendizaje, además se muestra un 73% de actitud de interés ante el uso de nuevas tecnologías educativas. Se realizó una observación de recursos cuyo estado es descuidado. Para enriquecer el análisis de estudio se estudió la perspectiva del uso de TIC, Con el resultado de la investigación se recomienda un plan de acción enfocado al fortalecimiento de competencias en TIC, definición de roles, soporte técnico del equipo y acompañamiento docente.','Competencias, Diagnosticar, TIC, Tecnología Educativa.',2,150,7,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-06-01 01:58:06'),(158,5,1,'Las Tecnologías de la Información Geográfica para la gestión del Territorio','El objetivo de este Panel es dar a conocer al publico en general sobre los diferentes análisis y discusión, sobre los avances, que estas tecnologías han experimentado en los últimos años. En donde muestra como las TIG tienen como un punto de encuentro multidisciplinar, en el que investigadores relacionan temas con respecto a la Descripción de la Infraestructura Cultural y Recreativa en la Ciudad del Distrito Central de Honduras, la Prospectiva Urbana de la Ciudad de Choluteca, departamento de Choluteca, para el año 2034, El Cálculo de Reflectancia en  Imágenes LandSat (1982?2013)  para la Región Central de Honduras, mediante Modelos Radiométricos con Software Libre SEXTANTE, El Análisis del Impacto Económico del PIB en Centroamérica, Utilizando Sistemas de Información Geográfica, en un periodo de 2010 a 2014 y el Fase Prospectiva de la Cobertura de la Tierra y Uso del Suelo de la Sub Cuenca del Rio Mocal, Lempira, del 2014 - 2034, dando asi pautas la gestion del Territorio con apoyo de las tecnologías de la información geográfica.','Prospectiva Infraestructura, Modelos, Impacto.',2,288,7,1,11,1,1,NULL,30,'',NULL,NULL,0,0,'2015-06-01 16:35:56'),(167,2,1,'Modelado de la corteza continental en Tegucigalpa utilizando el metodo de la función receptora','En este trabajo se presenta el estudio realizado de los todos eventos que han sido registrados por la estación sismológica TGUH ubicada en Tegucigalpa, Honduras desde el año 2006 hasta el año 2014. Dichos eventos fueron seleccionados bajo ciertos criterios y características específicas que debían cumplir para poder determinar cuál es el espesor de la corteza continental bajo la estación que registro los eventos así como la relación que existe entre las velocidades de propagación Vp/Vs, por medio del método de análisis de la Función Receptora que junto con el método de conjuntos (H - $\\kappa$) se obtuvo un modelo estimado de los parámetros de Bulk que caracterizan a la corteza continental, haciendo un estimado de como las ondas convertidas por la discontinuidad de Mohorovicic que arriban e interactúan entre sí para poder recolectar la información que caracteriza el medio que se estudió, aplicando un modelo que se basa en dar valoración con factores de peso a cada onda que arribo.','Corteza, Mohorovicic, Función, Receptora, TGUH',4,105,7,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-06-01 17:46:47'),(168,6,1,'Modelado de la corteza continental en Tegucigalpa utilizando el metodo de la función receptora','En este trabajo se presenta el estudio realizado de los todos eventos que han sido registrados por la estación sismológica TGUH ubicada en Tegucigalpa, Honduras desde el año 2006 hasta el año 2014. Dichos eventos fueron seleccionados bajo ciertos criterios y características específicas que debían cumplir para poder determinar cuál es el espesor de la corteza continental bajo la estación que registro los eventos así como la relación que existe entre las velocidades de propagación Vp/Vs, por medio del método de análisis de la Función Receptora que junto con el método de conjuntos (H - $\\kappa$) se obtuvo un modelo estimado de los parámetros de Bulk que caracterizan a la corteza continental, haciendo un estimado de como las ondas convertidas por la discontinuidad de Mohorovicic que arriban e interactúan entre sí para poder recolectar la información que caracteriza el medio que se estudió, aplicando un modelo que se basa en dar valoración con factores de peso a cada onda que arribo.','Corteza, Mohorovicic, Función, Receptora, TGUH',4,105,7,1,11,3,1,NULL,30,'',NULL,NULL,1,0,'2015-06-01 17:55:16'),(169,2,1,'Estimacion de las caracteristicas del subsuelo en una zona de alto riesgo a deslizamientos empleando metodos geofisicos','En este trabajo se presenta el estudio realizado en una zona con alto riesgo al deslizamiento, ubicada en el Barrio Campo Cielo del municipio de Comayagüela en  Francisco Morazán, Honduras, en el periodo de Febrero de 2013. Dicho estudio se realizó haciendo uso de Métodos de Prospección Geofísica como ser Refracción sísmica, y Resistividad eléctrica. En este caso en particular se seleccionó como método primordial el Método de Refracción Sísmica debido a la finalidad del estudio la cual es, analizar la estructura estratigráfica de la zona, en búsqueda de zonas de susceptibilidad al deslizamiento que aun puedan existir. Al obtener los resultados de este estudio y al compararlos con los resultados del Método de Resistividad Eléctrica, fue posible determinar zonas de susceptibilidad al deslizamiento que tiene la zona aun, así como valores estimados del espesor de la capa de sedimento suelto que posee la zona que es de seis (6) metros en las cercanías de la corona del deslizamiento y de diez (10) metros en la base del deslizamiento.','Estratigrafía, Refracción, Sísmica, Kriging, Deslizamiento',4,105,7,1,11,1,1,NULL,20,'',NULL,NULL,0,0,'2015-06-01 17:59:54'),(170,5,1,'Apuntes bibliograficos para la lectura en Honduras','El ensayo Fondos del Armario para la Lectura, es un acercamiento al desarrollo de la bibliografía de Literatura Infantil en Honduras: a través de la historia del primer impreso, el significado de la letra, como imagen, actividades de promoción de la lectura en la sociedad, la importancia de los Anuarios Bibliográficos Hondureños, las políticas y la institucionalidad que favorece un proceso sistemático de producción del libro y la lectura','Promoción,Lectura, promoción',2,293,9,1,11,1,1,NULL,50,'',NULL,NULL,0,0,'2015-06-01 20:42:58'),(173,4,1,'Evaluación del impacto social, económico y ambiental de la explotación de la empresa minera San Andres, municipio de La Union de Copan.','Se espera que la investigación arroje datos significativos que sirvan para valorar  hasta qué punto la actividad productiva minera  podría convertirse en el motor que impulsa el desarrollo en el  país o por el contrario, estamos acelerando el deterioro de la vida. El Estado de Honduras considera a la industria de la minería como un motor generador de desarrollo por lo que tiene una política de puertas abiertas para incrementar la inversión en este sector. Se buscará por ende evaluar los costos y beneficios sociales, económicos, ambientales y verificar los impactos  que esta actividad genera y constatar en qué medida los proyectos mineros en el país se desarrollan según su normativa legal y  con la participación libre, informada y consensuada de la población y sus comunidades en todas sus fases y con sentido de futuro, esto es, pensando en las generaciones actuales y futuras.','Minería, desarrollo sostenible, ambiente, economía y participación ciudadana.',1,364,9,1,11,3,1,NULL,25,'Al ser una Mesa de Trabajo, se espera la presentación de un diseño o avance de investigación; no es necesaria la presentación de conclusiones. ',NULL,NULL,1,0,'2015-06-02 16:52:04'),(174,4,1,'Movimientos sociales y reconfiguración de los imaginarios sociales en la escena política','Frente a la imagen del neoliberalismo tragándose la historia y las ideologías, Michael Hardt y Antonio Negri (2000), en su polémico libro Imperio, a través de la categoría spinoziana ?multitud? abren un horizonte de percepción sobre los movimientos sociales. Los autores atribuyen a éstos una función de antagonismo equilibrante y desequilibrante. Los movimientos sociales tienen un comportamiento  intrasistémico, rizomático, imprevisible, errático, tal como el movimiento autoproclamado como La Resistencia, que emerge a partir del golpe de Estado en Honduras del 28/06/09. Éste encontrará su máxima expresión en la movilización, a través de  ?la marcha?. De esta forma se resignifican los espacios de socialización, acción, construcción, creatividad, solidaridad, organización e intercambio. Con su emergencia, La Resistencia llena un tiempo detenido mediante la violencia y el toque de queda.','movimientos sociales, golpe de Estado, Honduras, Resistencia, imaginarios sociales',2,63,1,1,11,1,1,NULL,10,'',NULL,NULL,0,0,'2015-06-02 18:11:31'),(175,2,1,'Nombrando el cielo','La historia de la nomenclatura de los diferentes cuerpos celestes refleja la propia historia del ser humano. En ella tienen cabida los miedos, deseos y sueños de nuestra especie.\n\nTambién nos relata un viaje, el viaje que nos lleva desde tiempos inmemoriales hasta el futuro, de las cavernas a los viajes espaciales y el viaje que realizamos en la Tierra, el viaje que nos hace humanos.\n\nA través de esta ponencia realizaremos parte de ese viaje, relacionando Lengua, Ciencia e Historia para conocer cómo han sido nombrados los propios cuerpos celestes y sus diferentes accidentes topográficos.','Astronomía Viajes Lexicografía Literatura Toponímicos',3,409,11,1,11,3,1,NULL,60,'El instrumento para la ',NULL,NULL,1,0,'2015-06-04 16:21:33'),(176,1,1,'La serie lunar en las inscripciones mayas: una visión actual','En esta conferencia de una hora se proporcionará un panorama global sobre la naturaleza y contenido de la serie lunar en las inscripciones jeroglíficas mayas (ca. 292-909 d.C.), enfatizando sus aspectos astronómicos y lecturas epigráficas actuales. En las inscripciones mayas la serie lunar se ubica habitualmente luego de la serie inicial o cuenta larga, y forma parte a su vez de la denominada serie suplementaria, ocupando los lugares de los llamados glifos E, D, C, X, B y A, como los denominó Silvanus Morley (1915). En 1930 John Teeple propuso que se trataba de un ciclo de 12 lunaciones o ciclos sinódicos de la Luna y propuso que a lo largo de la historia maya pueden advertirse tres fases respecto a su uso: el periodo de independencia (292-687 d.C.), el de uniformidad, durante el cual todas las ciudades mayas usaron grupos de seis lunaciones contadas a partir de las mismas bases (687-765 d.C.) y el de reseparación, donde cada ciudad maya adoptó su propio sistema (765-909 d.C.). Eric Thompson (1950), Heinrich Berlin (1977) y John Justeson (1989) escribieron importantes síntesis sobre el tema, mientras que en 1978 Floyd Lounsbury descubrió que en realidad se trataba de un ciclo de 18 lunaciones. Linda Schele, Nikolai Grube y Federico Fahsen Ortega (1992) y Juan I. Cases Martín, Juan A. Belmonte Avilés y Alfonso Lacadena García-Gallo (2004) reunieron todos los ejemplos disponibles hasta el momento y proporcionaron lecturas epigráficas modernas para los mismos, trabajos que apuntan hacia la idea de que, más que ser un cómputo astronómico, se trata de una frase formularia en la cual no están ausentes los recursos retóricos. En años más recientes destacan los trabajos de Cases Martín y Stanislaw Iwaniszewski, que profundizan en diversos aspectos sobre el tema. En el año 2012 el equipo de William Saturno descubrió unos murales en Xultún, Guatemala, que revelan nuevos aspectos sobre los cómputos lunares que los mayas realizaban hacia el año 800 d.C.','Epigrafia Series lunares Maya Astronomia Astronomia Cultural',3,409,11,1,11,1,1,NULL,60,'',NULL,NULL,0,0,'2015-06-04 22:57:32'),(177,4,1,'Sobrevivencia de Pacientes Diagnosticados con Cáncer Gástrico en el Occidente de Honduras período 2002','Sobrevivencia de Pacientes Diagnosticados con Cáncer Gástrico en el Occidente de Honduras período 2002-2012\nEsta investigación se está desarrollando en el marco de las líneas prioritarias de investigación definidas por la UNAH y beneficiada con una beca básica de investigación por parte de la DICYP.  El estudio consiste en realizar una autopsia verbal con familiares o las personas más cercanas de los pacientes diagnosticados y fallecidos por cáncer gástrico, mediante una metodología que permite reconstruir la historia y el camino recorrido por un paciente desde que se enferma hasta que fallece, visitando los hogares de las personas fallecidas para corroborar la información que contiene la historia clínica y poder obtener más datos.  Esta modalidad es reconocida como una estrategia de vigilancia epidemiológica de gran utilidad en el que hacer de la salud pública, como instrumento de estudio del proceso enfermedad-atención-muerte.  \nEl cáncer gástrico en la región occidental de Honduras se ha definido como uno de los cánceres con mayor incidencia afectando a todos los grupos poblacionales especialmente a mayores de 30 años.  En Occidente, por más de 25 años se han realizado investigaciones en este sector que han contribuido a ampliar los conocimientos de su evolución, comportamiento y causas que van desde  factores genéticos, ambientales y algún tipo de predisposiciones gastronómicas; pero aún existe una preocupación en la comunidad y en el gremio médico ya que el número de casos va en aumento y no se tiene certeza de la causa real del problema, el comportamiento evolutivo de la enfermedad, la sobrevivencia de los pacientes una vez fueron diagnosticados, problemas que tuvieron que afrontar durante su padecimiento, qué decisiones tuvieron que afrontar durante su padecimiento.  Por tanto, sigue existiendo un vacío en el conocimiento que ésta investigación pretende llenar; convirtiéndose en un estudio pionero a nivel nacional que pretende servir como referencia al sistema de salud para el análisis de las estrategias actuales que utilizan en los procesos de atención de pacientes diagnosticados con cáncer gástrico.','sobrevivencia, cáncer, gástrico, región occidental.',1,378,11,1,11,2,1,NULL,30,'',NULL,NULL,0,0,'2015-06-05 00:00:34'),(178,5,1,'MIGRACIÓN DEL TRIÁNGULO NORTE DE CENTROAMÉRICA A LOS ESTADOS UNIDOS DE AMÉRICA','Los países que conforman el triángulo norte de Centroamérica son tres; Guatemala, El Salvador y Honduras, abarcan una extensión territorial de  242.4 mil kilómetros cuadrados, y han tenido un aumento acelerado de la población en los últimos sesenta y cinco años, de 6.8 millones en 1950, han alcanzado 30.9 millones en el 2015, es decir se incrementaron en 4.5 veces.\nLos países del triángulo norte de Cen¬troamérica en la actualidad generan los mayores flujos de migración hacia los Estados Unidos de América, en el siguiente orden El Salvador, Guatemala y Honduras, contribuyendo con alrededor del 85% de la población de origen hispano centroamericano (4 de 4.7 millones de personas en el 2012) residen en ese destino (Flores Fonseca, 2014). \n Este trabajo tiene por objetivo mostrar algunos elementos de la migración internacional de los países del triángulo norte de Centroamérica hacia los Estados Unidos de América. Pretende describir algunos elementos del proceso migratorio, en los países de origen, tránsito y destino, que aunque no es nuevo evoluciona a través del tiempo, por lo cual queremos acercarnos a observar las tendencias principalmente en la última década y encontrar explicaciones que contribuyan a generar conocimiento científico del fenómeno migratorio, que se ha complejizado e involucra aspectos que sobrepasan la perspectiva de este trabajo, que básicamente es demográfico.\nLas fuentes de información utilizadas en este trabajo son las bibliográficas, los informes, memorias, artículos, reportajes y otras experiencias de investigación, aunque la perspectiva demográfica principal de información es enfocada a las fuentes estadísticas en primer lugar, a las metodológicas de las fuentes de datos y finalmente en el análisis de datos.','Migración internacional, Emigración internacional, Centroamérica, Triángulo Norte de Centroamérica.',2,219,9,1,11,2,1,NULL,20,'',NULL,NULL,0,0,'2015-06-05 15:15:47'),(179,2,1,'Guiaicum sanctum (Zygophyllaceae), su distribución espacial, diversidad genética y etnobotánica en los bosques secos de Honduras','Guaiacum sanctum se caracteriza por su hábito arbóreo, y se distribuye desde la parte Central de Sur América hasta el norte de México, Florida y las Antillas Mayores. Actualmente se considera una especie amenazada según CITES y la Lista Roja de UICN. El objetivo de este estudio fue conocer la distribución de las poblaciones, su diversidad genética en los remanentes de bosque seco en Comayagua, Yuscarán, El Ojochal en Choluteca, Valle del Aguan y El Quebrachal en Olancho; así como los usos tradicionales en los sitios de estudio. Se realizó parcelas de 50x50 y se definió tres clases de edades: adultos (DAP ? 5 cm), juveniles (DAP< de 5 cm) y plántulas (individuos altura ? 30 cm). Se georreferenció los individuos adultos. 18 cebadores para microsatélites fueron diseñados para conocer la estructura genética de las poblaciones. Los resultados indican que la distribución de los individuos es agrupada, lo que muestra una alta regeneración. Se registra el uso de la madera para exportación, y la resina para usos medicinales. Adaptaciones importantes del guayacán es el desarrollo de su ciclo de vida en condiciones ambientales extremas del bosque seco, probablemente limita la abundancia de los individuos especialmente en la clase sub adultas pues se encontró solo 5 individuos, en contraste con las plántulas que resultaron muy abundantes. Los resultados de este estudio serán la base para establecer una estrategia de conservación de esta especie, así como la propuesta de áreas protegidas en el bosque seco en Honduras.','Guaiacum sanctum, distribución, diversidad genética, usos',2,383,11,1,11,3,1,NULL,20,'',NULL,NULL,1,0,'2015-06-05 15:18:24'),(181,1,1,'ponencia de prueba edición (en revisión)','resumen prueba edición','palabras claves',3,62,7,1,11,6,2,'2015-06-26',18,'Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui.',0,'',1,1,'2015-06-05 21:34:54'),(182,2,1,'Hueso Hioides y su relación con biotipo facial en pacientes de la clínica Monseñor Hombach, Tegucigalpa. Francisco Morazán.','En este estudio de tipo observacional, descriptivo, analítico, retrospectivo y de corte transversal, se identifico la posición antero posterior del hueso hioides en los biotipos faciales. El objetivo fue determinar si la posición de este hueso puede emplearse como herramienta de diagnóstico para predecir el biotipo facial. La muestra consistió en 174 radiografías (123 del género femenino y 51 del género masculino) con edad de 8 años a más. Para la recolección de datos se colocó un papel calca sobre la radiografía y se procedió a realizar el trazado cefalómetro del polígono de Bjork Jarabak, para determinar el biotipo facial mediante una relación porcentual entre altura facial posterior con respecto a la anterior. Posteriormente se trazó el plano de Frankfurt y perpendicularmente la vertical pterigoidea pasando esta en el vértice de la fosa pterigomaxilar. Luego se mide en milímetros la distancia del punto más anterior del cuerpo del hueso hioides a la vertical. Según los resultados obtenidos, el hueso hioides denota una posición más anterior en los braquifaciales y más posterior en los dolicofaciales, a su vez en todos los biotipo faciales, fue más posterior en el género femenino que en el masculino. Por lo tanto se concluye que si existen diferencias en la posición anteroposterior  del hueso hioides en los diferentes biotipos faciales.','Biotipo facial.    Hueso hioides.   Cefalometría',2,335,11,1,11,3,1,NULL,100,'Se encuentra un ALTO GRADO DE SIMILITUD con el estudio \"Posición antero posterior del hueso hioides en los biotipos faciales\" de Valenzuela Alvarez, Sebastián Patricio (2008), no citado entre las referencias bibliográficas. ',NULL,NULL,1,0,'2015-06-07 07:32:15'),(183,2,1,'Marcas olfativas: Un derecho evolutivo o restrictivo, perspectiva del derecho comparado (HonduraColombia)','Marcas olfativas:\nJurisprudencia internacional\nDoctrina internacional\nEstudio Comparado Legislaciones nacionales e internacionales\nTratados Internacionales\nConclusiones\nMarcas olfativas: ¿Un Derecho evolutivo o restrictivo?  Perspectiva del Derecho Comparado (Honduras-Colombia)\nAbog. José Alexander Ávila Vallecillo.  \nMagister en Derecho con énfasis en Derecho Mercantil, contratos y negocios Internacionales. \nFacultad de Ciencias Jurídicas, Departamento de Derecho Privado, Universidad Nacional Autónoma de Honduras.\nInstituto de Investigación Científica, Edificio 5, Planta baja, e-mail: jaavhn@yahoo.com\n\n\nel artículo describe, analiza y sintetiza los escritos vinculados al tema de las marcas olfativas desde una perspectiva nacional e internacional, tomando como referente jurídico las normas, doctrina y jurisprudencia que rigen a estos signos distintivos, dilucidando a su vez  la problemática que enfrentan  al solicitar su inscripción  ante las oficinas registrales correspondientes. En cuanto a su reconocimiento jurídico la doctrina internacional se encuentra totalmente dividida, algunos autores consideran que las marcas olfativas deberían ser reconocidas y protegidas como tal, otros por su parte se resisten a concebir tal idea. De igual forma, los requerimientos jurídicos que restringen la inscripción de marcas no visibles alrededor del mundo, gira en torno a tres requerimientos básicos: distintividad, perceptibilidad, y representación gráfica. En ese orden de ideas y con relación a la entrada en vigor del Tratado de Libre Comercio suscrito entre la República Dominicana, Centroamérica y los Estados Unidos (DR-CAFTA), Honduras incorporó a su compendio jurídico la inscripción de signos olfativos a su legislación, por tanto, resulta justo y necesario conocer los requerimientos y razonamientos jurídicos con que la Dirección General de Propiedad Intelectual (DIGEPIH) se encuentra atendiendo dicha problemática.\nPalabras clave\n     Marca olfativa, Signos distintivos, Dirección General de Propiedad Intelectual, Secretaría de Industria y Comercio, distintividad, perceptibilidad, y Representación Gráfica.\n\n\nAbstract \n     This paper seeks, analyzes and synthesizes the writings related to the topic of scent marks from a national and international perspective on the legal rules concerning, doctrine and jurisprudence governing these distinctive signs, turn elucidating the problems faced when applying its registration with the relevant registry office. As for the international legal recognition doctrine is completely divided, some authors believe that the scent marks should be recognized and protected as such, others meanwhile resist conceive such idea. Similarly, the legal requirements that restrict the entry of marks not visible around the world, revolves around three basic requirements: distinctiveness, visibility, and graphical representation. In that vein, and in relation to the entry into force of the Free Trade Agreement signed by the Dominican Republic-Central America and the United States of America (DR-CAFTA), Honduras joined the legal compendium registration Scent Trademarks its law therefore interesting meet the requirements and legal reasoning with the Directorate General of Intellectual Property (DIGEPIH) addresses this problem.\nKey words\nOlfactory mark, distinctive signs, Directorate General of Intellectual Property, Superintendence of Industry and Commerce, distinctiveness, graphic representation, and perceptibility. \n\nIntroducción\n     Ante un inminente e indetenible proceso de cambios globales, especialmente en cuanto a derecho marcario se refiere, los signos olfativos constituyen hoy por hoy un novedoso e interesante tema de estudio tanto en el ámbito nacional como internacional. Grandes emporios  vinculados a la industria, la tecnología, y el marketing internacional, buscan incansablemente una forma segura en que sus marcas odoríficas puedan ser objeto de protección, evitando así que sus productos, bienes o servicios sean  duplicados.\n     Recientes estudios demuestran que el ser humano es capaz de recordar el 1% de lo que toca, el 2% de lo que oye, el 5% de lo que ve, el 15% de lo que degusta y el 35% de lo que huele, concluyendo así, que un olor o fragancia es capaz de generar múltiples efectos evocativos en la conducta humana (Iannini, 2010, pp.60).\n     Desde otra perspectiva, una marca en general puede ser percibida únicamente a través del sentido de la vista, sin embargo, los signos olfativos poseen la exclusiva particularidad de ser percibidos a través del sentido del olfato y al igual que todo signo marcario, estos son utilizados para diferenciar productos, bienes y servicios, de entre otros de su misma clase o especie. \n     En dicho sentido, la protección de una marca se adquiere mediante su registro ante las oficinas de  propiedad industrial, sin embargo dicho resguardo se torna imposible cuando los requisitos para su inscripción  no superan los estándares establecidos por las entidades encargadas de formalizar su inmediato registro.  \n     Al respecto conviene decir que alrededor del mundo son pocas las marcas olfativas inscritas, los argumentos jurídicos que desestiman su registro varían de país a país, no obstante, el común denominador negatorio descansa bajo tres pilares fundamentales, el primero vinculado a su carácter distintivo, el segundo a su perceptibilidad y el tercero, a la forma en que éstos pueden ser representados (representación gráfica). \n      Honduras, en fecha 3 de marzo del 2005 mediante Decreto legislativo 10-2005 suscribió el Tratado de Libre Comercio  entre la República Dominicana, Centroamérica y los Estados Unidos (DR-CAFTA), el cual entró en vigencia el 1º de abril del 2006, dicho convenio preceptúa en uno de sus apartados lo siguiente: \nArtículo 15.2: Marcas.- ?1. Cada Parte dispondrá que las marcas incluirán las marcas colectivas, de certificación, y sonoras, y podrán incluir indicaciones geográficas y marcas olfativas. (?)? \n     Dado que tal disposición les confiere una  expresa  inclusión a estos signos marcarios, resulta de vital importancia conocer ¿De qué manera, la Dirección General de Propiedad Intelectual de Honduras está ventilando la inscripción de marcas olfativas? ¿Cuáles son los requerimientos para alcanzar su protección? ¿Qué tipo de exámenes o análisis tienen que superar dichas marcas ante esta Dirección General de Propiedad Intelectual? \n\n    Resulta importante señalar que Honduras al día de hoy no posee marcas olfativas inscritas ni se han presentado a la fecha solicitudes al respecto (DIGEPIH, 2014), pese a la aprobación de aquél tratado internacional.\n   Bajo esa panorámica y con relación a las sentencias emitidas por el Tribunal de Justicia Europeo en la sentencia Sieckman y las resoluciones pronunciadas por la Superintendencia de Industria y Comercio de Colombia, Honduras a través de la Dirección General de Propiedad Intelectual estaría sustentando sus pronunciamientos bajo el umbral de los requisitos de perceptibilidad, distintividad y representación gráfica, siendo la doctrina y la jurisprudencia internacional las herramientas más recurrentes en las que estas instituciones amparan  sus argumentos denegatorios, pese al expreso reconocimiento de los olores en sus compendios jurídicos.  \n\nMetodología\n     El artículo proporciona  un  enriquecedor estado del arte donde la doctrina, las leyes y la jurisprudencia nacional e internacional se interrelacionan armónicamente, examinando además la aplicabilidad y posibilidad que tienen las marcas olfativas de ser inscritas ante las oficinas registrales correspondientes.\n    Se trató entonces, de una investigación  descriptiva y documental, en la que se aplicó el método teórico inductivo y analítico por cuanto fue más allá de una escueta lectura de fallos y pronunciamientos emitidos por autoridades administrativas,  por el contrario, se buscó analizar aquellos razonamientos convergentes entre la doctrina y la jurisprudencia  internacional, en donde subyacen los argumentos más controvertidos con relación al tema. \n     No obstante, seleccionar dentro de un universo de antecedentes bibliográficos tan amplio, constituye una ardua labor para un sólo investigador, por lo tanto, se procedió a distinguir a los signos olfativos dentro de la gama de marcas no tradicionales, determinando así la ubicación y delimitación del tema escogido, como también la construcción de un  metódico estudio comparado entre Honduras y Colombia, quien en los últimos años y desde la aprobación de la Decisión Andina 486 se ha enfrentado ante dicha problemática. \n\nSinopsis sobre las marcas olfativas y su protección jurídica.  \n               Los argumentos jurídicos en el campo internacional, para objetar o conceder la inscripción de una marca odorífica converge en una doble vía, la primera de carácter interpretativa, porque suele desplegarse en un contexto de legislaciones y doctrinas permisibles, mientras la segunda de carácter restrictiva,  en cuanto devela subjetivos requerimientos  que giran en torno a la distintividad,  perceptibilidad,  y su controvertida desaprobación en cuanto a la forma gráfica en que éstas deben ser representadas.\n     Alemania. Uno de los precedentes jurisprudenciales a escalas internacionales lo constituye la sentencia Sieckman, emitida por el Tribunal de Justicia de la Comunidad Europea (TJCE) en fecha 12 de diciembre del 2002, donde un interesado pretendió inscribir un signo olfativo identificado como balsámico afrutado con ligeras reminiscencias a canela sin lograr su cometido al no satisfacer los criterios exigidos por aquél Tribunal. (Porras A, 2005).     Dicha sentencia refleja diversos matices en cuanto a sus argumentaciones jurídicas que versan en torno a los requisitos exigidos por el Tribunal de Justicia Europeo (TJCE), generando un efecto de carácter vinculante y de guía argumentativa no sólo para aquellos países miembros de la Comunidad europea, sino que también para la jurisprudencia y legislación internacional que afrontan la misma problemática en cuanto a la protección de marcas olfativas. \n     Francia. Cada país de la Unión Europea cuenta con un sistema marcario diferente, y es de público conocimiento que Francia constituye uno de los emporios más atractivos en cuanto a la manufactura de perfumes se refiere, por tanto, este país debería ser una de las naciones con mayor número de marcas olfativas registradas, no obstante la realidad jurídica supera los intereses económicos. Esta nación, al ser parte de la Unión Europea, provoca que su derecho marcario se vea influenciado por los criterios jurisprudenciales del Tribunal de Justicia Europeo; en esta vía restrictiva han sido publicadas cinco solicitudes de registro de marcas olfativas en la Propiété Industrielle francesa, pero ninguna ha sido inscrita al día de hoy. (Ruiz-Jarabo, 2001).\n     Estados Unidos. Esta Nación conforma una de las potencias que más adelantos evidencia en cuanto al registro de marcas olfativas se refiere, considerado como el primer Estado que registró ante sus oficinas una marca odorífica. Esta solicitud fue requerida para la inscripción de un hilo de coser y bordar, conocido como el asunto In re Clarke, descrita así: ?a high impact, fresh, floral fragrance reminiscent of plumeria blossoms?\nAsimismo se ha logrado incorporar ante los registros correspondientes las marcas olfativas siguientes:  \n1) US 2560618 «The scent of bubble gum» registrada para aceite industrial; \n2) US 2463044 «The cherry scent» para lubricantes sintéticos. \n3) US 2568512 «The scent of grape» para lubricantes y aceites para motor, y \n4) US 2596156 «The strawberry scent», también para lubricantes, aceites y combustibles de motor. (Balañá, 2006, pp. 21).  \n5) 3140700 	[scent only] Producto: artículos de oficina, a saber, las carpetas de archivo, carpetas colgantes, papel expandiendo archivos de descripción de la marca: la marca consiste en un aroma de menta o fragancia.  Propietario: Empresa de fabricación de Smead6) 3849102 	[scent only] Publicidad y marketing Descripción de marca: la marca consiste en un aroma de aceite de rosa o fragancia.  Propietario: Kalin Manche (Erick Pelton & Associates, 2011).      \n       Argentina. Este país no restringe la inscripción de marcas odoríficas, puesto que la compañía L?Oréal después de varios intentos logró conseguir el primer registro de aromas (números 2.270.653/54/55/56 a 2.270.657 bajo la Clasificación 3 de Niza) comprendiendo dentro de ellas, diferentes fragancias aplicadas en frascos que evocan diversos aromas frutales (Allman & Zuccherino 2010). \n     Reino Unido. En una primera etapa este país admitió el registro de dos marcas olfativas, identificadas bajo la numeración 2001416 y  2000234, la primera describe el olor de rosas aplicado a neumáticos, y la segunda el olor de cerveza para distinguir dardos; últimamente la United Kingdom Trade Mark Registry ha denegado la inscripción de una marca consistente en el aroma o la esencia de canela, para distinguir ciertos mobiliarios y sus complementos (Ruiz-Jarabo, 2001). \n     España. Las marcas olfativas en este país no pueden ser objeto de inscripción, basados en el argumento de que un olor no puede ser representado gráficamente, así lo dispone la ley de marcas española LME, la cual en su título II, capítulo I, artículo 4 numeral 1 define que una marca es todo signo susceptible de representación gráfica que sirva para distinguir en el mercado los productos o servicios de una empresa de las de otras. (LEY 17/2001, artículo 4)\n     Australia. Este país adopta criterios más prácticos y menos complejos en cuanto al registro de una marca odorífica, en vista de que el requisito imperante en la representación de un olor es la descripción verbal ? escrita, dejando de lado cualquier metodología tendiente a analizar de forma científica una fragancia,  debido a que éstas suelen escapar al entendimiento humano de mediano intelecto (Chijane, 2007, pp. 481).\n\nDoctrina e investigaciones referentes al tema de marcas olfativas.           \n     Las Marcas Olfativas han sido objeto de múltiples y debatidas controversias sobre todo en la esfera internacional, las premisas argumentativas con respecto a su protección giran en torno a los requisitos de perceptibilidad, distintividad y especialmente al requisito de representación gráfica que lo complementa.\n     La temática es de gran trascendencia, sin embargo son pocos los autores que han optado estudiar a profundidad la materia; a continuación se describe un estado del arte en donde se exponen diversos escenarios y tendencias jurídicas.\n     Cann (1989), Shab (1990), y Morrin y Ratneshwar (2000), realizaron algunos estudios, con propósitos específicos, donde se buscaba medir la inteligencia a través de la percepción olfativa. La investigación consistió en exponer a un variado grupo de participantes a una serie de artículos, imágenes, palabras o nombres de marcas, durante un lapso de tiempo, logrando determinar que ciertos olores podían favorecer considerablemente la memorización y que además, el recuerdo y el reconocimiento de los artículos mejora de forma considerable, sobre todo en su fase de aprendizaje. \n          Fernández (2001), y Casado (2000), señalan que los signos olfativos no deberían ser objeto de protección y mucho menos ser considerados como tal; sin embargo Rizzo (2002), y Senna (2003), estiman que las marcas olfativas deben ser aceptadas y por ende  reconocidas dentro del ámbito marcario, al igual que cualquier marca en general.\n     Otamendi (2002),  este jurista es completamente partidario de concederle a las marcas odoríficas la posibilidad de ser protegidas y registradas, pues al hacerlo, se estaría combatiendo la piratería y se evitaría de igual modo que terceros se enriquezcan con la invención de otros, así lo deja entrever en las siguientes palabras: \nNada dice la ley respecto del registro marcario de un determinado olor, aroma o fragancia. Quien dote al envase o envoltorio que usa para vender un producto de un determinado aroma, puede, con todo derecho querer ser el único en distinguir su producto con el aroma respectivo. Para ello, nada mejor que registrarlo como marca. \nEs probable que haya quienes sostengan que tal privilegio no es admisible en nuestro sistema marcario. (Otamendi, 2002, p. 61-62)\n          Uribe (2002), verifica una sutil referencia con relación a las marcas olfativas, considerando que el registro de olores responde a los avances tecnológicos actuales  y por el carácter distintivo que las envuelve, tendrían que difundirse a merced de una denominación ante la inminente dificultad de encontrar una fragancia que sea suficientemente característica, no usual o connatural al producto y no se encuentre dentro del dominio público.\n     Bertone, y Cabanellas (2003),  aportan un tratamiento específico sobre marcas odoríficas en el libro I, en este primer tratado se aborda en un subtítulo denominado signos no susceptibles de representación indicando: \nFrente al artículo 1 de la ley, la imposibilidad de esa representación gráfica no es un obstáculo insuperable para que un signo pueda ser calificado como marca. \nSin embargo, el procedimiento de registro que la ley prevé y la práctica que de tal procedimiento se hace, obran como obstáculo al registro como marcas de los signos no susceptibles de representación gráfica, sin perjuicio de la posibilidad de que operen válidamente ?con los consiguientes efectos jurídicos- como marcas de hecho.\nCabe determinar qué signos son calificables como no susceptibles de representación gráfica. Respecto de los signos sonoros, en ciertos casos no presentan dificultades prácticas para su representación gráfica ?como sucede con los signos musicales, respecto de los cuales pueden ser empleados pentagramas-, mientras que en otros ?rugidos, chirridos, etc.- tal representación puede ser prácticamente imposible. En estos casos, sin embargo, frente a la falta de una prohibición en el derecho argentino, debería ser factible una descripción gráfica o verbal del sonido, acompañada por una grabación del mismo (Otamendi, 2002, pp. 59).\n(?) Respecto de las marcas olfativas, táctiles y gustativas, si bien tienen en ciertos casos potencialidad distintiva ?limitada por su contenido funcional-, presentan en el sistema actual dificultades sustanciales de representación gráfica, y aún de identificación, que las hacen incompatibles con los mecanismos contemporáneos de registro. (Otamendi, 2002, pp. 434-435)\n          Antequera (2009), detalla y a su vez enuncia un variado compendio de marcas no tradicionales, en las que se pueden mencionar las sonoras, animadas y especialmente  las tridimensionales, profundizando además en aquellos aspectos contentivos a la distintividad y perceptibilidad exigidas para su inscripción y registro. No hace ningún planteamiento en esta obra que indique o señale a las marcas olfativas como tema de estudio.\n          Liévano (2011), efectúa un interesante y profundo estudio respecto a las marcas no tradicionales y los requerimientos que definen a las mismas, definiendo, de forma individual y a la vez específica los aspectos referentes la distintividad, perceptibilidad y representación gráfica.\n     Respecto a la distintividad de las marcas olfativas, dicho autor sostiene que las fragancias en  sí mismas no poseen  la capacidad innata de hacer distintivo un producto,  y que basados en la opinión de la  Oficina de Armonización del Mercado Interior (OAMI), la representación gráfica utilizada por algunos, en ningún momento satisface los requerimientos exigidos por la mayoría de registro de la Unión Europea. (Liévano, 2011)\n    Chijane (2007), enmarca el tema de las marcas olfativas bajo la denominación de las nuevas marcas, y divide su escrito entre las posiciones a favor y en contra al registro de signos olfativos, la carencia de distintividad, duración del aroma, y la imposibilidad de ser representadas gráficamente. Los argumentos que respaldan su inscripción radican en que si los aromas representan a un signo distintivo como ser palabras o grafías, no existe razón alguna para excluirlas dentro de esa categoría.\n     En cuanto a la representación gráfica, y su dificultad de cumplir con este requisito procedimental, debería dejarse a un lado tal rigidez y permitir la descripción escrita que se realiza del olor; es más,  podrían admitirse técnicas de fraccionamiento mediante las cuales se aíslan los componentes volátiles del olor para luego identificar cada uno de ellos comparándolos con la base de datos de compuestos conocidos, como la cromatografía de gases y la cromatografía líquida de alto rendimiento (Chijane, 2007, pp. 480)\n    No obstante, dicha técnica podría ser contraproducente debido al nivel de distintividad que un aroma vislumbra y que una persona de mediana inteligencia pudiese distinguir dentro de otras fragancias de su misma clase o especie . \n   En tal sentido, la imposibilidad de que estas marcas puedan ser representadas gráficamente representa el mayor inconveniente para las oficinas de Propiedad Industrial, puesto que al no cumplirse con tal requerimiento, éstas pueden ser objeto de rechazo frente a la alternativa de la descripción verbal cuyo argumento denegatorio podría sustentarse en que la misma,  no es clara, precisa u objetiva. \n\n      Marcas olfativas desde la perspectiva del derecho comparado (Honduras-Colombia)\n     Con el propósito de proveer un estudio comparativo con relación al tema, se tomó como referente jurídico a Colombia, puesto que además de ser un estado que reconoce el Registro de marcas olfativas,  ostenta además un enriquecedor y amplio compendio de resoluciones en donde se razonan aquellos puntos sensibles tratados en la presente investigación.\n Apreciación de la Superintendencia de Industria y Comercio  de Colombia (SIC)   \n     En Colombia, las marcas Olfativas se encuentran reguladas expresamente en el artículo134 de la Decisión Andina 486, inciso c) el cual establece lo siguiente:\n?A efectos de este régimen constituirá marca cualquier signo que sea apto para distinguir productos o servicios en el mercado. Podrán registrarse como marcas los signos susceptibles de representación gráfica. (?) Podrán constituir marcas, entre otros, los siguientes signos: (?) c) los sonidos y los olores; (?)?\n   Bajo ese contexto, Colombia admite la inscripción de marcas olfativas en su legislación nacional, sin embargo desde que la Decisión Andina 486 fue aprobada en el año 2000, no existe a la fecha un tan sola marca olfativa inscrita, las causas o razonamientos que la sustentan se ven reflejadas en las resoluciones emitidas por Superintendencia de Industria y Comercio (SIC), entidad encargada de revisar, analizar y registrar todo lo referente al tema de propiedad intelectual e industrial.   \n      Así las cosas, cabe preguntarse, cuáles son las motivaciones que limitan y han restringido la inscripción de una marca olfativa ante la Superintendencia de Industria y Comercio de Colombia durante los últimos 13 años, tomando como referente jurídico las resoluciones 11- 30326-2-0-2011-05-13 y 00017175, la legislación interna, y la doctrina nacional.\n     Para dilucidar el anterior cuestionamiento, resulta oportuno analizar los tres requisitos fundamentales en que descansan las marcas olfativas y que constituyen a su vez,  los tres grandes obstáculos para estas puedan ser inscritas ante la Superintendencia de Industria y Comercio, es decir la: perceptibilidad, distintividad y representación gráfica.\n     De conformidad  a los pronunciamientos emitidos por  la Superintendencia de Industria y Comercio, las marcas olfativas presentadas ante la División de Signos Distintivos, han sido denegadas en razón de los argumentos subsiguientes: \n     1.- Distintividad\n     La distintividad es un requisito inherente a cualquier tipo de marca, sin esta, un signo marcario no tendría razón de ser y por ende carecería de capacidad diferenciadora.\n     De acuerdo al Tribunal de Justicia de la Comunidad Andina, la distintividad es aquella que:  \n (?) le permite al consumidor realizar la elección de los bienes que desea adquirir, pues el signo marcario le da a la mercadería su individualidad y posibilita que un producto sea reconocido de entre otros similares que se ofertan en el mercado por sus competidores. (Tribunal de justicia de la Comunidad Andina. (2005). Sentencia de 6 de julio, proceso n°  94-ip-2005 marca: ?Epomega?.)\n       Este requisito, ha generado incontables posiciones doctrinales ante la imposibilidad de distinguir una fragancia de otra, ya que la descripción verbal y la fórmula química del olor no constituyen según sus opositores, elementos suficientes para superar los exámenes requeridos. \n     2.- Perceptibilidad\n     A diferencia de todas las marcas restantes, tradicionales y no tradicionales, los signos olfativos invisten la exclusiva particularidad de ser percibidos a través del olfato.  \n     Bajo este referente, estudios recientes demuestran que los aromas provocan poderosos efectos en el comportamiento humano (relajar, estimular, asustar, provocar, seducir, etc.) y que de hecho, la memoria es capaz de distinguir entre más de 10.000 aromas diferentes que influyen en nuestras emociones y sentimientos (Iannini, 2010, pp.59).\n     Por su parte, El Tribunal Andino entiende que la perceptibilidad:\nHace referencia a todo elemento, signo o indicación que pueda ser captado por los sentidos para que, por medio de éstos, la marca penetre en la mente del público, el cual la asimila con facilidad. (Tribunal de Justicia de la Comunidad andina (2004) Sentencia de 26 de octubre,  proceso n° 132-ip-2004. marca: ?Diacom)\n      3. Representación Gráfica\n     Este parámetro constituye el trascendental obstáculo que ha esgrimido la Superintendencia de Industria y Comercio, pese a la existencia de visibles contradicciones que existen al respecto, dicha intendencia señala que: \n (?) La susceptibilidad de representación gráfica consiste en expresiones o descripciones realizadas a través de palabras, gráficos, signos mixtos, colores, figuras, etc., de tal manera que sus componentes puedan ser apreciados en el mercado de productos.  (Superintendencia de Industria y Comercio, 2011).\n    Partiendo de la premisa que representar gráficamente consiste en expresar o describir mediante palabras, gráficos, signos mixtos, colores y figuras, resulta inexplicable como un gráfico en donde se puntualiza la composición química de un olor, acompañada de una descripción verbal-escrita no puede ser considerada como tal; algunas legislaciones han aceptado una delineación escrita (caso Australia), por eso se defiende la idea de que pueda aceptarse la composición química como forma de representar gráficamente un aroma.  \n   Consecuentemente, no existe en Colombia una sola marca olfativa inscrita que haya superado la terna de requerimientos exigidos, deduciendo que, o no se pueden registrar, o a pesar de esta posibilidad la oficina encargada  ha edificado una fuerte barricada para no permitirlo.\nApreciación de la Dirección General de Propiedad Intelectual de Honduras (DIGEPIH)\n       En nuestro país, la Ley de Propiedad Industrial no contempla la inscripción de marcas olfativas,  así lo vislumbra el artículo 79 inciso 2)  al conceptualizar a las ?marcas? en la forma siguiente:\n?ARTÍCULO 79. - Para los efectos de la presente Ley se entenderá por:\n1.	(?.)      2) Marca, cualquier signo visible apto para distinguir los productos o los servicios de una empresa, con respecto a los productos o servicios de otras empresas (?.)?\nEvidentemente la Ley de Propiedad Industrial, excluye a las marcas no visibles (sonoras, olfativas, gustativas) dentro del compendio de marcas propiamente dichas a lo interno de su legislación, quedando estos signos distintivos, exentos de protección alguna. \n      Sin embargo, al incorporase en Honduras el Tratado de Libre Comercio suscrito entre la República Dominicana, Centroamérica y los Estados Unidos (DR-CAFTA), obliga a nuestro país a extender una brecha significativa con relación a la admisibilidad de marcas olfativas al compendio jurídico hondureño.  \n    Ante esa disyuntiva jurídica, la regla general nos indica que en caso de existir conflicto de leyes entre una norma interna y un tratado o convención internacional, se aplicará  esta última, así lo dispone la Constitución de la República de Honduras al pronunciar lo siguiente: ?Artículo 18.-  En caso de conflicto entre el tratado o convención y la Ley prevalecerá el primero?.\n    Con relación a los alcances y obligaciones que el DR- CAFTA implica, el articulo 1.4 preceptúa que: ?Las Partes garantizarán la adopción de todas las medidas necesarias para hacer efectivas las disposiciones de este Tratado, incluida su observancia por parte de los gobiernos estatales, salvo que este Tratado disponga otra cosa?.\n       En conclusión y de conformidad a lo expuesto por la Dirección General de Propiedad Intelectual de Honduras, al día de hoy no existen marcas olfativas inscritas ni se han presentado a la fecha solicitudes al respecto (DIGEPIH, 2014), no obstante dicha Dirección se encuentra esperando la aprobación del reglamento correspondiente donde se contempla el procedimiento y exámenes a verificar al momento en que una marca olfativa u otro signo no visible contemplado en el artículo 15.2 del DR-CAFTA solicite su inmediato registro.  \n      \n  Sentencia Ralf Sieckman y su efecto vinculante con relación a las Marcas Olfativas\n     Uno de los precedentes jurisprudenciales más influyentes a escalas internacionales lo constituye la sentencia Sieckman, la cual fue emitida por el Tribunal de Justicia de la Unión Europea (TJCE) en fecha 12 de diciembre del 2002, donde un interesado pretendió inscribir un signo olfativo denominado \"balsámico afrutado con ligeras reminiscencias a canela\" sin lograr su cometido al no satisfacer los criterios solicitados por aquél Tribunal. (Tribunal de Justicia de las Comunidades Europeas, 2002)\n     El fallo pronunciado en la sentencia giraba en torno a tres aspectos básicos, el primero de ellos argumentaba que la marca odorífica carecía de capacidad distintiva tanto intrínseca como extrínseca, en tanto el segundo ponía en manifiesto que dicho olor era imperceptible a la vista humana y que finalmente carecía de representación gráfica.\n    Este último constituye el argumento más sensible de la sentencia, puesto que al momento de solicitar el Sr. Sieckman la inscripción de la marca olfativa en mención, adjuntó a la misma, una descripción escrita, el depósito de una muestra del aroma, como también un gráfico que detallaba su composición o fórmula química. Una vez examinadas, El TJCE procedió a desvirtuar los elementos acompañados, ya que según éste, la descripción de la fragancia no era clara, precisa u objetiva, la muestra o depósito no era suficiente ni duradero, y por ende la representación gráfica se limitaba a describir su composición o formula química, y no a la fragancia en sí. (Tribunal de Justicia de las Comunidades Europeas, 2002)\n\n     Notemos, entonces que los mismos argumentos utilizados por el Tribunal de Justicia alemán, son reproducidos en Colombia a través de la SIC para denegar la inscripción de una marca olfativa sobre todo por  el requisito de representación gráfica, la cual no puede ser descrita por una formula química que no representa fehacientemente un aroma; y no podría ser depositada en un frasco como una muestra, puesto que al transcurrir el tiempo éste perdería su efecto aromatizante.\n          Desde el punto de vista institucional, La Superintendencia de Industria y Comercio (SIC), como entidad encargada de registrar marcas en Colombia se ha confrontado con iguales objeciones con respecto a la inscripción de esta clase de signos distintivos, prueba de ello es que dicha institución ha denegado la inscripción de algunos olores bajo la premisa de que los mismas no superan los estándares de perceptibilidad, distintividad y representación gráfica (radicaciones 11- 30326-2-0-2011-05-13, 00017175 y expediente 05-47635) invocados y fundamentados en la sentencia Sieckman, lo que viene a confirmar que ese precedente jurisprudencial ha traspasado fronteras y por ende influenciado de alguna u otra forma a la autoridad competente.\n     Visto de esa forma y aunque en Honduras no existen marcas olfativas inscritas o se hayan presentado solicitudes  ante la Dirección General de Propiedad Intelectual, la norma,  doctrina y la jurisprudencia internacional, apuntan fehacientemente a que dicha institución podría amparar en un futuro no muy lejano sus criterios jurídicos a la luz de los mismos argumentos descritos en la sentencia Sieckman y las consideraciones legales de la Superintendencia de Industria y Comercio de Colombia.\nConclusiones\n?	Las marcas odoríficas constituyen un reto innovador para el Derecho de Propiedad Industrial en general, puesto que al no ser percibidas mediante el sentido de la vista, éstas no logran obtener en la mayoría de países su inscripción y registro. \n?	Pese a que la decisión Andina 486 de Colombia reconoce expresamente la inscripción de los olores como signos marcarios, la Superintendencia de Industria y Comercio ha señalado que a pesar de ello, los olores no son susceptibles de representación gráfica. Mientras tanto, algunos acuerdos internacionales giran en torno a reconocer o prohibir los olores como signos marcarios, lo cual representa una clara disyuntiva registral.\n?	La Superintendencia de Industria y Comercio no hace más que reproducir las restricciones adoptadas por el resto de países alrededor del mundo tendientes a limitar  la inscripción de marcas olfativas. Pese a que el artículo 134 de la Decisión Andina 486 es novedoso en teoría, la práctica jurídica refleja todo lo contrario, ya que requisitos como la representación gráfica y aún más la interpretación que de ella se realiza, frenan el expedito registro de los olores.  \n?	La doctrina internacional denota una marcada y dual tendencia en cuanto a la inclusión y protección de los signos olfativos en el derecho marcario, por una parte, algunos autores defienden la idea de incorporar esta clase signos en el sistema marcario, mientras que a contrario sensu, otros se oponen radicalmente a la inclusión de los olores ante la imposibilidad de ser representados gráficamente. \n?	Desde que el Tratado de Libre Comercio DR-CAFTA entró en vigencia en Honduras y admitió la inscripción de marcas Olfativas, al día de hoy no existen signos odoríficos inscritos por diversas razones, una porque ningún solicitante se ha hecho presente ante las oficinas de la Dirección General de propiedad Intelectual a solicitar su inscripción y segundo porque dicha institución no posee a la fecha un reglamento establecido y aprobado en donde se consagren aquellos requerimientos indispensables que permitan su expedito registro. \n?	Pese a no existir en Honduras marcas olfativas registradas y la carencia de un reglamento que permita examinarlas, no es de extrañarse que los argumentos jurídicos en que la Dirección General de Propiedad Intelectual de Honduras (DIGEPIH) pueda en un futuro no muy lejano,  estar sustentando sus resoluciones al amparo de los indicadores que la jurisprudencia y doctrina internacional establezcan.\n?	Finalmente, La sentencia Sieckman refleja diversos matices en cuanto a sus argumentaciones jurídicas que versan en torno a los requisitos exigidos por el TJCE, generando un efecto de carácter vinculante no sólo para aquellos países miembros de la Comunidad europea, sino que también para la jurisprudencia y legislación internacional que afrontan la misma problemática en cuanto a la protección de estos signos olfativos.','Marcas Olfativas, Dinstintividad, perceptibilidad, representación gráfica, Inscripción, registrabilidad',1,458,11,1,11,2,1,NULL,60,NULL,NULL,NULL,0,0,'2015-06-07 19:54:43'),(184,4,1,'Prácticas de Higiene Bucal de los escolares del municipio de San Ignacio de Loyola, Francisco Morazán. 2013 al 2015','Objetivo: Describir las prácticas de higiene bucal, con el propósito de promover hábitos de higiene bucal, en escolares de seis a doce años de edad, del municipio de San Ignacio de Loyola, geográficamente dividido por el Casco Urbano y seis aldeas, mismas que fueron visitadas y asistidas por el equipo de trabajo del Proyecto APS-Bucal conformado por la máxima autoridad de nuestra facultad, Comisión de Vinculación de la Facultad de Odontología-UNAH, y, como grupo de apoyo, los pasantes de servicio social, que procedieron a aplicar el Formulario de Evaluación Odontopediátrica Poblacional (modificada), conteniendo las siguientes variables y/o categorías: tenencia de cepillo dental/frecuencia del cepillado dental/cepillado de la lengua/uso de la seda dental/aplicación de flúor/visita al odontólogo. Materiales y Métodos: Se realizó un estudio descriptivo, en la población escolar (N=1070). Resultados: 89% manifiestan tener cepillo dental; 53% se cepillan los dientes tres veces al día; 68% se cepilla la lengua, sin embargo, 91% no utiliza el hilo o seda dental; 73% ninguna vez han recibido aplicación tópica de flúor; 58% por ninguna razón ha visitado al odontólogo, 56 % presentan placa dental. Conclusiones: A menor edad (6-9), menor tenencia de cepillo dental y por ende menos práctica del cepillado dental. Las niñas de siete años presentan mayor deficiencia en las prácticas de higiene bucal. A menor acceso geográfico mayor deficiencia en las prácticas. El Naranjal es la aldea que presenta mayor deficiencia en las prácticas, en cambio el Escano de Tepale presenta las mejores. En términos generales, las prácticas de higiene bucal son deficientes. Es necesario implementar programas de salud bucal.','Salud bucal      Higiene bucal        APS Bucal        Hábito de higiene bucal      Odontología Comunitaria',3,335,11,1,11,2,1,NULL,100,NULL,NULL,NULL,0,0,'2015-06-08 07:32:28'),(186,5,1,'Observatorio Demográfico Universitario','Se presentará el proyecto de creación del Observatorio Demográfico Universitario; sus objetivos, metodología, fuente de información y el formato de salida de los datos.','Observatorio y dinámica demografica',2,501,11,1,11,2,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-09 14:18:00'),(187,5,1,'Prácticas de manufactureras en plantas procesadoras de lácteos en el Departamento de Olancho año 2014','La investigación se enmarca en el análisis de las prácticas de manufacturera en plantas procesadoras del sector lácteo del Departamnento de Olancho. En la actualidad a nivel mundial existen empresas que cumplen estándares de calidad y otras que atentan contra la salud de las personas; es por ello que estas empresas, deben de ser certificadas para garantizar la calidad de los productos procesados; asugurando con ellonichos de mercados nacionales, internacionales sostenibles. El objeto de lai nvestigación es analizar las prácticas de manufactura (BPM) en plantas procesadoras del sector lácteo, con el próposito de conocer si los productos se ajustan a los estándares de calidad requeridos.','Manufacturera, BPM, Práctica sde higiene',2,101,1,1,11,1,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-09 15:19:21'),(188,2,1,'Identificación de estrellas variables en el cúmulo Globular NGC6569 durante el año 2014','Uno de los grandes desafíos de la Astronomía es el poder determinar con precisión la edad del Universo, dado que las estrellas variables son usadas como candelas estándar para determinar distancias a los cúmulos globulares, la búsqueda de estas y la determinación de sus distancias se vuelve de gran importancia para entender la edad, estructura y formación de la Vía Láctea. Los modelos físicos actuales que nos explican la estructura de las estrellas es uno de los mayores logros científicos, que nos han permitido en gran medida explicar los valores observados de los parámetros físicos como: masa, radio, temperatura, luminosidad y composición química, además de predecir la evolución de estos en el tiempo. Sin embargo, dichos modelos tienen aproximaciones y simplificaciones a los fenómenos físicos reales que se producen en las estrellas, debido a esto se da la necesidad de hacer una comparación entre las predicciones que resultan de los modelos y los valores que se obtienen por medio de las observaciones para los parámetros físicos ya mencionados, esta comparación permitirá evaluar el grado de exactitud y realizar las correcciones necesarias. Las estrellas variables son un excelente laboratorio de prueba para contrastar los modelos teóricos de estructura y evolución estelar con la realidad.','Cúmulos globulares, Estrellas variables',2,404,11,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-09 15:26:10'),(189,2,1,'La Empreasa Agroindustriales en crecimiento, ubicadas en el Valle del Guayape, Departamneto de Olancho y con potencial a la exportación','La presente investigación busca identificar las empresas agroindustriales en crecimiento y con potencial a la exportación del departamento de Olancho, detectar aquellas características que las empresas deben  poseer para  incursionar en mercados internacionales  como  nivel de tecnología, tamaño de la empresa, tipo de producto, calidad, buenas prácticas de manufactura y la administración.   Honduras mantiene con otros países importantes relaciones comerciales y dado a la escasez alimentaria en el mundo se abren espacios de oportunidad en la exportación de productos  lácteos, cárnicos, vegetales, granos básicos, verduras, y otros productos que se producen en región y que tienen demanda,\nCon esta investigación se pretende  contribuir al desarrollo socioeconómico del país a través de  la búsqueda de nichos de mercados para la expansión comercial de las empresas, lo cual es fundamental para alcanzar un  desarrollo sostenible','Empresas, exportación, administración, producto, calidad, crecimiento, tecnología, relaciones comerciales, tratados de libre comercio, agroindustria,  mercados.',4,101,1,1,11,1,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-09 17:13:58'),(190,3,1,'Vacunas: uno de los mayores avances de la medicina','Una vacuna es una suspensión de microorganismos vivos atenuados, muertos o inactivados, fracciones de los mismos o partículas proteicas, polisacáridos o ácidos nucleídos de patógenos que al ser administradas en el organismo inducen una respuesta inmune especifica que inactivan, destruyen o suprimen al patógeno previniendo la enfermedad contra la cual está dirigido, cuyo resultado en el organismos es la capacidad de que el agente patógeno se multiplique y produzca inmunidad, sin causar enfermedad.\nCon el uso de las vacunas existentes se salvan más de 300 millones de vida y se previenen más de 4 millones de defunciones. Según datos de la Organización Mundial de la Salud (OMS) y la Organización Panamericana de la Salud (OPS) se pueden prevenir hasta 26 enfermedades con el uso de ciertas vacunas, lo que reduciría las hospitalizaciones, costos relacionados con el tratamiento y mejoraría la productividad. De hecho, gracias a las vacunas hay enfermedades que están controladas, como la papera; otras como el tétano y la difteria se han reducido dramáticamente\nEn Honduras, el Programa Ampliado de Inmunización (PAI), es el responsable de garantizar el acceso a los servicios de vacunación según el esquema nacional de vacunación y población objeto en forma permanente y gratuita; capaz de responder en forma efectiva y oportuna a la demanda de la población en materia de vacunación con calidad, equidad y solidaridad, a través de procesos técnicos normativos y administrativos con una amplia participación social. El propósito del programa es disminuir la morbilidad y mortalidad de las enfermedades prevenibles por vacunas en la población infantil, mujeres en edad fértil y grupos en riesgo, y así mantener la certificación de la erradicación de la poliomielitis, garantizar la eliminación del sarampión, tétanos neonatal, rubéola, síndrome de rubéola congénita y control de formas graves de tuberculosis infantil, tos ferina, difteria, parotiditis, hepatitis B, enfermedades invasivas por Hib (1).\nActualmente, hay una vacuna contra el dengue de la compañía Sanofi-Pasteur que en su fase de prueba demuestra una reducción en las hospitalizaciones por dengue, y es efectiva para prevenir hasta el 70% de los casos. En los ensayos de fase 3 para medir la eficacia de la vacuna tetravalente (4 serotipos) contra dengue en cinco países de Latinoamérica, incluido Honduras, donde el dengue es endémico, ellos incluyeron al azar a niños sanos entre las edades de 9 a 16 años y en una proporción de 2:1 recibieron tres dosis de la vacuna viva recombinante, atenuada, tetravalente de dengue (CYD-TDV) o placebo. A los niños se les realizó un seguimiento por 25 meses. El primer indicador evaluado fue la eficacia de la vacuna contra el dengue sintomático, virológicamente confirmado (DVC), independientemente de la enfermedad grave o el serotipo, que se produjo más de 28 días después de la tercera dosis. En general, la vacuna de dengue CYD-TDV fue eficaz contra casos de DVC y casos severos de DVC y conduce a menos hospitalizaciones por DVC en 5 países de Latino América donde dengue es endémico (2).\nEl Departamento de Control de Alimentos y Medicamentos de los Estados Unidos (FDA) ha aprobado dos vacunas para prevenir la infección por virus de papiloma humano (VPH): Gardasil® y Cervarix®. Ambas vacunas son muy efectivas en la prevención de infecciones persistentes por los tipos 16 y 18 de VPH, dos de los VPH de ?alto riesgo? que causan la mayoría (70%) de los cánceres de cuello uterino (3).  Gardasil impide también la infección por los tipos 6 y 11 de VPH los cuales causan prácticamente todas (90%) las verrugas genitales. Además, hay datos iniciales que sugieren que Cervarix protege parcialmente contra algunos otros tipos de VPH que pueden causar cáncer. La vacuna Gardasil es una vacuna cuadrivalente que protege contra cuatro tipos de virus de papiloma humano: 6, 11, 16 y 18. Cervarix es una vacuna bivalente porque está dirigida a dos tipos de VPH: 16 y 18. Ambas vacunas son altamente efectivas para impedir la infección por los tipos específicos de VPH a los que están dirigidos. La vacunación generalizada tiene el potencial de reducir hasta en dos terceras partes el número de muertes por cáncer de cuello uterino en el mundo, si todas las mujeres se vacunaran y si la protección resulta ser de largo plazo. Además, las vacunas pueden hacer que disminuya la necesidad de atención médica, de biopsias y procedimientos agresivos asociados con las secuelas de pruebas anormales de Papanicolaou, lo que ayudará a reducir los costos de atención médica y la ansiedad relacionada con las pruebas anormales de Papanicolaou y procedimientos de seguimiento. Hasta ahora, no se han registrado efectos secundarios graves causados por las vacunas. Los problemas más comunes han sido una breve dolencia y otros síntomas en el sitio de la inyección. Estos problemas son semejantes a los que se experimentan ordinariamente con otras vacunas.\nLas enfermedades tropicales desatendidas son las infecciones más comunes de los 120 millones de personas en las Américas que viven con menos de US $ 2 por día. Estas enfermedades incluyen la anquilostomiasis y otras helmintiasis transmitidas por el suelo, la enfermedad de Chagas, amebiasis, esquistosomiasis, la leishmaniasis y el dengue. En conjunto, estas enfermedades desatendidas producen una carga de la enfermedad en el hemisferio occidental que en algunas regiones supera incluso el VIH/SIDA, y a la vez afectan las poblaciones pobres a través de sus efectos desfavorables especialmente en el desarrollo físico e intelectual en los niños, el impacto en las mujeres embarazadas y efectos en la productividad de los trabajadores de América Latina (4). La alta prevalencia e incidencia de estas principales enfermedades tropicales desatendidas ofrecen una oportunidad para la cooperación conjunta y la creación de alianzas para hacer frente a las condiciones más altas de prevalencia y acelerar el desarrollo de nuevas herramientas de control y alternativas para prevenir, diagnosticar o curar dichas enfermedades tropicales. Uno de los principales obstáculos en la trayectoria crítica para el desarrollo de productos y para la traslación de nuevos descubrimientos es el llamado \"valle de la muerte\", o los pasos necesarios para que un descubrimiento en el laboratorio pueda ser desarrollado a un punto en el cual se demuestra un camino claro hacia la investigación clínica (5). Una perspectiva para un modelo sostenible para acelerar la traslación de los descubrimientos de laboratorio en nuevas vacunas será presentada. Dicho modelo es actualmente utilizado por el Centro de Vacunas del Sabin Vaccine Institute y Texas Children?s Hospital, una asociación de desarrollo de productos (PDP) fundada específicamente para desarrollar vacunas recombinantes dirigidas a las enfermedades tropicales desatendidas y poder avanzar diferentes métodos de prevención o control.','Vacunas, vacuna contra dengue, vacunas contra Virus Papiloma Humano, vacunas de nueva generación',2,164,9,1,11,2,1,NULL,150,NULL,NULL,NULL,0,0,'2015-06-09 20:00:37'),(191,2,1,'La inteligencia general como un determinante del éxito académico','El estudio tiene la finalidad de analizar las relaciones existentes entre la inteligencia general y la asistencia a clases con el rendimiento académico, en una muestra de estudiantes universitarios de distintas carreras. Los participantes fueron 56 estudiantes universitarios matriculados en la clase de Psicología General (Sección 1500) de la Universidad Nacional Autónoma de Honduras, durante el tercer periodo académico de 2014. Los resultados ponen de manifiesto que no existe relación entre la inteligencia y el rendimiento académico( correlación nula) mientras que la asistencia a clases si se relaciona con este (correlación fuerte), por tanto la asistencia está mucho más vinculada al éxito académico. Estos resultados incentivan el estudio de otras variables que pueden estar vinculadas al rendimiento académico por lo que se requiere de otros estudios que ayuden a determinar cómo mejorarlo.','Inteligencia, asistencia a clases, rendimiento académico',2,84,1,1,11,2,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-09 20:21:32'),(192,2,1,'La accesibilidad universal en el campus de la UNAH. Plan Maestro de accesibilidad Ciudad Universitaria 2015','El proyecto consiste en levantar, describir y elaborar propuestas arquitectónicas de accesibilidad universal en todos los edificios que componen la Ciudad Universitaria de la UNAH. Se participó en el VII Congreso de Investigación Científica, como una mesa redonda, con el objetivo de afinar la propuesta para la Beca de Investigación No. 3, financiada por la DICYP. Posteriormente, se hizo parte del VIII Congreso, dando a conocer los avances de la investigación. \n\nSe pretende entonces, mostrar los hallazgos y las propuestas arquitectonicas en el presente simposio. Se tomaron en cuenta todos los edificios construidos que componen el campus universitario, las principales rutas de circulación dentro del campus, las principales rutas de acceso a la ciudad universitaria desde el transporte público y sus estacionamientos pavimentados. Se compartirá videos de los principales edificios, los planos arquitectónicos y el antepropyecto de la Plaza José Trinidad Reyes.','Accesibilidad, Barreras arquitectónicas, Ciudad Universitaria',2,351,11,1,11,2,1,NULL,100,NULL,NULL,NULL,0,0,'2015-06-09 23:15:06'),(193,2,1,'Disfunción de la articulación temporomandibular en estudiantes de primer ingreso, facultad de odontología. universidad nacional autónoma de honduras, 2014.','El presente trabajo tuvo como objetivo principal analizar la incidencia de la disfunción de la articulación temporomandibular en estudiantes de I ingreso en la facultad de odontología de la Universidad Nacional Autónoma en el tercer periodo del año 2014. Para tal fin se examinaron 95 estudiantes, a los cuales se evaluó con el Índice de Helkimo, para determinar la presencia de trastornos Temporomandibulares, y  se auxilió el estudio con el test estándar de la universidad de Murcia, y la ficha del Dr. José Cornejo. \nSe encontró que el 79.4% de los pacientes estudiados presentan disfunción anamnésica, el 65% disfunción clínica, y el 60.9% disfunción oclusal. El sexo más afectado fue el femenino en el índice anamnésico. Se encontró que hubo un mayor porcentaje de personas afectadas por trastornos temporomandibulares leves. El signo más prevalente fueron los ruidos articulares con 60%, seguido por sensibilidad muscular con un 24%, el síntoma más prevalente fue el atascamiento o traba de la mandíbula con 22%, el hábito parafuncional más prevalente fue el rechinamiento o apriete dentario con un 53% de la muestra. Conclusión: Existe una alta incidencia de disfunciones temporomandibulares en la población estudiada, con un porcentaje promedio de 66.6% según el índice de Helkimo.','Disfunción de la ATM.        Bruxismo.        Índice de Helkimo.',1,335,11,1,11,2,1,NULL,100,NULL,NULL,NULL,0,0,'2015-06-10 04:37:29'),(194,2,1,'Resistencia de dientes intactos y dientes restaurados con dos tipos de resina, sometidos a carga, Facultad de Odontología, UNAH','El objetivo de esta investigación fue determinar si existían diferencias significativas en la capacidad de resistencia a la fractura de dientes intactos y dientes restaurados con 2 tipos de resina sometidos a carga constante. Fue una investigación de tipo descriptivo donde se utilizó la observación como método de medición de la información, proporcionada por las visitas realizadas al Laboratorio de la Facultad de Ingeniería de la UNAH, utilizándose una máquina de compresión mecánica para realizar las pruebas de resistencia a la fractura.  Con ello se procedió a evaluar la resistencia a la fractura de 2 diferentes tipos de resinas compuestas utilizadas en restauraciones clase II en premolares, aplicándoles fuerzas verticales. Dentro de los resultados obtenidos tenemos que el tiempo de falla de los premolares restaurados con la resina Brilliant obtuvo una media de 34.51 (s), los dientes restaurados con la resina Filtek Supreme obtuvieron una media de 22.43 (s) y en los dientes intactos su media fue de 17.89 (s). Y en cuanto al tipo de Fractura, en los dientes restaurados con resina Brilliant, el diente agrietado es el tipo de fractura más frecuente (40%), en los dientes restaurados con resina Filtek Supreme, el diente partido es el tipo de fractura más frecuente (40%) y de los dientes intactos lo fue la fractura cuspidea (60%). Se concluyó que tanto la resina Filtek Supreme como la Brilliant tienen una capacidad a la resistencia a la fractura similar, por lo que ambos materiales son óptimos para su uso en restauraciones de dientes posteriores.','Resistencia a la Fractura.    Resina.    Fractura Dentaria.     Dientes.',1,335,11,1,11,2,1,NULL,100,NULL,NULL,NULL,0,0,'2015-06-10 05:21:35'),(195,4,1,'Estado de la Dentición Temporal y Permanente y Necesidad de Tratamiento Odontológico, en escolares del municipio de San Ignacio de Loyola, Francisco Morazán. 2013 al 2015','Objetivo: registrar el estado de la dentición temporal y permanente, con el propósito de analizar la Prevalencia de Caries, el Índice CPO-D, índice ceo-d y la necesidad de tratamiento odontológico inmediato , en los escolares de seis a doce años de edad del municipio de San Ignacio de Loyola, geográficamente dividido entre el Casco Urbano y seis aldeas, que fueron visitadas y asistidas por el equipo de trabajo del Proyecto APS-Bucal, conformado por la máxima autoridad de nuestra facultad, Comisión de Vinculación de la Facultad de Odontología-UNAH, y como grupo de apoyo, los pasantes de servicio social, que procedieron a aplicar el Formulario de Evaluación Odontopediátrica Poblacional (modificada), conteniendo las siguientes variables y/o categorías: Diente Permanente: Cariado (C) - Perdido (P) y Obturado (O); Diente Temporal: cariado (c) ? extracción indicada (e) y obturado (o); y necesidad de tratamiento odontológico inmediato. Materiales y Métodos: Se realizo un estudio descriptivo, transversal y observacional en la población escolar (N=1070). Resultados: Prevalencia de Caries en escolares de 12 años: 90% y un CPO= 5 (alto). En escolares de 6 años la prevalencia de caries es de 42%, el ceo= 7 (muy alto). El aporte porcentual del índice C= 66%, P=11, O=4%. El aporte porcentual de c=68%, e=24, 0=5%. Las niñas son las que presentan más severidad de caries. El 90% de los escolares presentan necesidad de tratamiento odontológico. Conclusiones: La prevalencia de caries dental es alta y aumenta con la edad. Siete de cada 10 escolares no ha recibido tratamiento odontológico. Las niñas son más vulnerables al ataque y severidad de la caries y por ende a mayor necesidad de tratamiento odontológico. La aldea El Naranjal es la que más tratamiento odontológico necesita, en cambio, El Escano de Tepale es la que mejor salud dental presenta (2.3= bajo). Es necesario implementar programas de salud bucodental.','Prevalencia de caries.      Caries dental.     Índice CPOceo.   Dentición.  Necesidad de tratamiento.',3,335,11,1,11,2,1,NULL,100,NULL,NULL,NULL,0,0,'2015-06-10 07:15:24'),(196,5,1,'titulo test','resumen -test','palabras claves',2,3,7,1,11,1,1,NULL,50,NULL,NULL,NULL,0,0,'2015-06-10 14:45:39'),(197,3,1,'Perfil del Turista y Satisfacción del Cliente en La Ceiba y Tela','El Consejo Regional Estadístico (CRE) de La Ceiba y Tela se conforma en el marco de la implementación del proyecto ?Desarrollo de un Modelo de Turismo Sostenible en la Costa Norte de Honduras (ATN/ME?10096?HO)? apoyado por CANATURH y BID ? FOMIN.\nEl CRE, es un espacio regional, multidisciplinario y multi?actoral público?privado que lleva a cabo la medición de un conjunto de indicadores de manera sistemática sobre el perfil socio-económico, características del viaje y nivel de satisfacción de los visitantes de La Ceiba y Tela. \n \nEl CRE está conformado por las siguientes instituciones: Instituto Hondureño de Turismo (IHT), el Centro Universitario Regional del Litoral Atlántico (CURLA), Dirección de Investigación y Estadística Municipal (DIEM), Municipalidades de La Ceiba y Tela, La Cámara Nacional de Turismo de Honduras (CANATURH), el Proyecto CANATURH BID/FOMIN Y USAID ProParque.\n \nA través de los resultados, se podrán realizar análisis para conocer las características y flujos turísticos de estos dos municipios, tomar decisiones en función de la información del destino y valorizar el impacto que genera el turismo en la región.\nLa información estadística que se genera a través de encuestas, constituirá además la base para la consolidación de un Modelo de Cálculo SROI (Social Return on Investment) que permita determinar cuál es el retorno de la inversión que se realizará a través del proyecto Desarrollo de un Modelo de Turismo Sostenible en la Costa Norte de Honduras.\nObjetivos: \nDesde la perspectiva académica, en este proyecto combinamos la docencia, cuando los estudiantes son capacitados para la aplicación de la encuesta.  Ponen en práctica los conocimientos teóricos sobre el turismo y tienen su primera experiencia real de contacto con  visitantes.  Aprenden y ponen en práctica herramientas estadísticas como ACCES y SPSS y serán capaces de analizar datos estadísticos que servirán de líneas base para futuros proyectos de Investigación.  \nLa Vinculación Universidad/Sociedad se hace evidente cuando los resultados obtenidos servirán para elaborar estrategias de mercadotecnia, fortalecer las relaciones interinstitucionales, evaluar la eficacia y eficiencia de las decisiones administrativas, medir la importancia del turismo en la economía de La Ceiba y Tela y mejorar la experiencia del visitante.','Perfil de Turista  Satisfacción del cliente',2,521,11,1,11,2,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-10 20:10:53'),(198,4,1,'Economia del Patrimonio Urbano Arquitectónico','El Patrimonio Urbano Arquitectónico está en constante transformación, degradación, ruina o desaparición, son diferentes factores los que conducen a dicha situación, en una simple observación del caso, se manifiesta que las causas de la transformación son diversas y en múltiples casos actúan simultáneamente.\nEn este sentido, el patrimonio arquitectónico se transforma a través del tiempo en un proceso que depende de la relación y vinculación de ciertos factores que proceden de acciones y efectos que se producen desde el punto de vista físico, cultural, social y económico.\n\nEn cada caso la combinación de factores determinará el tipo y nivel de transformación, en marcándose en periodos específicos del desarrollo y crecimiento de la ciudad; por tanto es preciso examinar el común denominador de la interacción entre diferentes los componentes involucrados en el proceso. Esta investigación se centra en la relación entre la economía y patrimonio urbano, siendo toral ciertos conceptos como la naturaleza económica de los bienes patrimoniales y su conservación; los procesos urbanos de decadencia y de renovación y el papel del desarrollo económico en la degradación del patrimonio urbano','Patrimonio,  Estudios Urbanos,  Arquitectura, Conservación',4,362,11,1,11,1,1,NULL,10,NULL,NULL,NULL,0,0,'2015-06-10 21:52:44'),(200,3,1,'EL DRON Y SU CONDICION JURIDICA','Honduras se perfila, como los demás países centroamericanos a excepción de Guatemala, paraísos en la proliferación desregularizada de aeronaves pilotadas a control remoto conocidas como Drones,  que actualmente se desarrollan sin ningún tipo de control gubernamental dentro de nuestros espacios aéreos; importante es, señalar la falta de regulación jurídica del Objeto Técnico Aeronáutico Civil que navega nacional e internacional y, pilotada bajo la modalidad de robot aeronáutico, logrando este, el auge tecnológico no esperado en los países que pertenecen a la región centroamericana, de tal fin convirtiéndose su desarrollo en el incentivo de investigación científico-jurídico de lo que resulta la interrogante ¿son los Drones, amenaza contra la Seguridad de la Navegación Aérea Civil Internacional?','Drones, aeronaves no tripuladas',2,524,11,1,11,1,1,NULL,15,NULL,NULL,NULL,0,0,'2015-06-11 05:19:53'),(202,2,1,'METODOLOGÍA PARA  DETECCIÓN DE BÓLIDOS EN EL OBSERVATORIO ASTRONÓMICO CENTROAMÉRICANO DE SUYAPA','El presente trabajo describe el desarrollo de un sistema para detectar y procesar bólidos ( meteoros igual o más brilllantes que Venus)\nEl sistema incluye una cámara de alta sensibilidad, blanco y negro, estos detectores son más sensibles que los detectores de color para la detección de bólidos. El software de la cámara tiene dos aplicaciones independientes, una para la adquisición de imágenes y video, y otra para control de la cámara, \nEl sistema desarrollado está en operación en el Observatorio Astronómico Centroamericano de Suyapa de la Facultad de Ciencias Espaciales de la Universidad Nacional Autónoma de Honduras y se pretende  replicar en otros puntos del país a efectos de construir una red de sistemas todo cielo capaz de determinar órbitas originales de bólidos.\nPara realizar el análisis de los datos obtenidos se utiliza el software UFO Capture V2 que permite \nobservaciones prolongadas de manera estable y precisa, Captura  objetos en movimiento, Encuentra \nobservaciones simultáneas de bólidos desde resultados multi-lugar, Calcula elementos orbitales','Bólidos',2,404,11,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-11 14:41:24'),(203,4,2,'ponencia a eliminar','resumen ponencia a eliminar','palabras claves',3,1,11,1,11,1,1,NULL,600,NULL,NULL,NULL,0,0,'2015-06-11 14:42:32'),(204,3,1,'Caracterización epidemiológica y resistencia antibiótica en Enterobacteriaceae productoras de B lactamasas de espectro extendido (BLEE).  Hospital Escuela Universitario. Tegucigalpa, Honduras.','Antecedentes. La prevalencia de  Enterobacterias productoras de ?-lactamasas de espectro extendido (BLEE) se ha incrementado a nivel mundial aumentado el riesgo de mortalidad en los pacientes infectados con este tipo de bacterias. \nObjetivo. Determinar las características epidemiológicas y resistencia bacteriana de Escherichia coli y Klebsiella pneumoniae BLEE aisladas en  pacientes del Hospital Escuela Universitario en el año 2013. \nMetodología. Estudio transversal. Se recolectaron 50 cepas de Escherichia coli y 50 cepas de Klebsiella pneumoniae ya identificadas como BLEE aisladas de pacientes del Hospital Escuela Universitario de abril a agosto del 2013,  fueron  trasladas al Laboratorio de Investigacion en Enfermedades Tropicales de la Escuela de Microbiología UNAH, se les realizó aislamiento, identificación y susceptibilidad a antibióticos (Amoxicilina +Ac. Clavulanico, Cloranfenicol, Gentamicina, Norfloxacina Tetraciclina, Trimetropin sulfametoxazol, Cefoxitin, Cefpodoxime, Ceftazidime, Cefotaxima, Ceftriaxona) por medio del método estandarizados de Kirby-Bauer y la prueba comercial E-test para Concentración Mínima Inhibitoria (MIC). La información clínica-epidemiológica se obtuvo de los expedientes clínicos. El análisis de la información se realizó en  Epi info 7 y SPSS. \nResultados. La media de edad de los pacientes con E. coli fue 33.6 años ± 26.5 1DE y 26.5 años ± 26.4 1DE con K. pneumoniae. Las muestras fueron recolectada a los 10.0 días en promedio de hospitalización para los pacientes con E. coli y 21.8 días para los de K. pneumoniae y las diferencias fueron significativas (p=0.02). E. coli presentó resistencia a 9 de los 11 antibióticos, K. pneumoniae a 10 de los 11 antibióticos estudiados y las diferencias fueron significativas (p=0.00002), el tipo de muestra más frecuente donde se aisló E. coli fue orina (62.0%) y K. pneumoniae en un 34.7% de orina seguido de hemocultivo (16.3%) por lo tanto UCI fue donde se aisló el mayor porcentaje de K. pneumoniae en cambio E. coli fue  consulta externa. E. coli fue resistente en 100.0.% a Ceftriaxona y Cefotaxime, K. pneumoniae en un 98.0%. Y una menor resistencia al cloranfenicol 6.0% para E. coli y 54.0% para K. pneumoniae. Conclusiones/Recomendaciones. los resultados de este estudio muestran la existencia de Enterobacterias BLEE, altamente resistentes,  esencialmente a las cefalosporinas de tercera generación y se deben redefinir los esquemas de antibioticoterapia para el mejoramiento de la calidad de atención médica hospitalaria.','BLEE, Escherichia coli, Klebsiella penumoniae',2,309,7,1,11,1,1,NULL,100,NULL,NULL,NULL,0,0,'2015-06-11 20:35:56'),(205,5,1,'Resultados del Estudio Universitic LATAM 2014. Descripción, Gestión y Gobierno de las Tecnologías de la Información en las universidades latinoamericanas.','La Comisión Sectorial de las Tecnologías de la Información y las Comunicaciones de la Conferencia de Rectores de las Universidades Españolas (CRUE-TIC), desarrolla desde el año 2006 los Estudios Universitic con el propósito de realizar anualmente un análisis detallado de la situación de las TI en el Sistema universitario Español, SUE.\n\nLa mirada periódica puesta al tema de las TI y la Universidad ha permitido al SUE la evolución general en este temática, identificar buenas prácticas en universidades específicas, que sirven de referente a otras instituciones de educación superior en sus procesos de mejora.\nA partir del año 2013 la CRUE-TI decidió ampliar el estudio Universitic, a universidades de América Latina y en el 2014 la invitación de participar en el mismo llegó  a la Universidad Nacional autónoma de Honduras, UNAH.\n\nEl Informe del Estudio Universitic 2014 no constituye un mero inventario de los elementos TI activos en las universidades participantes, puesto que incluye además un estudio global y minucioso de las TI desde diversas perspectivas, centrándose en tres componentes esenciales: la descripción, la gestión y el gobierno de las TI.\n\nEl objetivo central del estudio es ofrecer a los equipos de gobierno de las universidades una información precisa, que desde el punto de vista estratégico, les apoye en la adopción de decisiones relacionadas con los nuevos proyectos y servicios basados en TI.\n\nEs así como desde la mirada de los expertos permite la revisión detallada de las tablas de datos, de las cuales emanan interesantes conclusiones\n\nLa CRUE-TI está lanzando el tercer estudio Universitic 2015 para América Latina, donde la UNAH espera participar con el propósito de ir identificando fortalezas y puntos de mejora el ámbito de las TI.','Tecnologías de Información y Comunicaciones, docencia no presencial o virtual, investigación, gestión de las TI, enseñanza',1,389,11,1,11,2,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-11 21:13:44'),(206,5,1,'Nivel de Conocimientos, Actitudes y Prácticas sobre la Enfermedad del Chikungunya en la Población del Barrio Jesus, de la Ciudad de Juticalpa. Marzo 2015','El estudio se realizo con el objetivo de conocer los niveles de Conocimientos, Actitudes y Practicas que tiene la población del barrio Jesús de la Ciudad de Juticalpa en el periodo de marzo 2015, justificado por los niveles de inclusión epidemiologicos que cumplen como ser:  altos indices de infestación, la alta tasa de incidencia de casos y el numero de habitantes en riesgo de enfermar.  La ciudad de Juticalpa, esta como tercera ciudad del pais con las tasas mas altas de incidencia de la enfermedad y el canal endémico de degue desde la semana 1 del 2015 hace un repunte en el numero de casos lo que coincide con los indices de infestación del vector transmisor que es el mismo para el chikungunya. Este estudio es descriptivo, transversal. El método utilizado es la observación y el instrumento que se aplico (encuesta CAP) los resultados describen que hay un alto porcentaje de la población con conocimientos 94% pero menos del 50% realizan practicas de prevención.','Conocimientos, Actitudes, Practicas y chikungunya.',2,513,11,1,11,1,1,NULL,5,NULL,NULL,NULL,0,0,'2015-06-12 00:08:45'),(207,4,1,'Medición de la frecuencia de vibración de un anillo de Thomson','El fenómeno conocido como anillo de Thomson consiste en la levitación de un anillo de aluminio alrededor del núcleo sobresaliente de una bobina alimentada por corriente alterna (C.A). En nuestro trabajo mediremos la frecuencia de vibración del anillo, mediante las ondas capilares estacionarias generadas por aquel al vibrar en un medio acuoso controlado.','aluminio, inducción de Faraday, anillo de Thomson, frecuencia.',3,454,11,1,11,1,1,NULL,10,NULL,NULL,NULL,0,0,'2015-06-12 04:47:43'),(208,2,1,'ESTUDIO DE INTERFERENCIA DE RADIOFRECUENCIA (RFI) EN VHF  406','Este documento presenta los resultados del estudio denominado ?Estudio de Interferencia de Radiofrecuencia en VHF, 406 - 410 MHz.?, siendo este estudio, de primordial importancia en las etapas previas a la implementación de un Radiotelescopio.\nEn nuestro país no se ha realizado ningún estudio de este tipo, en ninguna frecuencia o rango de frecuencias destinadas para el Servicio de Radioastronomía, servicio que fue definido conjuntamente por la Unión Internacional de Astronomía y la Unión Internacional de Telecomunicaciones (IAU e ITU ?siglas en inglés, respectivamente).  \nComo objetivo principal del estudio, se determinó la existencia o no de emisiones de interferencias radioeléctricas de origen humano, como ser interferencias: Co-canal, Canal adyacente, Harmónicas, Espurias  e Intermodulaciones en VHF, 406 - 410 MHz, en la ciudad de Tegucigalpa, específicamente en el Observatorio Astronómico Centroamericano de Suyapa (OACS), o dicho de otra manera, el ambiente en radiofrecuencia al que estará expuesta cualquier señal proveniente de objetos celestes ubicados en el centro de la galaxia y los brazos de esta, emitida en frecuencia VHF 406 - 410 MHz.\nLos datos se recopilaron mediante técnicas de monitoreo de Interferencia en Radiofrecuencia (RFI -siglas en Ingles), establecidos en el ?Handbook Spectrum Monitoring?, publicado por ITU en el año 2011 y se utilizaron equipos certificados por ITU, para estudios radioeléctricos -RFI.\nLas conclusiones y las recomendaciones, parten de las disposiciones emanadas por ITU, para el Servicio de Radioastronomía y del análisis de las condiciones radioeléctricas existentes en el OACS.\nEl estudio demostró que la ubicación del Observatorio Astronómico Centroamericano de Suyapa (OACS),  durante el periodo del estudio, no se detectaron interferencias de origen humano,  lo que permite que señales de fuentes de la Vía Láctea, sean factibles de ser recibidas, quedando sujetas a la sensibilidad del equipo receptor del radiotelescopio.','Radioastronomía, RFI, RadioInterferencias',2,404,11,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-12 14:59:18'),(209,1,1,'Complejidad Ciclomática y Líneas de Código Como Métricas de Software en Proyectos Desarrollados en UNAH Tec Danli','Este artículo describe la experiencia de aplicar algunas métricas de software sobre proyectos desarrollados por estudiantes de Licenciatura en informática Administrativa de UNAH-TEC-Danlí. Se explican dos métricas importantes usadas para medir la complejidad y el tamaño del software. Se analizan los valores obtenidos al aplicar estas métricas en diferentes niveles de granularidad y se define una relación entre ambas. Los temas y el análisis de los datos presentados en este artículo pueden resultar importantes para estudiantes y programadores que buscan mejorar la calidad de sus aplicaciones, así como para docentes de centros  de enseñanza superior en el área de lenguajes de programación que desean adiestrar a sus alumnos en la aplicación de métricas complejidad de software.','UNAH, UNAH Tec Danli, métricas de software, complejidad ciclomatica, lineas de software',3,111,7,1,11,2,1,NULL,15,NULL,NULL,NULL,0,0,'2015-06-12 15:15:07'),(210,1,1,'La Gestión del Conocimiento en el Desarrollo de Software Ágil','Muchas empresas de desarrollo de software están adoptando metodologías ágiles. En un proceso tradicional de desarrollo de software se requiere y genera mucho conocimiento y como en entornos ágiles se le da mucha importancia a los procesos de retroalimentación en ciclos cortos, la cantidad de conocimiento generado es mayor. Por lo tanto, las empresas enfrentan el reto de crear sistemas efectivos de administración del conocimiento.','gestión del conocimiento, desarrollo ágil, herramientas de colaboración',3,111,7,1,11,2,1,NULL,15,NULL,NULL,NULL,0,0,'2015-06-12 16:09:20'),(211,1,1,'Analisis de Mineria de Datos con Weka Parallel en Computadoras Multinucleo','Los estudiantes e investigadores cada vez más tienen la necesidad de aplicar de minería de datos. Weka surge como un proyecto que pone a su disposicio ?n una coleccio ?n de al- goritmos que facilitan el descubrimiento de conocimiento en los datos. Sin embargo, no fue disen ?ado para aprovechar el paralelismo local con multihilo ni los ambientes distribuidos. Ante esta necesidad han surgido algunos proyectos que extienden Weka permitiéndole aprovechar mejor los recursos. Uno de estos es Weka Parallel. En este artículo se analiza el rendimiento de Weka Parallel y la mejor forma de utilizarlo en una sola computadora que tenga procesador multinúcleo','Weka, paralelo, distribuido, multinucleo, mineria de datos',3,111,7,1,11,2,1,NULL,15,NULL,NULL,NULL,0,0,'2015-06-12 16:47:09'),(212,2,1,'Evaluación del Impacto Ambiental de los Métodos de Mecánico y Solar  de Café en El Paraíso Honduras.','Para realizar un detallado balance de consumo de energía en un sistema de secado en un beneficio de café, sería necesario instalar un riguroso sistema de medición y verificación de los diferentes flujos de energía que se observan dentro del proceso de secado del café durante la plena temporada de producción. Sin embargo, esta tarea estaba fuera de las posibilidades de este estudio, y debido a esta situación se calculó valores de consumo de energía tomando como base la información recolectada en algunos beneficios y exportadoras visitados en el municipio de El Paraiso. Con esto en mente, se calcularon los flujos de energía eléctrica (kWh) consumida por los motores mediante la potencia (HP) de los mismos,la energía calorífica generada y consumo de combustible (cascarilla y madera) en los hornos, para luego intentar estimar los consumos promedios por flujo de energía utilizada, por cada método de secado mecánico utilizado en la zona.En el caso de los métodos de secado solar como patio de concreto y secadora tipo domo, los flujos de energía generados se calcularon a partir de la radiación solar emitida en un día (0.024 kWh/m2 día), junto con la densidad del grano ocupada por método utilizado para secar el grano (Kg/m2) es decir 70lbs por m2 en patio y 50lbs por m2 (zaranda) en domo, otra forma fue utilizando como base de cálculo el 5% de la producción nacional secado bajo métodos de secado solar. Una vez calculada la energía consumida para ambos métodos se realizaron una serie de comparaciones estadísticas mediante tablas a partir de las toneladas, barriles de petróleo equivalente, emisiones de CO2 producidas ya sea durante el tiempo de secado o bien por la producción nacional de acuerdo al método empleado. Los resultados del estudio fueros notorios por ejemplo según la cosecha 2013-2014 con el secado mecánico (95%) se consumen 4244MWh de energía (eléctrica-calórica), el equivalente a 368toneladas de petróleo o 2650barriles de petróleo y emitir 1137toneladas de CO2 en cambio con el secado solar o natural (5%) se ahorran 247MWh energía eléctrica, 22toneladas de petróleo o 159barriles de petróleo y se evitarían 67toneladas de CO2en la atmosfera. Si se desea conocer laenergía producida  mediante secadoras mecánicases la siguiente: la rotativa consume 10MWh el equivalente a 1tonelada de petróleo y emite 2.5toneladas de CO2, la vertical consume 13MWh el equivalente a 1tonelada de petróleo y emite 3.5toneladas de CO2 y la estática consume 5MWh el equivalente a 0.5toneladas de petróleo y emite 1.5 toneladas de CO2.','energía renovable, biomasa, secadoras solares, TEP, emisiones, CO2.',1,127,7,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-12 17:07:34'),(214,2,1,'Analisis de los procesos productivos de Palma Africana En Honduras','Se desarrolló el Perfil Agroindustrial de la Palma Africana (Elaeis Guineensis) en Honduras en la empresa Palmas Centroamericana S.A de CV (PALCASA S.A de CV) Ubicada en Aldea Los Castaños, localizada en kilómetro 16, carretera Progreso a Tela El estudio comenzó el 01/10/2014 y finalizó el 30/12/2014 con un ciclo de catorce semanas. Consistió en Observar detalladamente el proceso de extracción de aceite de palma africana que se realiza en la empresa Palcasa S.A, y comparar dicho proceso con la metodología que se emplea en las plantas extractoras de otras partes del mundo y nacionalmente, se realizaron mediciones diarias durante los meses de octubre, y noviembre del 2014 de las perdidas en el proceso, y así determinar los valores para establecer el respectivo balance de materia del proceso de extracción de aceite de palma africana, en donde e obtuvo los siguientes resultados: Total en kg= 100 , Extracción de aceite= 22.25kg, 92.70% (incluyendo la acidez como aceite), Total de pérdidas de aceite = 1.75kg, Extracción de Almendra= 5kg, Total de pérdida de Almendra= 0.4%. \nCon respecto al ambiente socioeconómico la palma africana en honduras se ha convertido últimamente una fuente de ingresos, y empleos muy importante a nivel de país, Su aporte al PIB agrícola es 13.50%/PIB ampliado 17.3%. Genera ingreso de divisas por más de 300 millones de dólares al año (2012: US$ 331.0 Millones con 206,000 TM de Aceite), socialmente beneficia a más de 18,000 familias que la producen y más de 100,000 dependientes; el 10% de las unidades productivas son manejadas directamente por mujeres y el 90% por varones; genera unos 135,000 empleos directos e indirectos y más de 300,000 beneficiarios, A generado prosperidad económica a la mayoría de los 41 municipios de los departamentos de Colon, Atlántida, Yoro y Cortes, cuya población representa el 35% del total nacional.\nDentro del estudio se realizó una descripción detallada del proceso realizado en la empresa PALCASA S.A, junto con la descripción de la maquinaria y equipo utilizados en el proceso, además se llevó a cabo un manual de calidad, describiendo el equipo de laboratorio junto con el procedimiento detallado de los análisis  respectivos parámetros y la aplicación  de un plan de mejora y análisis de puntos críticos de control (HACCP) para el mejoramiento del proceso.','Palma africana, producción, proceso, balance materia, HACCP.',2,127,7,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-12 17:44:41'),(215,2,1,'Relación entre los elementos situacionales producto del juego y la conducta verbal de los entrenadores en competición de voleibol','Los entrenadores son los responsables de que sus atletas o deportistas puedan responder de forma óptima durante la competencia del deporte, para ello es necesario que los entrenadores san formados en los aspectos técnicos, tácticos, físicos, psicológicos y también en la pedagogía del deporte para transmitir la mejor enseñanza a sus deportistas.\nCon esta investigación, pretendo ofrecer información de mucha importancia para los entrenadores actuales de voleibol y además a los educadores físicos que se orientan como entrenadores deportivos en Honduras, con el fin de profundizar en la pedagogía del deporte y específicamente en la dirección de equipos deportivos.\nEsta investigación se desarrollo durante el XXV Torneo de Voleibol de Escuelas Bilingues de Honduras (ABSH), en el mes de marzo del 2015, analizando a cinco entrenadores durante la competición, por medio de una grabadora de audio y grabadora de video para captar las situaciones de juego y la conducta verbal de los entrenadores.','Dirección de equipos, situaciones de juego, conducta verbal, entrenador, voleibol.',3,545,11,1,11,1,1,NULL,50,NULL,NULL,NULL,0,0,'2015-06-12 20:19:17'),(216,1,1,'La creatividad como competencia docente del profesor de Diseño:','Durante su existencia la educación se ha preocupado por homogeneizar la formación. No obstante, los paradigmas que se establecen con el siglo XXI: caos, cambio, minorías y heterogeneidad entre otros evidencian que la enseñanza superior tiene que renovarse inevitablemente. El hombre es creativo por naturaleza, esto quiere decir que la creatividad se encuentra en la base de la adaptación y la actitud transformadora como progreso. Aquí radica la importancia de enseñar con creatividad, sin embargo, ser un arquitecto o diseñador destacado no es suficiente para desempeñarse con éxito como profesor de diseño, ser profesor de diseño es otra profesión y por ello es necesario dominar las competencias que la distinguen como tal. Este trabajo no aborda la enseñanza de la creatividad, sino de cómo enseñar creativamente. Analiza y expone el conjunto de competencias del docente, en específico la creatividad, en el campo del diseño. Contrasta docencia versus docencia creativa: la creatividad vista como nivel de excelencia y referencia de desempeño de calidad, para lo cual es necesario conocer las estructuras del qué y el cómo se enseña para ser un profesor creativo. El presente trabajo responde a: ¿existen regularidades del proceso proyectual?, ¿Existe una Didáctica especifica del proceso proyectual?, ¿la enseñanza de un contenido creativo es creativa por naturaleza?, ¿Es creativa la actividad docente de los talleres de proyecto? y finalmente ¿Existen claves para una enseñanza creativa del diseño?','Didáctica especifica del diseño, proceso proyectual,  enseñanza del diseño, creatividad, competencias del profesor de diseño. Estrategias didácticas. Enseñanza creativa.',2,479,11,1,11,3,1,NULL,300,'',NULL,NULL,1,0,'2015-06-12 20:43:33'),(217,2,1,'Patrones y estilos de crianza en las familias hondureñas en el 2015','Se presentará un marco conceptual y metodológico, además de un un avance de los resultados parciales de la Investigación \"Pautas y estilos de crianza en las familias hondureñas en el 2015\"','crianza, pautas, estilos, familias',2,547,11,1,11,1,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-12 21:15:50'),(218,2,1,'Eficiencia: Proyecto de Vivienda Social','efiCIENCIA fue el proyecto ganador del concurso nacional de vivienda social promovido por el Instituto Hondureño de Ciencia, Tecnología y de la Innovación (IHCIETI). El proyecto surgió a partir de la investigación de las aristas que condicionan los proyectos de vivienda social en el país. Se trató los temas de las urbanizaciones de vivienda social como la posibilidad de conformar nuevas comunidades. También se investigó sobre la implementación de diferentes sistemas constructivos para la realización de un concepto moldeable. Otro de los aspectos importantes fue la implementación de mobiliario incorporado y tecnologías low-cost que propiciaran un mejor confort a las personas que habitarán el modelo de casa.','Vivienda Social, Arquitectura, Soluciones Modulares, Sostenibilidad, Urbanismo',2,479,11,1,11,2,1,NULL,90,NULL,NULL,NULL,0,0,'2015-06-12 21:25:06'),(219,3,1,'DESCRIPCION  DE TRES DIFERENTES ESPECIES PRODUCTORAS DE MIEL DE ABEJA  PARA CONSUMO HUMANO ADAPTADAS EN LA REGION 11 DE HONDURAS.','La abeja más conocida y estudiada en nuestro medio, son las abejas de la especie: Apis Melífera  abeja africanizada introducida en américa para aumentar la producción de miel. Pero no todos conocen las abejas nativas como el jimerito (tetragonisca angustula) y el jicote de abeja real o morito (Hymennoptera apidae), que producen una excelente calidad de miel, producida en su totalidad para medicina y alimentos suplementarios, se adaptaron panales de las tres variedades en la misma zona, en una finca de café, para observar y medir todas las caracteristicas fisicoquímicas que se elaboraron en este estudio.\n Las características biológicas de las tres variedades de abejas estudiada se encuentran: el tamaño de los abeja en las aphis mellífera el tamaño generalmente es de 20 a 30 mm de longitud y robustas y la tetragonisca angustula es más pequeña mide  2 a 8 mm de longitud y delgadas y la Hymennoptera apidae es un poco más grande puede llegar a medir de 8 a 25 mm de longitud y robustas. la naturaleza de entrada de las abejas al nido en las abejas Europeas no hacen entrada, las tetragonisca hacen una piquera de sera larga y las himenópteras hacen una entrada de baro especial, las celdas reales para nuevas reinas en las abejas europeas es una celda especializadas grandes, el las angustula las celdas reales especializadas más grandes que de obreras y machos y las himenópteras no tienen celdas reales y en las características químicas de las mieles de abejas Europeas y las nativas son diferentes. La humedad de la miel de abeja europea es de 18 a 20 % y las de abejas nativas es de 30 a 35 % y de 20 a 30 % y los contenidos de azucares en las abejas europeas es de  85 a 90 % y las abejas nativas de 70 a 80 % y 82 a 85 %, una acidez o pH de 3.0 y 4.5 para abejas europea y un pH de 3.0 y 3.5 para las abejas nativas  y el Hidroximetilfurfural de 1 a 5 mg/1000gr de HMF para mieles de abejas Europeas y  6 mg/1000gr de HMF Y  las propiedades físicas más sobresalientes están: la Densidad y densidad relativa que es de1,39 y 1,44 kg/L para abeja europeas y	entre 0.96 y 1,2 kg/L para abejas nativas y Grados °Brix 85 % para abejas europeas y 79%, 81% para las mieles de abejas nativas y el Color que pueden variar de acuerdo a la floración recolectada por las abejas, con un Color netamente cristalino para las mieles de abejas nativas y las mieles de abejas Europeas presentan diferentes tonalidades de colores. La Conductividad eléctrica de las mieles de abejas europeas varía entre los 0.868 a los 3.65 x 10-4/ohm cm. y las mieles de abejas nativas	varía entre los 0.40  a los 2.45 x 10-4/ohm cm. el rendimiento por colmena al año es diferentes, en las abejas europeas el rendimiento es hasta de 600 kg/año y las abejas nativas producen  de 7 a 11 kg por colmena al año.','Miel, Abeja, producción, nativas, fisicoquímica, panales, subproductos.',3,127,7,1,11,2,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-12 21:36:47'),(220,5,1,'Estado de la TI en la UNAH: un diagnóstico preliminar','Este panel tendrá como propósito reflexionar sobre el estado de las TI a nivel de la UNAH tomando como referente los indicadores del estudio UNIVERSITIC LATAM 2014, del cual la UNAH formo parte. \nLa información derivada de la participación en este estudio internacional en el campo de las tecnologías de la información en la educación superior ha permitido  llevar a cabo un analisis interno sobre la descripción y gestión de las TI  la UNAH. Este diagnóstico posibilita la mirada cientifica de la situación actual de las TI a nivel de equipamiento para la docencia y la investigación, capacitación la alfabetización digítal, el avance en la automatización de procesos a nivel de la gestión administrativa y académica. \nEn ese sentido, se proporciona información relevante para la definición de politicas académicas institucionales con el fin de lograr un uso eficiente y eficaz de las TI y poder avanzar al ritmo de las tendencias de las TI a nivel de la educación superior Iberoamericana. Resultado de este diagnostico se extraen conclusiones y recomendaciones para fortalecer la gestión y el gobierno de las TI en la UNAH.','Tecnologías de la Información TI, Infraestructura TI, gobierno de la TI, gestion de la TI.',2,554,11,1,11,2,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-12 22:15:38'),(221,2,1,'DISEÑO DE UNA PROPUESTA DE PAGOS POR SERVICIOS AMBIENTALES HÍDRICOS EN LA MICROCUENCA DEL RÍO LANCETILLA, MUNICIPIO DE TELA, ATLANTIDA, HONDURAS.','El agua es un recurso fundamental para el funcionamiento de los ecosistemas y para la vida humana en el planeta ya que todos los seres vivos lo necesitan para poder vivir (ONU, 2005). \n\nEl agua puede ser utilizada para la producción de alimentos, para cubrir las necesidades de agua potable de las poblaciones humanas, para la agricultura, recreación, producción industrial y pesquera entre otros (Badii, 2007). Con lo anterior queda claro que el agua es un recurso vital para mantener la vida y  el equilibrio ecológico de nuestro planeta. Sim embargo, este recurso con el paso del tiempo se vuelve más escaso debido a la presión que se ejerce sobre las zonas productoras de agua y otras actividades como la tala ilegal del bosque o la agricultura migratoria en las partes altas de las cuencas hidrográficas. Con esto hay que tener presente que de toda el agua disponible en el planeta solamente un 0.007% es agua dulce, por lo tanto, su conservación es una obligación de las instituciones públicas, privadas y de la sociedad civil. \n\nLos ecosistemas proveen una serie de bienes y servicios ambientales que no tienen un mercado definido y por lo tanto carecen de un precio y valor para la sociedad; esto hace que muchos servicios ambientales como la protección de cuencas hidrográficas no tengan el suficiente apoyo técnico y financiero para su eficiente gestión. \n\nEs aquí donde entra una herramienta denominada Pago por Servicios Ambientales, definido como un mecanismo innovador, flexible y adaptable a diferentes condiciones para el manejo de los recursos naturales que apunta a un pago o compensación directo por el mantenimiento o provisión de un servicio ambiental por parte de los usuarios que se benefician del servicio el cual se destina a los proveedores (UICN, 2012). A nivel internacional existen cinco criterios definidos por Wunder (2005) para la implementación de un sistema de PSA, por lo tanto, es necesario cumplirlos todos para considerar una experiencia como un sistema de PSA, estos son: (1) la existencia de un acuerdo voluntario, (2) la provisión de un servicio ambiental, (3) un oferente, (4) un demandante y (5) un mecanismo de transacción.\n\nPara establecer el sistema de PSA en la microcuenca del río Lancetilla se propone el diseño de un esquema metodológico basado en experiencias anteriormente implementadas por: PASOLAC (2006); PASOLAC (2002); Espinal y Martínez de Anguita (2006); Martínez de Anguita et al. (2006) y Flores-Velásquez et al. (2008). El esquema propuesto consta de ocho pasos que definen la planificación del sistema de PSA más su implementación y monitoreo a futuro.\n\nEl reto de la investigación es generar conocimiento para que los beneficiarios del recurso hídrico de la microcuenca del río Lancetilla (pobladores de los barrios y colonias beneficiarios del agua) podrían estar dispuestos a pagar a los proveedores del servicio hídrico (U-ESNACIFOR) siempre y cuando se compruebe que el servicio ambiental es proveído en cantidad y calidad.','Pago por servicios ambientales, agua, protección de cuencas hidrográficas',2,497,11,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-12 22:17:51'),(222,2,1,'ESTUDIO DE MERCADO DE PRODUCTOS  LÁCTEOS, EN LAS CIUDADES DE LA CEIBA, TELA, TOCOA, OLANCHITO Y COMUNIDADES DE  SAN JUAN PUEBLO, JUTIAPA Y SABÁ','El presente Estudio de Mercado es un aporte de la Carrera de Economía Agrícola de la UNAH ? CURLA, realizado en respuesta a la solicitud planteada  por la Asociación de Ganaderos y Agricultores de Atlántida (AGAA) y del Centro de Desarrollo Empresarial CDE de la Cámara de Comercio e Industrias de Atlántida.\nLa AGAA valorando la competitividad de la industria láctea y el creciente mercado potencial, nacional e internacional ha observado una oportunidad de negocio con la industrialización de la leche, razón por la que sus socios están analizando la posibilidad de incursionar en esta industria, instalando su planta procesadora en la comunidad de Jutiapa.\nAnalizando los resultados de la presente investigación de mercado, observamos que existe una demanda actual y futuramuy significativa de productos lácteos. Del total de 700 personas encuestadas un 99% consumen productos lácteos, en especial leche, mantequilla y queso.\nLa investigación utilizada  fue  descriptiva, cualitativa. Se elaboró un cuestionario como instrumento el que en total comprendía 49 interrogantes.  La encuesta se aplicó en cuatro  ciudades  y tres comunidades  representativas del mercado actual y potencial de productos lácteos. Además se realizó una entrevista semi-estructurada la que fue aplicada a  intermediarios detallistas.\nSe aplicaron en total 700 encuestas: 300 en la ciudad de La Ceiba, 400en las ciudades de Tela, Tocoa, Olanchito y en las comunidades de San Juan Pueblo, Sabá y Jutiapa.\nPara el cálculo de la muestra en la ciudad de La Ceiba se fijó un nivel de confianza de 90%. Se consideró un error del  5%  el cual fue obtenido de otro estudio similar. La muestra en las restantes ciudades y municipios fue realizada utilizando la metodología a conveniencia, debido a  la no disponibilidad de información de la población existente en ellas. El levantamiento de información en las ciudades y comunidades seleccionadas se realizó de forma aleatoria.\nLos resultados del Estudio manifiestan que en los lugares  donde se realizó la investigación existe un mercado amplio que consume leche y derivados lácteos con mayor preferencia a los procedentes de elaboración artesanal.','Estudio de Mercado, Productos lácteos',2,561,11,1,11,1,1,NULL,20,NULL,NULL,NULL,0,0,'2015-06-13 01:09:14'),(223,4,1,'Propiedades químicas y microbiológicas de Sapindus sp. en especies que crecen en la comunidad de Santa Bárbara, Choluteca y El Paraíso, Honduras','Honduras es un país rico en recursos naturales, la diversidad de suelos y los diferentes climas favorecen el desarrollo de un sinnúmero de especies vegetales que se utilizan en la medicina tradicional, como alimento, y muchas de ellas tienen un enorme potencial comercial, pero no se aprovechan de manera sostenible, dependemos directamente de cultivos como el café, cacao y banano, pero se deben buscar otras alternativas que pueden desarrollarse simultáneamente a estos cultivos, como una fuente de ingresos económicos .La información tradicional constituye la base para identificar las plantas con potencial industrial. La especie ?Sapindus  sp? conocida comúnmente como Jaboncillo o pacón, es una especie que crece a lo largo de todo el país, los frutos de esta planta se utilizan como jabón, las hojas se utilizan como repelente y se tiene reportes de que la semilla tiene propiedades larvicidas. Estudios preliminares indican que esta planta es rica en saponinas compuestos que le confieren a esta especie las propiedades surfactantes. No se tienen reportes de estudios taxonómicos, químicos ni microbiológicos sobre las especies que crecen en Honduras. El proyecto tiene como finalidad estudiar las propiedades químicas y microbiológicas y además determinar su capacidad repelente y larvicida contra el zancudo Aedes Aegypti. Al material vegetal procedente de los departamentos de Santa Bárbara, Choluteca y El Paraíso se les realizaron las pruebas de identificación de metabolitos secundarios como ser flavonoides, cumarinas, taninos, antraquinonas, saponinas entre otros, un análisis cualitativo de las muestras usando un cromatógrafo de gases de alta resolución así como el diseño de experimentos en donde se cambiaron variables de tiempo, temperatura, disolvente así como técnica con el objetivo de identificar del proceso de extracción más eficiente para extraer los compuestos químicos presentes . Las propiedades antimicrobianas, repelentes y larvicidas se realizan en la Escuela de Microbiología.','Sapindus, Aedes Aegypti, saponinas, larvicida,',1,395,11,1,11,1,1,NULL,60,NULL,NULL,NULL,0,0,'2015-06-13 02:52:24'),(224,2,1,'Estudio de la actividad solar durante el año 2014','El Sol es la estrella más cerca a nuestro planeta, y es por eso la más estudiada. Muchas teorías de evolución y dinámica estelar se pueden comprobar estudiando el Sol. No obstante, aun siendo la estrella mejor caracterizada, el Sol continúan mostrándose enigmático en algunos aspectos, y por ello se hacen extensos esfuerzos por monitorear y estudiar su comportamiento. El ciclo solar según el modelo undecenal estaría llegando a su máximo entre el 2013 y 2014.  Se esperaba que el ciclo solar numero 24 fuera menos intenso que su predecesor (Brajsa, 2009, Brajsa, 2010, Hathaway & Wilson, 2006). Los resultados de esta investigación comprueban estas predicciones.','solar, manchas solares, OACS, ciclo 24',1,404,11,1,11,1,1,NULL,10,NULL,NULL,NULL,0,0,'2015-06-13 03:26:56'),(225,6,1,'Las Dos Mil Hectáreas al natural UNAH CURLA','El bosque latifoliado de las dos mil hectares, se pretende proporcionar oportunidades para la investigación científica, mantener los ecosistemas naturales y los procesos ecológicos que ahí se sustentan, mantener el régimen hídrico para asegurar el agua en cantidad, continuidad y calidad a las pobladores, preservando el hábitat y especies a través de un manejo sustentable. Ellas posee bellezas escénicas, aguas cristalinas y balneario, rocas monumentales y sitios recreativos es asi como la Universidad Nacional Autonoma de Honduras a traves del Centro Universitario Regional del Litoral Atlántico (CURLA) ha establecido una variedad de ensayos científicos y estudios, entre ellos: Dinámica del bosque latifoliado, fenología del bosque, plantas no maderables, insectos, especies endémicas entre otros. Se han establecido sitios de experimentación y contando una buena interpretación, son de mucho interés para turistas con profunda pasión científica por la naturaleza.','Biodiversidad',2,543,11,1,11,1,1,NULL,10,NULL,NULL,NULL,0,0,'2015-06-13 04:54:46'),(226,4,1,'Estado de la lexicografía en Honduras a finales del XIX','La lexicografía es una disciplina de la lingüística aplicada que se ocupa de la confección de diccionarios, pero los consultantes por lo general,  infieren que los diccionarios son todos iguales, que contienen todas las palabras; que sirven para todo y que son para toda la vida (Maldonado 1998:11) Aun en la docencia universitaria se logra comprobar esto y más: los usuarios no tienen ni la más mínima idea de la tarea lexicográfica y mucho menos del desarrollo histórico de esta disciplina en nuestro país. Así que, este estudio intenta rescatar el contexto histórico de la lexicografía en Honduras a finales del siglo XIX. Gracias a la beca sustantiva otorgada por la DICYP denominada ?América Central en la mirada extranjera: exploradores y viajeros entre 1845 y 1898? demostraremos el significativo aporte de la literatura viajera en la historia de la lexicografía hondureña. Este es el caso de Ephraim George Squier, quien se dedicó a la tarea lexicográfica en zonas inhóspitas lencas como Guajiquiro en el Departamento de la Paz, léxico que hoy forma parte de nuestra historia étnica multilingüe y multicultural.','Lexicografía, léxico, literatura viajera, diccionarios, Honduras.',2,338,11,1,11,2,1,NULL,60,NULL,NULL,NULL,0,0,'2015-06-13 06:14:18'),(227,2,1,'Actitud hacia el uso del celular y sus efectos en el desarrollo del proceso educativo de los estudiantes de Pedagogia,UNAH.','El estudio denominad: \"Actitud hacia el uso del celular y sus efectos en el desarrollo del proceso educativo de los estudiantes de Pedagogia, de la Universidad Nacinal Autonòma de Honduras durante el tercer periodo acadèmico del año 2013\", se considera importante hoy dìa, dado que el celular es un fenòmeno de comunicaciòn a nivel mundial, acortando distancia con personas, en diferentes momentos y en cualquier lugar, y no sòlo por medio de llamadas, tambien por diferentes aplicaciones como las redes sociales y muy usadas por los jòvenes y particularmente por los estudiantes de educaciòn superior y los educandos de la carrera de Pedagogìa no son la excepciòn. sobre todo se ha convertido en el acompañante nùmero uno de ellos en todo momento, y no digamos a la hora de clases, llegando inclusive a poner màs atenciòn a sus mensajes de redes sociales, llamadas, internet que al mismo proceso de enseñanza aprendizaje. La investigaciòn se desarrollarà siguiendo el proceso cientifico de la investigaciòn: Planteamiento del probleam, fundamentaciòn teorica, marco metodologico, resultados del estudio, conclusiones y recomendaciones, referencias consultadas.\n\nHoy  dìa este tema ha tomado mucho interes por los avances de la tecnologia de la informacion y de la comunicacion, exigen mayores competencias, tanto a docentes como a los estudiantes, y no basta  solamente con descodificar informaciòn, sino que hay que lograr la comprensiòn, como parte del desarrollo de las competencias comunicativas del proceso enseñanza-aprendizaje, y que se da durante toda la vida, por lo que no es un proceso acabado por la apertura del ser humano en el conocimiento.\nDe allì  el papel importante que hoy representan los telèfonos celulares, y en este cado en la Educaciòn Superior, cabe mencionar que el celular es un fenòmeno de gran impacto en el entorno, y que atravès  de los tiempos penetra con la mayor fuerza en la sociedad, y màs en los jòvenes que en los adultos, lo que provoca que las compañìas telefònicas crezcan cada dìa màs por la venta de los telèfono. Asi es que la mayorìa de los estudiantes universitarios, hoy dìa en su mayorià cuentan con el suyo y les dà muchos usos tanto personales como acadèmicos y es asì que puede incidir para su èxito o para su fracazo. \n\nPor eso hoy dìa en las instituciones universitariaas se hace explicito una didàctica en la cual el papel del estudiante y del docente se modifica, en este sentido se puede leer el modelo pedagògico de la UNAH, en la pàgina 71 señala que: \" Uno de los pilares bàsicos fundamentales en la educaciòn de los individuos es el aprender a aprender, por consiguiente el docente debe ocuparse de enseñarñe a pensar\", es decir està obligado a estimular el  desarrollo de operaciones mentales como las que señala la Dra. Grajead, 2009: \" Clasificar, analizar, identificar, comparar, sintetizar, codificar, descodificar, diferenciar, representar mentalmente, transformar, proyectar, razonar, esto ùltimo puede ser: divergente, hipotètico, lògico, progresivo\".\nDe todo lo anterior se deduce que el estuiante universitario debe hacer uso de su tiempo y sobre todo hoy dìa en donde el modelo vigente en la UNAH es el constructivista, humanista y crìtico.\n\nLa investigaciòn precisa que las tecnologìas de la comunicaciòn y la informaciòn, aportan grandes avances en el conocimiento y en la comunicaciòn, pero por sus propias caracteristicas pueden conllevar consecuencias psicològicas negativas a los usuarios finales, que son los jòvenes estudiantes universitarios y los adultos, en la incidnecia de la poblaciòn estudiantil de la UNAH, que se ha considerado de suma importancia el reflexionar este tema como investigaciòn dada a  la incidencia en la poblaciòn de estudio.','Celular, dependencia, uso, rendimiento acadmico, actitud, estuiante, dimensin curricular, tecnologas de informacin y comunicacion docente, modelo educativo.',2,369,11,1,11,3,1,NULL,30,'',NULL,NULL,1,0,'2015-06-13 07:45:19'),(228,2,1,'La calidad de la comunicacin y su impacto en la seguridad ciudadana','Esta investigación se desarrolló en la Escuela de Pedagogía de la Facultad de Humanidades y Artes de la UNAH., y resulta de suma importancia por los antecedentes que hay sobre la calidad e la comunicación y la seguridad ciudadana para el desarrollo normal de las actividades de los seres humanos y en particular del desarrollo de las funciones académicas de la UNAH y específicamente de la actividades académicas de la Escuela de Pedagogía. Las autoridades deben estar atentos a las medidas a implementarse, mismas que deben ser convenientes y necesarias para fortalecer la Seguridad Ciudadana dentro del entorno institucional, convirtiendo la academia en un lugar seguro y por ende tiene incidencia directa y positiva en los estudiantes, contribuyendo así el desarrollo normal, del talento humano en forma integral y relacionado directamente con las funciones académicas universitarias en una institución sin violencia asegurando así la integridad física y psíquica.\n\nEste tema tiene  muchas facetas y va más allá de una interpretación estrecha del rol académico de los diferentes programas de desarrollo institucional, implica entonces además la atención a todas las situaciones que se relacionan  con el bienestar estudiantil para su desarrollo  integral como seres humanos y como futuros profesionales, asegurando así un porvenir exitoso al estado hondureño y garantizando por ende el fortalecimiento, político, económico, social e intrínsecamente incidirá a fortalecer el Estado de derecho, (se refiere a vivir en una sociedad en donde existe el respeto y el fiel cumplimiento de la constitución de la República y sus leyes, así mismo garantizar  la funcionalidad de sus operadores de justicia, las instituciones públicas, funcionarios públicos y privados, sociedad civil, etc. En todos los estamentos del estado y en todo sus poderes). La toma de decisiones debe ser siempre en función de garantizar la Seguridad Ciudadana de la Población estudiantil de la UNAH y recordemos a nuestro prócer: José Cecilio del Valle con su pensamiento inmortal: \" La educación es la primera necesidad de una nación\".\n\nEsta investigación se justifica por la necesidad que ha sido manifestada por los estudiantes preocupados por los niveles de inseguridad ciudadana que prevalecen en las instalaciones físicas de la institución a pesar de los grandes esfuerzos que día a día  hacen las autoridades universitarias para contrarrestarlo.\n\nEs un estudio no experimental, transaccional, con un alcance descriptivo, exploratorio y con enfoque cualitativo. \n\nY  pretendiò estudiar la calidad de la comunicación y su impacto en la Seguridad ciudadana en la Escuela de Pedagogía, durante el tercer periodo académico del año 2014.','Autnoma, calidad, canal de comunicacin, comunicacin, conocimiento, corrupcin, delincuencia, delito, derechos humanos, educacin, impunidad, inseguridad, seguridad, seguridad nacional, violencia.',2,369,11,1,11,2,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-13 08:30:00'),(229,5,1,'Situación actual y desafíos para la psicometría en honduras','Los test psicológicos son la principal herramienta con la que trabajan los psicólogos, a pesar de lo cual en Honduras no se le ha prestado la atención científica necesaria que asegure que cumplen con las normas internacionales (The American Educational Research Association AERA; The National Council on Measurement in Education NCME y The American Psychological Association APA).\nActualmente hay un impacto significativo de los test en la población en general, razón por la cual debe prestarse atención con el objetivo de garantizar que dichos instrumentos, efectivamente, cuentan con los requisitos que las agencias internacionales determinan, para que su impacto social sea positivo.\nDe hecho los test constituyen la principal herramienta utilizada por los psicólogos en su ejercicio profesional, sirven para medir o evaluar características psicológicas específicas, bajo el supuesto de que dan evidencia de conductas; no obstante, para que este supuesto sea efectivo requiere asegurar que hay una serie de criterios que se cumplen a la hora construir dichos instrumentos, los criterios principales son la validez y la confiabilidad, y se estipulan en un proceso denominado validación.\nEn el panel los expositores se proponen compartir, los usos actuales que se le esta dando a los test y las tendencias que se están presentando en el desarrollo de la psicometría y los posibles escenarios en los que se va mover esta disciplina en el país. Este análisis permitirá identificar potencialidades y debilidades, en la aplicación en los diferentes campos de la psicología profesional. \nEn el campo educativo permiten evaluar de una forma estandarizada los procesos relacionados con el aprendizaje y las posibles dificultades que se puedan presentar en éste, también es fundamental en las asesorías de elección vocacional pues permiten visualizar las capacidades, aptitudes y preferencias que la persona posee. \nLa Psicología clínica es quizás la más popularmente relacionada con el uso de test, ya sea para la práctica privada o institucional. Los test le permiten al clínico tener una mayor cantidad de información del individuo en un período relativamente corto así como acceder a elementos difícilmente alcanzables por otros métodos, y también proporcionan un perspectiva general con respecto a la forma de funcionamiento predominante en el paciente en determinadas áreas lo que contribuye tanto al proceso de diagnóstico, como al momento de planificar determinada intervención, remisión a otros profesionales o, incluso, al inicio de un proceso de psicoterapia.\nLos test han sido asumidos por los psicólogos como instrumentos que les dan información respecto a las conductas de las personas, no obstante queda la incertidumbre de si efectivamente estos pueden ser usados sin que los mismos hayan sufrido los correspondientes procesos de validación. Aunque son herramientas altamente exhaustivas y rigurosas, no escapan a la cultura y a los efectos de los contextos en los que se utilizan; de hecho, esto obliga a que la Psicología científica en Honduras se vea avocada a realizar procesos de ajuste.','Psicometría, Test,',3,465,11,1,11,1,1,NULL,25,NULL,NULL,NULL,0,0,'2015-06-13 19:03:22'),(230,5,1,'Salud mental sus determinantes y consecuencias','La presente panel aborda los determinantes de la salud mental y en particular de los trastornos mentales, se incluyen no solo características individuales tales como la capacidad para gestionar nuestros pensamientos, emociones, comportamientos e interacciones con los demás, sino especialmente factores sociales, culturales, económicos, políticos y ambientales tales como las políticas nacionales, nivel de vida, niveles de violencia, condiciones laborales o los apoyos sociales de la comunidad. \n\nSe propone que dependiendo del contexto local, algunas personas y grupos sociales corren un riesgo mayor de sufrir problemas de salud mental. Entre estos grupos vulnerables se encuentran  miembros de las familias que viven en la pobreza, las personas con problemas de salud crónicos, los niños expuestos al maltrato o al abandono, los adolescentes expuestos por vez primera al abuso de sustancias, los grupos minoritarios, las poblaciones indígenas, las personas de la tercera edad, personas sometidas a discriminaciones y violaciones de los derechos humanos, los homosexuales, bisexuales y transexuales, los prisioneros o las personas expuestas a violencia, desastres naturales. \n\nSe plantea como las condiciones de pobreza y exclusión social es un ejemplo de un factor, que exacerba el aparecimiento de los trastornos mentales en tiempos en los que hacen recortes presupuestarios, a pesar de que se requiere más programas sociales y de salud mental debido al aumento de las tasas de trastornos mentales y suicidio, así como a la aparición de nuevos grupos vulnerables. Los trastornos mentales están relacionados con la marginación y el empobrecimiento, la violencia y el maltrato doméstico, el exceso de trabajo y el estrés, son factores que suscitan una creciente preocupación por sus efectos en la salud mental de las personas que sufren estas condiciones de vida.\n\nCon frecuencia estos trastornos mentales se convierten en un circuito retroalimentatorio que hunden a las personas y a las familias en la pobreza. La carencia de hogar y la encarcelación son mucho más frecuentes entre las personas con trastornos mentales que en la población general, y exacerban su marginación y vulnerabilidad. Debido a la estigmatización y la discriminación, las personas con trastornos mentales sufren frecuentes violaciones de los derechos humanos, y a muchas se les niegan derechos económicos, sociales y culturales y se les imponen restricciones al trabajo y a la educación, así como a los derechos reproductivos y al derecho a gozar del grado más alto posible de salud. \nPueden sufrir también condiciones de vida inhumana y poco higiénica, maltratos físicos y abusos sexuales, falta de atención y prácticas terapéuticas nocivas y degradantes. A menudo se les niegan derechos civiles y políticos, tales como el derecho a contraer matrimonio y fundar una familia, la libertad personal, el derecho de voto y de participación plena y efectiva en la vida pública, y el derecho a ejercer su capacidad jurídica en otros aspectos que les afecten, en particular el tratamiento y la atención Así, las personas con trastornos mentales suelen vivir situaciones de vulnerabilidad y pueden verse excluidas y marginadas de la sociedad, lo cual representa un importante impedimento para la consecución de los objetivos de desarrollo nacionales e internacionales.','Salud Mental, Trastornos Mentales',3,465,11,1,11,1,1,NULL,25,NULL,NULL,NULL,0,0,'2015-06-13 20:42:10'),(231,5,1,'Aspectos psicosociales en la prevención de la violencia','Honduras es catalogado el país más violentos del mundo, de allí que, según el Observatorio de la Violencia de la Universidad Nacional Autónoma de Honduras, informa que entre 2008 y 2013 se registraron 3,430 homicidios, cuyas víctimas tenían entre 12 y 18 años; el ajuste de cuentas, las riñas interpersonales y la delincuencia común fueron las principales causas de los crímenes, mientras que las armas de fuego y las blancas fueron las más involucradas en los hechos de sangre contra los más jóvenes (IUDPAS, 2014).\nDe lo anterior Interesa rescatar la información relacionada con la delincuencia, en la que algunas veces la adolescencia y juventud se ve involucrada, lo que contribuye a mantener los altos índices de violencia en el país. No resulta fácil establecer las causas determinantes de la violencia en Honduras, estas son múltiples, es una mezcla de pobreza, falta de oportunidades, entre otras, en especial para la juventud (Irías, 2013).\nEn Centro América en general y en Honduras en particular se ha continuado implementando respuestas punitivas dirigidas al encarcelamiento de jóvenes como estrategia principal para enfrentar la escalada de violencia. Se ha usado una estrategia de acoso y persecución hacia los pandilleros (Aguilar y Carranza 2008).  No obstante que poco a poco se hace sentir en las autoridades del país una retórica de la prevención, esta no alcanza a convertirse en políticas e instituciones sólidas en el país.  \nA pesar de que en un número creciente de estudios científicos se demuestra que la violencia puede prevenirse, que en una inversión inmejorable, la OMS plantea que las siguientes intervenciones han demostrado científicamente su efectividad: favorecer relaciones sanas, estables y estimulantes entre los niños y sus padres y cuidadores; fomentar las aptitudes para la vida en los niños y los adolescentes; reducir la disponibilidad y el consumo nocivo de alcohol; reducir el acceso a las armas de fuego y las armas blancas; promocionar la igualdad en materia de género para prevenir la violencia contra la mujer (OMS/UNODOC/PNUD, 2014).\nLa prevención secundaria es entendida como detener precozmente o retardar el progreso de la violencia (o de sus secuelas) en cualquier punto de su aparición, se aplica cuando un evento violento ya ha ocurrido, y su intención es evitar nuevos episodios o disminuir su gravedad (Molina, Dulmus, & Sowers, 2005).\nLa prevención primaria o el detener la violencia antes que ocurra es el enfoque más estratégico, supone trabajar en los diferentes niveles de la sociedad para lograr cambios en las instituciones e implementar intervenciones dirigidas a grupos específicos, y enfoques más generalizados para la población a gran escala (campañas, mensajes en medios de comunicación masivos y otras iniciativas para aumentar la sensibilización).\nSin embargo, hay limitadas evidencias y conocimientos especializados en cuanto a cómo diseñar e implementar estrategias efectivas de prevención primaria y secundaria, amerita un debate científico que rescate los conocimientos que fundamentan las intervenciones más efectivas, a fin de encontrar las más prometedoras, ya que tienen mayor efectividad en el combate a la violencia.','Prevención, Violencia,',3,465,11,1,11,1,1,NULL,25,NULL,NULL,NULL,0,0,'2015-06-13 21:30:03'),(232,5,1,'Salud Mental modelos de atención: posibilidades y limitaciones','Para la OMS (2013) la salud mental es importante, pero queda un largo camino por recorrer hasta que se consiga. Quedan muchos aspectos por resolver, como el descuido de los servicios y la atención a la salud mental o las violaciones de los derechos humanos y la discriminación de las personas con trastornos mentales y discapacidades psicosociales.\nSegún la OMS (2013) los sistemas de salud todavía no han dado una respuesta adecuada a la carga de trastornos mentales; en consecuencia, la divergencia entre la necesidad de tratamiento y su prestación es grande en todo el mundo. En países como Honduras entre un 76% y un 85% de las personas con trastornos mentales graves no reciben tratamiento. El problema se complica aún más por la escasa calidad de la atención que reciben los casos tratados. \nHay escasez de recursos para atender las necesidades de salud mental y los que hay están mal distribuidos y usados ineficientemente. El número de profesionales sanitarios especializados y generales que se ocupan de la salud mental es mani?estamente insu?ciente en los países de ingresos bajos y medios. Tampoco se dispone de políticas, planes y legislación sobre la salud mental.\nSegún un informe realizado por la OMS (2008) En Honduras se observan algunos avances por ejemplo se crearon las Consejerías de Familia para abordar el problema de la violencia intrafamiliar la ?Política Nacional de Salud Mental 2004-2021?, el plan 2021 que impulsa la línea de la salud mental comunitaria y las áreas estratégicas que deben ser implementadas. \nNo obstante hay evidencia que indica que los problemas de salud mental alcanzan altas tasas de prevalencia de trastornos mentales en las poblaciones estudiadas es de 35%, lo que es mayor que en otros estudios internacionales, donde oscila entre el 10 y el 30% (Chirinos, 2002). El problema puede estar en los modelos de atención que en el país se han ensayado por lo que es importante hacer un análisis sistemático y basado en evidencia de los alcances que tiene los enfoques utilizados (Sallis & Owen, 2002).\nLo prevaleciente ha sido el enfoque clínico biologicista que plantea que la salud mental es un fenómeno biológico que se define en oposición a la enfermedad y se caracteriza por ser de manejo individual y asistencialista. Otros enfoques que cada vez cobrar mayor relevancia,  son el enfoque estratégico basado en la salud pública y la participación social tiene la ventaja que toma en cuenta los saberes construidos socialmente y las acciones que se desprenden de esta construcción, se procura el bienestar de los individuos y la colectividad, a través de la provisión de servicios públicos básicos, la optimización del medio ambiente, la inmunización de los individuos, y la construcción de políticas que defiendan los derechos de los ciudadanos.\nEs crucial para enfrentar el desafío de la salud mental en Honduras que se evalué teóricamente de forma analítica y empírica los modelos para orientar la toma de decisiones, la investigación juega un papel fundamental en definir el futuro de estas políticas, que de momento tienen avances poco significativos. Las teorías sobre lo que es salud mental incide en los modelos de atención y enfermedad, hay un debate entre los enfoques biológicos y los sociales, ello se traduce en acciones del Estado y la sociedad civil.','Salud Mental, trastornos mentales, modelos de atención',3,465,11,1,11,1,1,NULL,25,NULL,NULL,NULL,0,0,'2015-06-13 21:50:47'),(233,3,1,'Desarrollo Contrainsurgente y la Lucha Garífuna en la Costa Norte de Honduras','Esta investigación pretende hacer un análisis crítico de la inseparable historia entre los procesos de militarización y desarrollo en las comunidades garífuna de la costa norte de Honduras, señalando cómo las Estrategias de Seguridad Nacional (ESN) estadounidenses y la contrainsurgencia (COIN) formulados en el último siglo han y siguen condicionando estos procesos. En Honduras, esta relación se hace evidente a lo largo de su historia, empezando con la llegada de las corporaciones bananeras para la expansión del dominio geopolítico y económico de EUA en la región centroamericana y caribeña. \n       La estrategia de contrainsurgencia de este momento tiene una estructura basada en el uso de fuerzas especiales de élite y \'nuevos\' elementos como la seguridad privada. La contra-insurgencia que se vive en Honduras también aparece regirse por una lógica de des/estabilización-- de mantener y controlar un estado de excepción perpetua. Esta doble cara de la contrainsurgencia se hace evidente en los casos de la producción de aceite de palma africana, el complejo turístico Indura Beach and Golf Resort y los ZEDE\'s, proyectos son impulsados económicamente y políticamente por instituciones internacionales y el gobierno estadounidense y hondureño. Justificados por su supuesto aporte al desarrollo y seguridad interna del país, siguen la pauta de la nueva ESN estadounidense de Diplomacia, Desarrollo y Defensa. \n	La historia de la contrainsurgencia en Honduras es compleja, pero hay unos constantes que esta ponencia quiere señalar. Primero, que los intereses empresariales y monopólicos de los EUA y la expansión de su dominio militar y económico en América Latina solo son imposibles de separar actualmente, sino que siempre han sido mutuamente dependientes. Segundo, que este militarización se ha entendido desde sus inicios como una forma de guerra irregular, contrainsurgente en la cual el rol del desarrollo es, y siempre ha sido, un eje central. Esto se sigue viendo en la nueva DSN basada en las tres D\'s: Defensa, Desarrollo y Diplomacia. Tercero, que los proyectos de turismo, producción de aceite de palma africana y las ZEDES encajan dentro de este uso contrainsurgente del desarrollo. Por último, se propone una cuarta D, la des/estabilización como elemento esencial de la DSN en práctica en la costa norte para re-asegurar el dominio militar, económico y político estadounidense en la región tanto como en América Latina en general.','EUA, Honduras, Palma Africana, Turismo, ZEDEs, Contrainsurgencia, Desarrollo',2,594,11,1,11,1,1,NULL,10,NULL,NULL,NULL,0,0,'2015-06-16 05:43:13'),(234,4,1,'La actividad de la enzima Colinesterasa en sangre en pobladores expuestos y no expuestos al uso de plaguicidas en la comunidad de La Brea, Lepaterique en el primer trimestre del 2015','Presentación de los resultados obtenidos para determinar los niveles de la enzima colinesterasa en sangre total de pobladores de la comunidad de La Brea, Lepaterique en Francisco Morazán, expuestos y no expuestos al uso de plaguicidas. La idea es presentar los resultados de la encuesta levantada a los pobladores sobre las practicas comunes del uso de plaguicidas, los cursos sobre sus manejos y cuidados que han recibido. De igual forma se pretende exponer sobre las muestras que han sido levantadas y analizadas utilizando el método potenciometrico para colinesterasa en sangre total.','Colinesterasa, Pesticidas, Potenciometría, Lepaterique',1,74,1,1,11,1,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-17 04:14:27'),(235,4,1,'Equidad, Derecho, Medición de desigualdades socioeconónicas en salud, unreto metodologico de epidemilogía para generación de evidencia científica','El proposito de la presente mesa de trabajo pretende contruir u n amplio debate para responder de forma colectiva como mejorar las condiciones de vida de la población hondureña en el marco de los proncipios de igualdad y equidad para evidenciar la falta de cumplimiento al derechoa a la salud a través de la implementación de un metodo epidemiologico como es la medición de las desigualdades en salud en el contexto de los determinantes de salud.','Desigualdades Salud Socioeconomica Equidad Derecho',2,208,9,1,11,1,1,NULL,30,NULL,NULL,NULL,0,0,'2015-06-17 20:31:22'),(236,4,1,'Estudio de la actividad farmacológica  del extracto de Bauhinia monandra en el Departamento de Francisco Morazan en los años 2014 2015.','El proposito de la participación en el congreso es presentar los resultados de la primera etapa del estudio sobre  la experimentación sobre la acción antibacterial que presentan los diferentes extractos obtenidos de la Bauhinia monandra, conocida también como casco de vaca u orquidea del pobre, ya que la revisión de artículos sobre  plantas del genero Bauhinia en otros países habían reportado dicha actividad, con el propósito de poder utilizar dichos extractos como antibióticos naturales  y si es posible extraer y purificar los principios activos y así poder llegar a la preparación de una forma farmacéutica.','Fitoquimica, Extractos, Bauhinia monandra, Actividad antimicrobiana.',2,598,11,1,11,2,1,NULL,25,NULL,NULL,NULL,0,0,'2015-06-18 17:37:15'),(237,1,1,'Marco Académico y Legal para la Transferencia de Resultados de Investigación Científica: sector productivo, social y estatal.','El objetivo de la ponencia es que el conferencista de a conocer la experiencia vivida sobre la Transferencia de los Resultados de Investigación desde la academia hacia los sectores productivo, social y gubernamental en el contexto propio de éste, iniciando con la descripción de los instrumentos normativos con los que la institución debe contar para poder efectivamente, transferir los resultados de investigación con éxito y que genere un impacto positivo en el desarrollo del país. A su vez, explicará cuál es el proceso de transferencia de resultados de investigación, cuáles han sido los retos y cuáles deben ser las metas que una universidad debe proponerse a corto, mediano y largo plazo para lograr esta vinculación. Luego, se hará énfasis en los derechos de propiedad intelectual de los autores o creadores, de manera que no deben percibirse como monopolios del conocimiento generado, sino más bien, para ver en éstos a un aliado que aumente la producción científica de los miembros universitarios, ya que es el estímulo que el sistema ofrece para el surgimiento de ideas creativas que desemboquen en productos, procesos o servicios altamente innovadores, competitivos y provechosos para los diferentes sectores de la sociedad. \n\nFinalmente, los panelistas, deberán complementar la ponencia con sus intervenciones, en donde manifiesten cómo pueden rescatar lineamientos dictados por el conferencista y lograr la transferencia de resultados de investigación científica de acuerdo a las funciones que cada uno lleva a cabo dentro de la institución de Educación Superior.','Transferencia, academia, derechos, normativa, resultados y desarrollo.',3,324,11,1,11,1,1,NULL,50,NULL,NULL,NULL,0,0,'2015-06-19 03:36:05'),(238,2,1,'Radiofarmacia y sus aplicaciones en Honduras','La química nuclear es una rama de la ciencia que tiene sus orígenes a finales del siglo XIX y goza de múltiples aplicaciones a nivel mundial. El presente trabajo pretende ilustrar al lector cuáles son los principios básicos que fundamentan las teorías nucleares. Muestra algunas de las aplicaciones de salud más destacadas en Honduras y la legislación vigente que las rige. Se presenta una revisión bibliográfica sobre los últimos avances referidos a las moléculas radioactivas con aplicaciones terapéuticas.','Isótopos, Radioactividad, Vida Media, Fusión, Fisión, Medicina Nuclear, Radioinmunoterapia, Anticuerpos Monoclonales, Gamma Cámara',1,618,11,1,11,1,1,NULL,300,NULL,NULL,NULL,0,0,'2015-06-19 18:01:06'),(239,2,1,'Estudios farmacológicos preliminares de un derivado de dopamina enfocados al tratamiento de la enfermedad de Parkinson','.La levodopa es el principal fármaco utilizado para tratar esta enfermedad, sin embargo, la pérdida de eficacia tras el uso crónico y las complicaciones motoras han limitado su uso, exponiendo así la necesidad de crear de nuevas entidades terapéuticas para esta enfermedad.El 5-(2-aminoetil)-benzo-1,3-dioxaborol-2-oles molécula con posible actividad sobre sistemas  dopaminérgicos  que  modulan  la  conducta  motora,  esto  probado  en  un modelo de MPTP. El presente trabajo tiene como finalidad fortalecerlos hallazgos previos  relacionados  con  la  conducta  motora,utilizando  un  modelo  de  ratones Aphakia  (deficientes  del  gen  pitx3-/-),además  de  medirlas  concentraciones en cerebro a diferentes tiempos, para confirmar la presencia de esta entidad química en su sitio de acción, el cerebro.Al  evaluar  la  conducta  motora  de  ratones  aphakia  utilizando  como  tratamiento levodopa  y  el  derivado  borado,  se  observó  que  el  derivado  borado  mejoró  la coordinación  motora  de  los  ratones  aphakia,  más  no  así, la  actividad  motora espontánea, en cambio el grupo tratado con levodopa presentó mejoría en ambas capacidades  motoras.El  hallazgo más interesante  es que  a  pesar  de  ser hidrosoluble,el 5-(2-aminoetil)-benzo-1,3-dioxaborol-2-ol atravesó barrera hemato-encefálica y se encontraron concentraciones crecientes con respecto al tiempo en cerebro. El perfil farmacocinético presenta ascenso de la concentración a medida que aumenta el tiempo, pero no se observó el proceso de eliminación; por lo cual es necesario ampliar el tiempo de muestreo para poder determinar los parámetros farmacocinéticos del derivado borado en su sitio de acción.','Farmacologia, Enfermedad de Parkinson, Agonistas Dopaminergicos',2,100,1,1,11,2,1,NULL,300,NULL,NULL,NULL,0,0,'2015-06-19 19:35:15'),(240,5,1,'Desafíos de la Psicología del Deporte en Honduras','Las múltiples exigencias de la competición, el elevado nivel de compromiso personal y la necesidad de rendir siempre al máximo han hecho que la preparación psicológica del deportista se convierta en algo tan necesario como puedan serlo el entrenamiento físico o técnico.\nEn la actualidad el vertiginoso desarrollo del deporte, así como los altos niveles de desempeño son algunos de los componentes que elevan las exigencias al deportista. Para enfrentar este reto se hace necesaria la aplicación de la ciencia al proceso de preparación, como premisa para la obtención de altos rendimientos.\nLa importancia del deporte en el mundo actual ha trascendido al ámbito social, económico e, incluso, político, por encima de lo relativo meramente a su práctica. Con el auge creciente que presenta el ámbito deportivo, resulta sumamente importante potenciar al deportista en todos los aspectos posibles, tomando en cuenta que la preparación psicológica conforma la base, junto a la parte física y técnica, del éxito en los deportes.\nExisten muchos factores que influyen en el desempeño que pueda tener un atleta, dentro de estos se encuentran la preparación física, psicológica, magnitud del evento, problemas personales o familiares, entre otros. Sin embargo, me centro en la parte cognitiva del atleta, esa parte en la cual no se le dedica el mismo tiempo y esfuerzo para entrenar.  (Dosil, 2008)\nEs necesario entonces poder equipar a los deportistas de herramientas, así como lo plantea Márquez (2006): ??es evidente que los atletas que participan en deportes competitivos necesitan emplear habilidades psicológicas y estrategias de afrontamiento efectivas para lograr satisfacer sus expectativas y mejorar su desempeño.?  \nPara lograr la excelencia en el alto rendimiento deportivo es fundamental maximizar todos los recursos disponibles, tanto físicos y técnicos como los mentales. Sólo así se pueden traspasar los propios límites, expandir las capacidades y aspirar a estar  en la cima de la disciplina. (Beltrán, 2010)','Psicología del deporte,',3,465,11,1,11,1,1,NULL,25,NULL,NULL,NULL,0,0,'2015-06-20 05:17:15'),(241,1,1,'Dra suly','Dra suly guatemala','Dra Syly',1,395,11,1,11,1,1,NULL,60,NULL,NULL,NULL,0,0,'2015-06-26 02:32:38');
