ra de la DICYP,  se realizó de forma satisfactoria.',0,2,1,37,'2015-02-17 16:46:01'),(0,0011,01,01,09,02,2015,27,'Jorge... Vaya usted, tengo reunión con el Director de Cultura de 1 a 3 pm, no llegaría a tiempo... Y quien dice que la invitación es para inaugurar? vaya y les tira flores sobre la importancia de que los posgrados compartan con los interesados los especialistas que brindan clases para tratar temas de interés nacional y académico.',2,2,1,65,'2015-02-10 18:43:31'),(0,0011,01,01,09,02,2015,30,'Como recordatorio, ese día (20 de febrero) estará siendo realizada la presentación oficial de la página web.',2,2,1,1,'2015-02-16 13:13:14'),(0,0011,01,01,09,02,2015,33,'Le mandé la nota a Albita para que me confirme si va a asistir al Diplomado y asimismo si la Directora lo va a autorizar dado que son dos semanas a partir de hoy lunes 16 y ella no vino debido al problema de salud de su esposo. Estaré pendiente de enviar nota excusandola con la Jefe de Desarrollo Humano.',2,2,1,47,'2015-02-16 20:58:56'),(0,0011,01,01,09,02,2015,44,'Información remitida por el Depto de G&amp;C: Grupo de Investigación, becas otorgadas, proyectos financiados por CSUCA-COSUDE, Ponencias, REBICAMCLI e investigadores individuales.',2,2,1,24,'2015-02-17 20:23:48'),(0,0011,01,01,10,02,2015,29,'Estimado Dr., Amador, adjunto mi opinión',0,2,1,39,'2015-02-17 21:02:39'),(0,0011,01,01,10,02,2015,35,'Estimado Dr., le adjunto las observaciones que considero importantes',0,2,1,39,'2015-02-17 20:17:28'),(0,0011,01,01,11,02,2015,34,'Leí detenidamente la carta wde Ortega y lo que pide es transformar los dos financiamientos completos en cuatro financiamientos parciales (viáticos)... Adelante con ello María Elena, el punto es que debe verse cuantos días se pueden financiar....',2,2,1,65,'2015-02-23 14:24:14'),(0,0011,01,01,11,02,2015,48,'Estimada jefa, el informe ya esta elaborado e incluye gráficos relevantes y algunas fotografias estratégicas, todo relacionado a los logros 2014, en estos momentos se esta revisando detalles de forma. El informe enuncia todo lo realizado alrededor de 8 años, pero resalta los logros del 2014, esto con el fin de mostrar que la agenda es continua y que responde a lineas estratégicas.\nPd. la estrucutura del informe es igual a la del año pasado (2013) que fue aprobada por usted.',2,2,1,33,'2015-02-17 19:52:41'),(0,0011,01,01,16,02,2015,42,'Seminario impartido por el Departamento de Proyectos el 20/II/2014 a las 8 a.m.',0,2,1,24,'2015-02-21 08:06:19'),(0,0011,01,01,16,02,2015,53,'Agendada la reunión.',0,2,1,35,'2015-02-18 16:28:08'),(0,0011,01,01,18,02,2015,58,'La capacitación es solamente para personal de la DICYP, Departamento de Proyectos, Política de Investigación, Desarrollo Curricular, Documentación, Evaluación y Propiedad Intelectual.',0,2,1,37,'2015-02-21 14:02:08'),(0,0016,01,01,17,02,2015,59,'Desde el año pasado estamos en contacto con la DEGT gestionando cada semana las licencias y tenemos ya  20 diás que las.licencias han evencido en algunas computadoras de la Dirección, la opción  de hacer copias de respaldo se ha hecho pero es una medida transitoria, tambien se probo instalar una  versión free en una pc y funciona bien. Pédí a  Dan y David  mas opciones para mejorar esta situacíón.',2,2,1,33,'2015-02-23 03:00:49'),(0,0017,01,01,05,02,2015,15,'Termiando, contestado y enviado por correo a Jorge , en proceso de revision.',2,2,1,23,'2015-02-17 21:27:07'),(0,0017,01,01,17,02,2015,49,'Se notificará con oficio que se extiende plazo para entrega de documento del proyecto pero no como carga académica.',2,2,1,35,'2015-02-23 14:23:01'),(0,0017,01,01,17,02,2015,50,'Se notificará con oficio que se le extiende plazo para entrega del proyecto pero no como carga académica.',2,2,1,35,'2015-02-23 14:19:03'),(0,0022,01,01,02,02,2015,16,'Se agendarán fechas de sesión de Consejo Universitario, con el entendido de que se asignarán fechas con los distintos jefes de departamento, tal como lo ordenó la Directora de la DICYP.',0,2,1,37,'2015-02-17 1