e la UNAH y que debe establecer de donde saldrán los recursos porque la UNAH no pondrá recursos para ello....',2,2,1,65,'2015-03-04 16:41:32'),(148,0011,01,01,03,03,2015,108,'Iniciar proceso y asegurar seguimiento al proceso....',2,2,1,65,'2015-03-04 16:51:55'),(149,0011,01,01,03,03,2015,107,'Este oficio solo manifiesta que fue recibido pero quiero que averigüen por qué demoró tanto en llegar al destinatario: Es un problema de secretaría o es un problema del departamento que comunica????',2,2,1,65,'2015-03-04 16:55:36'),(150,0011,01,01,25,02,2015,106,'Buen día, conforme a sus instrucciones, le adjunto el borrador de la nota para contestar al Decano de la Facultad de Ciencias Médicas en lo referente a la aprobación de una nueva maestría en Epidemiología sin antes contar con la aprobación del Consejo Universitario, para su conocimiento y demás,',0,2,1,39,'2015-03-04 17:03:43'),(151,0011,01,01,11,02,2015,48,'El informe fue enviado con oficio No. 253-DICyP.',0,2,1,33,'2015-03-04 17:04:08'),(152,0011,01,01,03,03,2015,109,'Por un correo del que recibí copia, me fijé que le había dicho a los jefes que asistan todos... Recuerde que para hacer eso hay que remitirlo por esta víay de esa forma, yo me entero que hay una acción y yo no inicio otra....',2,2,1,65,'2015-03-04 17:08:46'),(153,0011,01,01,03,03,2015,110,'Resolver con urgencia.... no estoy segura del significado de ese acuerdo del Consejo Universitario, pero a) Si es que el Consejo General de Posgrados detalle los criterios de excepcionalidad o b) Si en cada caso, deben reunirse para dictaminar.... En función de ello: instruya para que elaboren un Manual que regulará el procedimiento a seguir por cada posgrado con el dictamen nuestro, ahí debe indicarse los detalles en docencia, investigación, expediente laboral.... para que luego nosotros dictaminemos en el caso de los profesores que ahí se indican... Ojo con esto, después lo hablamos con cada coordinador antes de convocarlos a reunión a mi regreso. Necesito un manual