P y Rectoria en cuanto a la jornada de trabajo. Seria importante programar una reunión para discutir su contenido.',2,2,1,29,'2015-03-06 02:22:55'),(180,0017,01,01,05,03,2015,118,'Contestar conforme reglamento y explicar que se presentara un proyecto que hace diferentes formas de ingreso.',2,2,1,29,'2015-03-06 02:24:57'),(181,0011,01,01,05,03,2015,119,'Luis, Marco, Iving, Karla,Alberto y Lesbia...... Les tocó la lotería!! Quedan constituidos en Comisiøn para entrarle a la tarea asignada por el Consejo Universitario de formar parte de la Comisión Estratégica que formulará propuestas para sacar a flote el CURVA en Olanchito, tocándonos a nosotros: El Plan de Fortalecimiento, capacitación, registró, monitoreo, acompañamiento y evaluación de actividades de Investigaciøn en el Centro y los alrededores que conforman la región. Les pido destinar dos semanas para dos cosas: 1) poner a un equipo de apoyo de sus departamentos a recoger todo lo que haya en la Vra., Junta de Dirección Universitaria y demás, sobre diagnósticos de la zona (actividades productivas, poblaci?n, oferta y demanda de educación superior, etc) y del centro ( cantidad de profesores, grados académicos, disciplinas, categorías, carreras), 2) Reunirse para conocer muy bien lo que pasa en el Centro y en la región. Luego, destinar otras dos semanas para elaborar un plan a dos..',2,2,1,65,'2015-03-06 03:45:02'),(182,0011,01,01,05,03,2015,119,'... elaborar un plan de promociøn de la investigación cient?fica (capacitación por diplomado o cursos, formulación y gestiön de proyectos de investigación), cursos de alto nivel/ actualización disciplinar a nivel de posgrado, montaje de la estructura de investigación básica: unidades de gestión, grupos de investigación, observatorios y, por supuesto la Coordinación Regional de Investigación ( incluir capacitación de 5 días en Tegucigalpa para que administre eficientemente el Plan), no estoy segura de que haya posibilidades de impartir un posgrado pero sí de desarrollar cursos de posgrado para elevar el nivel profesional y académico de los egresados... Solamente después de hacer esto podemos pensar en desarrollar un taller d dos días completos para presentarles el Plan y discutir con ellos la factibilidad y viabilidad del mismo. Queda a cargo Luis. Al regreso quiero una reunión para ver avances en el conocimiento y contextualización del Centro....',2,2,1,65,'2015-03-06 03:55:49'),(183,0011,01,01,05,03,2015,119,'Preside Luis: Doble premio.......',2,2,1,65,'2015-03-06 04:05:32'),(184,0011,01,01,26,02,2015,116,'Lo que procede en este caso es una ofensiva académica, en la parte laboral no pueden hacer nada hasta que se concrete una posición oficial al respecto.... Quise iniciar esa ofensiva enviando el documento de justificación académica que diferencie la Gestiøn académica de la gestión administrativa pero cuando revisé la última versión me dí cuenta del estado lamentable en que se encontraba, razón por la cual le he pedido a José que le de una revisiøn de fondo antes de que Leda lo edite y Karol lo diagrame porque no vuelvo a revisar un documento en condiciones poco profesionales. La última versión es la que le mandé yo a José... Una vez que esté presentable de fondo y forma, le pediré una reunión a Jacinta para hablar del tema y otra a la rectora para finiquitar el tema.. Una tercera línea de trabajo será la Vicerrectora Académica pero eso lo veremos después... Iniciaremos con el env?o del documento a todas las instancias de decisiøn con una introducciøn mia comparando el trabajo de los ...',2,2,1,65,'2015-03-06 04:17:28'),(185,0011,01,01,26,02,2015,116,'.... Comparando el trabajo de los docentes que dan clases con el trabajo de los docentes que trabajan en nuestra Dirección.... Incorporaré en la introducciøn lo de la intensidad de la fuerza de trabajo ( en eso somos buenos los sociølogos con influencias económicas) y el hecho de que la Unah les paga a los docentes que dan clases por 25 horas a la semana y trabajan únicamente 15. Y a los docentes de nuestra Dirección ( no defenderé a las otras Direcciones) se les paga por 25 y trabajan 25 y hasta 30.... Me consta que algunos hasta 40...!!',2,2,1,65,'2015-03-06 04:24:51'),(186,0011,01,01,04,03,2015,117,'Qué procede Jorge?? Me preocupa que aún no se ha presentado al Consejo de ES a teavés de la DES... Podemos autorizar que inicien el proceso mientras se completa el proceso de aprobación en el CES.... Iving puede averiguar qué falta de la documentación de la Guía para irla consiguiendo... Tenemos que acelerar porque si termina el curso y no se ha aprobado.... Arde Troya....',2,2,1,65,'2015-03-06 04:29:26'),(187,0017,01,01,23,02,2015,82,'Se envió oficio No. 251-DICYP con fecha 26 febrero de 2015, otorgándole prórroga para entrega de Informe.\nSe adjunta oficio',0,2,1,35,'2015-03-10 14:18:32'),(188,0017,01,01,17,02,2015,49,'Se le extendió prórroga para entrega de informe hasta el 8 mayo 2015 mediante oficio No. 227DICYP con fecha 23 febrero de 2015, se adjunta oficio.',0,2,1,35,'2015-03-10 14:22:16'),(189,0017,01,01,17,02,2015,50,'Se otrogó prórroga para entrega de informe hasta el 8 de mayo de 2015, mediante oficio No. 226 con fecha 23 febrero de 2015.\nSe adjunta oficio.',0,2,1,35,'2015-03-10 14:25:22'),(190,0017,01,01,25,02,2015,121,'¿Que paso alli?¿como queda el grupo?',2,2,1,29,'2015-03-10 14:56:42'),(191,0011,01,01,09,03,2015,128,'Lo nacional y académico se turna a la VRA, y todo lo internacional para la VRI ¿porque se remitió a la Secretaría General?',2,2,1,29,'2015-03-10 14:59:14'),(192,0011,01,01,04,03,2015,122,'Tomar nota, que se procesen, se revisen cuales de ellos corresponden a investigación y posgrado y se usen en la página web',2,2,1,29,'2015-03-10 15:00:47'),(193,0011,01,01,06,03,2015,123,'Revisar, analizar y responder',2,2,1,29,'2015-03-10 15:02:21'),(194,0011,01,01,05,03,2015,124,'Ratifiquele la posición legal',2,2,1,29,'2015-03-10 15:03:38'),(195,0017,01,01,06,03,2015,127,'Iving ¿es un grupo de investigación? revisar y notificar si 