reo de todo el proceso, las veces que se ha dictaminado y, sobre todo, los errores en la formulación. Quiero una respuesta contundente: y me mandan copia.... Es importante hacerlo.... Antes de las 10 am...',2,2,1,65,'2015-05-23 13:55:40'),(742,0011,01,01,06,04,2015,228,'El programa de posgrado que se pretende desarrollar se enmarca en la modalidad indicada en el Artículo 4. Literal b del Reglamento para la Aprobación y Desarrollo de Planes de Estudios de Grado y Posgrado en Convenio con Universidades Extranjeras por lo que ?deberá seguirse el procedimiento ya establecido en el Reglamento General de la Ley de Educación Superior y demás normativa aplicable a un programa nuevo?. \nSe remite oficio adjunto explicando que procede que la Facultad de Ciencias Médicas, previo a la negociación de los convenios que establezcan la colaboración entre universidades, avance en el proceso regular de aprobación de un programa de posgrado de acuerdo a los estipulado en la normativa aplicable. \nPara esto, deberán avocarse al Departamento de Desarrollo Curricular de la DICYP para dar inicio a dicho proceso.',0,2,1,24,'2015-05-25 20:13:53'),(743,0017,01,01,06,04,2015,220,'Se desestima la solicitud de modificación presupuestaria mediante oficio adjunto.',0,2,1,24,'2015-05-25 20:24:54'),(744,0017,01,01,08,04,2015,240,'Se desestima solicitud de modificación presupuestaria mediante oficio adjunto.',0,2,1,24,'2015-05-25 20:29:09'),(745,0011,01,01,14,04,2015,269,'Se integra el Dictamen de la JDU al dossier de IARPACUNA remitido a CU por la Secretaría Ejecutiva del CGI mediante oficio N°003-SECGI-15 del 18 de mayo de 2015 (adjunto)',0,2,1,24,'2015-05-25 20:33:01'),(746,0017,01,01,20,05,2015,378,'La investigación deriva de beca sustantiva #02-2013, de la II convocatoria de 2013, la cual está en proceso de finalización.',2,2,1,35,'2015-05-25 20:33:09'),(747,0011,01,01,26,02,2015,93,'Se cuenta con los necesarios dictámenes positivos de las diferentes instancias que se integra  al dossier de IAR