INSERT INTO `gip_modulos` (`cod_direccion`, `cod_modulo`, `modulo`, `ruta`, `orden`, `descripcion`, `imagen`, `activo`, `user_insert`, `date_insert`) VALUES (1,1,'Profesionales','/mod_servicios/ui/ros_seleccionar_actividad.php',1,'Convocatoria para la prestación de servicios ocasionales relacionados con investigación científica y posgrados.','profesionales.JPG',1,1,'2014-10-21 20:55:51'),(1,2,'Becas','/mod_becas/ui/bec_mis_proyectos.php',2,'Motivar a los profesores de la UNAH a que se integren a los procesos de investigación sobre ciencia, tecnología e innovación y sobre la realidad universitaria y nacional, fortalecer las iniciativas de los profesores en el campo de la investigación, desarrollar las prioridades de investigación científica que se ha propuesto la UNAH y estimular a los estudiantes para desarrollar proyectos de investigación científica, tecnológica o de innovación.','becas.JPG',1,1,'2014-10-21 20:55:51'),(1,3,'Registro de Investigadores','/mod_catalogo_investigadores/ui/index.php',3,'El Catálogo de Investigadores es una publicación que la Dirección de Investigación Científica y Posgrado publica cada tres años, con el propósito de seguir en el proceso de identificación de todos los investigadores de la UNAH en las distintas áreas del conocimiento y en los diferentes centros regionales para dar a conocer su ubicación institucional y física, su trayectoria como profesor, sus líneas de investigación y sus publicaciones científicas.','investigadores.JPG',1,66,'2015-01-28 16:17:17'),(1,4,'Congresos','/mod_congresos/ui/index.php',4,'El Congreso es un evento académico de alto nivel científico en el que se reúnen investigadores, profesores, directores de institutos y unidades de investigación, coordinadores regionales de investigación y profesionales expertos en el tema, para presentar y debatir ponencias, dictar conferencias, participar en mesas redondas o en paneles de comentaristas y compartir inquietudes con expertos nacionales e internacionales en las diversas áreas del conocimiento.','congreso.JPG',1,1,'2015-03-12 20:19:31');
