--
-- Table structure for table `ros_detalle_educacion_superior`
--

DROP TABLE IF EXISTS `ros_detalle_educacion_superior`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ros_detalle_educacion_superior` (
  `cod_consultor` int(11) NOT NULL,
  `cod_educacion_superior` int(11) NOT NULL,
  `institucion` varchar(150) NOT NULL,
  `cod_grado` int(11) NOT NULL,
  `cod_estado_titulo` int(11) NOT NULL DEFAULT '4',
  `titulo_obtenido` varchar(150) NOT NULL,
  `cod_pais` int(11) NOT NULL,
  `cod_departamento` int(11) NOT NULL,
  `cod_municipio` int(11) NOT NULL,
  `cod_ciudad` int(11) NOT NULL,
  `periodo` varchar(150) NOT NULL,
  `activo` tinyint(1) NOT NULL DEFAULT '1',
  `date_insert` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`cod_consultor`,`cod_educacion_superior`),
  KEY `fk_ros_educacion_superior_geo_departamentos_idx` (`cod_pais`,`cod_ciudad`),
  KEY `fk_ros_educacion_superior_ug_grado_titulo_obtenido_idx` (`cod_grado`),
  KEY `fk_ros_educacion_superior_geo_ciudades_idx` (`cod_ciudad`),
  KEY `fk_educacion_superior_maestro_consultores_idx` (`cod_consultor`,`cod_educacion_superior`),
  KEY `fk_ros_educacion_superior_geo_ciudades_idx1` (`cod_pais`,`cod_departamento`,`cod_municipio`,`cod_ciudad`),
  KEY `fk_ros_educacion_superior_ros_estado_titulo_idx` (`cod_estado_titulo`),
  CONSTRAINT `fk_ros_educacion_superior_geo_ciudades` FOREIGN KEY (`cod_pais`, `cod_departamento`, `cod_municipio`, `cod_ciudad`) REFERENCES `geo_ciudades` (`cod_pais`, `cod_departamento`, `cod_municipio`, `cod_ciudad`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_ros_educacion_superior_ug_grado_titulo_obtenido` FOREIGN KEY (`cod_grado`) REFERENCES `aca_grados_titulo` (`cod_grado`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_ros_estados_titulo` FOREIGN KEY (`cod_estado_titulo`) REFERENCES `ros_estados_titulo` (`cod_estado_titulo`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

