DROP TABLE IF EXISTS `ros_parientes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ros_parientes` (
  `cod_consultor` int(11) NOT NULL,
  `cod_pariente` int(11) NOT NULL,
  `primer_nombre` varchar(120) NOT NULL,
  `segundo_nombre` varchar(120) NOT NULL,
  `primer_apellido` varchar(120) NOT NULL,
  `segundo_apellido` varchar(120) NOT NULL,
  `cod_parentesco` int(11) NOT NULL,
  `oficina` varchar(120) NOT NULL,
  `activo` tinyint(1) NOT NULL DEFAULT '1',
  `date_insert` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`cod_consultor`,`cod_pariente`),
  KEY `fk_ros_detalle_parientes_ros_informacion_personal1_idx` (`cod_consultor`),
  KEY `fk_ros_parientes_ug_parentescos_usuarios1_idx` (`cod_parentesco`),
  KEY `fk_ros_maestro_consultores` (`cod_pariente`),
