nto solicito cancelarlo.','../../mod_soporte/adjuntos/2_45_2014-12-11_',45,'2014-12-11 18:22:36'),(11,47,2,'La usuaria Bessy Bonilla solicita soporte','Bessy Bonilla ingresó solicitud de permiso pero fue denegada por no adjuntar la constancia, ella explicó que al intentar adjuntarla el sistema no lo adjunto y aparece como no adjunto','../../mod_soporte/adjuntos/2_47_2015-01-22_',47,'2015-01-22 17:22:12'),(12,19,2,'Cancelación de permiso 147','No realice el tramite por no contar con toda la documentación. Solo utilice una hora para ir y venir del TSC','../../mod_soporte/adjuntos/2_19_2015-03-06_',19,'2015-03-06 17:03:42'),(13,11,2,'Eliminación de la ficha No. 12 de Chummy Uclés Brevé','Buen día, les agradeceré eliminen la ficha No. 12 de Chummy Uclés Brevé ya que fue ingresada para pruebas del sistema. \n\nSaludos','../../mod_soporte/adjuntos/2_11_2015-03-13_',11,'2015-03-13 17:13:22'),(14,11,2,'Usuario con problema para ingresar a la base de datos de pro','Buen día, la catedrática Lourdes de Madrid no puede ingresar al sistema con el usuario y la clave que le fue enviada a su correo.  Al digitar sus datos solamente se pone en rojo el botón de ingresar pero no le permite el acceso. Adjunto documento con las pantallas del problema reportado. le agradeceré me informe una vez resuelto para contactar al usuario y darle seguimiento.\n\nMil gracias!','../../mod_soporte/adjuntos/2_11_2015-03-24_',11,'2015-03-24 17:11:11'),(15,25,1,'incapacidad Dr sanchez','Incapacidad Dr Sanchez. Favor enviarla a Lic Lesbia Buitrago y Lic Ninoska Navarro','../../mod_soporte/adjuntos/1_25_2015-04-09_C:\\fakepath\\20150409_090704.jpg',25,'2015-04-09 16:01:17'),(16,16,2,'Cancelacion de permisos','Porfavor cancelar los permisos 196,197,198','../../mod_soporte/adjuntos/2_16_2015-04-28_',16,'2015-04-28 14:55:50'),(17,16,2,'Cancelacion de permisos','Porfavor cancelar los permisos 196,197,198','../../mod_soporte/adjuntos/2_16_2015-04-28_',16,'2015-04-28 14:55:52');
