INSERT INTO `ug_noticias` (`cod_noticia`, `titulo`, `contenido`, `fecha_inicio`, `fecha_fin`, `clase`, `imagen`, `activo`, `user_insert`, `fecha_insert`) VALUES (1,'Dirección del Sistema de Estudios de Posgrado (DSEP)','<strong>Misión</strong></br></br>Somos la instancia de gestión académica que asegura la formación de profesionales del más alto nivel académico y de investigadores en todas las áreas del conocimiento, impulsando carreras de posgrados tradicionales e innovadores, asegurando la calidad, cantidad y pertinencia, para que se articulen con la investigación científica y tecnológica, la vinculación con los sectores estatal, social y productivo, y promoviendo la gestión de la calidad con fines de mejora continua y con miras a la acreditación regional.</br></br><strong>Visión</strong></br></br>Al 2018, ser la instancia de gestión de los posgrados de la UNAH que responde a las tendencias y desafíos de la educación superior nacional, regional e internacional, mediante una excelente gestión académica, administrativa y financiera, con una oferta de posgrados tradicional e innovadora, acreditada y reconocida como referente académico de prestigio que forma profesionales e investigadores de alto nivel. </br></br><strong>Valores</strong></br></br>   - Pertinencia</br>      - Comunicación</br>      - Inclusión</br>      - Objetividad</br>      - Servicio</br>','2014-09-17 14:00:00','2014-09-17 14:00:00','event-success','mod_noticias/adjuntos/DICyP.jpg',0,1,'2014-09-17 21:13:06'),(2,'Dirección de Investigación Científica (DICU)','<strong>Misión</strong></br></br>Somos una Dirección académica responsable de la gestión general de la investigación científica y tecnológica de la UNAH, promoviendo, fortaleciendo y dando seguimiento a la investigación científica y tecnológica, y a los resultados derivados de esta en todas las áreas del conocimiento que desarrolla la UNAH, propiciando su articulación con la docencia, tanto en el grado como el posgrado, y su vinculación con la sociedad. Nuestro compromiso es consolidar una estructura de investigación en la universidad, capaz de contribuir al desarrollo sostenible del país por medio de la promoción y ejecución de una política de investigación que mejore la cantidad, calidad y pertinencia de la investigación científica y tecnológica; y la calidad de la enseñanza de la investigación en grados y posgrados; y que fortalezca la gestión interna, regional, nacional e internacional de la investigación. </br></br><strong>Visión</strong></br></br>Ser la instancia de excelencia regional en gestión de la investigación, protagonista en la consolidación del sistema de investigación científica y tecnológica de la UNAH, posicionándose con liderazgo nacional y regional en cuanto al fomento de la investigación, formación inicial y permanente de investigadores, protección de resultados de investigación, publicación, difusión y comunicación de resultados de investigación y gestión de la investigación. </br></br><strong>Valores</strong></br></br>   - Responsabilidad</br>   - Equidad</br>   - Honestidad</br>   - Ética</br>   - Integridad</br>   - Confiabilidad</br>   - Transparencia y Rendición de cuentas</br>','2014-09-17 14:00:00','2014-09-17 14:00:00','event-success','mod_noticias/adjuntos/DICyP.jpg',0,1,'2014-09-17 21:03:26'),(3,'Sistema de seguimiento de actividades de investigación y posgrado','Es un conjunto de módulos informáticos integrados, para la planificación, gestión, control, evaluación y rendición de cuentas de las actividades de la Dirección, es decir, constituye un sistema de gestión relacionada con el registro, orientado a reemplazar el flujo de papeles por el flujo de información computarizada, permitiendo que cada usuario, en el departamento o unidad  en la cual está adscrito, alimente la información una sola vez y en tiempo real en el sistema, para lo cual deberán contar con una clave de acceso que tendrá un nivel de responsabilidad la cual le permitirá desarrollar la labor asignada de acuerdo a su perfil de puesto en los procedimientos relativos  a sus funciones.','2014-09-17 14:00:00','2014-09-17 14:00:00','event-success','mod_noticias/adjuntos/DICyP.jpg',0,1,'2014-09-13 01:41:18'),(4,'Bienvenidos','Gracias a las facilidades que la tecnología brinda actualmente y motivados en el avance óptimo de nuestras actividades, la Dirección de Investigación Científica y Posgrado tiene la satisfacción de darles la bienvenida a nuestro nuevo Sistema Web DICyP. </br></br>Estamos conscientes de que es un nuevo proceso y que conforme vaya consolidándose y evolucionando, nuestro desempeño y capacidades de DICyP serán un factor clave en el éxito como equipo de trabajo. </br></br>Sean bienvenidos a una nueva etapa en nuestra Dirección.','2014-09-17 14:00:00','2014-09-17 14:00:00','event-success','mod_perfil_usuario/fotos_usuarios/LS.png',0,1,'2014-09-13 01:41:18'),(5,'Taller de Socialización de Manuales e Instructivos','Dirigido a:  Grupos, unidades e institutos de investigación\nFecha: miércoles 15 de octubre de 2014\nHora: 8:30am a 11:30am\nLugar: Aula de clases de POSCAE, edificio F1, tercer nivel','2014-10-14 14:52:13','2014-10-14 22:00:00','event-special','mod_noticias/adjuntos/DICyP.jpg',0,6,'2014-10-14 14:52:13'),(6,'Taller de Socialización de Manuales e Instructivos','Dirigido a: Grupos, unidades e institutos de investigación \r \r</br> Fecha: miércoles 15 de octubre de 2014\r \r  </br>Hora: 8:30am a 11:30am \r \r </br>Lugar: Aula de clases de POSCAE, edificio F1, tercer nivel','2014-10-15 14:30:00','2014-10-15 17:30:00','event-special','mod_noticias/adjuntos/DICyP.jpg',0,6,'2014-10-14 14:54:03'),(7,'Taller de Socialización de Manuales e Instructivos','<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]-->\n\n<p class=\"MsoNormal\"><b>Dirigido a:</b> Grupos, unidades e institutos de investigación&nbsp;</p><p class=\"MsoNormal\"><br>\n<b>Fecha:</b> miércoles 15 de octubre de 2014 <br>\n<b>Hora: 