  `cod_estatus_migratorio` int(11) DEFAULT '1',
  PRIMARY KEY (`cod_usuario`,`cod_modulo`),
  KEY `fk_ug_usuarios_externos_ug_modulos1_idx` (`cod_modulo`),
  KEY `fk_cod_tipos_documentos_identificacion_ug_usuarios_externos_idx` (`cod_documento_identificacion`),
