  CONSTRAINT `fk_ug_modulos_ug_usuarios_externos` FOREIGN KEY (`cod_modulo`) REFERENCES `ug_modulos` (`cod_modulo`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_ug_nacionalidades_ug_usuarios_externos` FOREIGN KEY (`nacionalidad_origen`) REFERENCES `ug_nacionalidades` (`cod_nacionalidad`) ON DELETE NO ACTION ON UPDATE NO ACTION,
