  CONSTRAINT `fk_ug_usuarios_ug_usuarios_externos` FOREIGN KEY (`user_insert`) REFERENCES `ug_usuarios` (`cod_usuario`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
